INSERT INTO `tbl_cms` VALUES (1,1,'About Us','<p><strong><span style=\"color: #ff0000;\">About Pakodi</span></strong></p>\n<p>Gone are the days when conversations were boring and prosaic talkfests.</p>\n<p><br /> Chats with loved ones and friends have taken on new life today with the advent of clever apps. Now, the stronger the &lsquo;X&rsquo; factor in conversations, the smarter the perception about the speaker.</p>\n<p>Pakodi is a one-of-its-kind discovery platform for witty one- liners, cinema dialogues, comedy clips and anything else that one can dream of. You can now send audio clips, record videos and dub over them with movie or sound clips. Pakodi lets you share all these over social media platforms like Whatsapp, Google+, Facebook, Twitter, etc.</p>\n<p>&nbsp;</p>',1,'2015-06-25 06:37:31'),(2,1,'Terms and Conditions','<p style=\"background: #ffffff; line-height: 100%; margin: 0.05cm 0.26cm 0.05cm 0.26cm;\" align=\"JUSTIFY\"><span style=\"font-size: small;\">These terms of service (as updated from time to time, the &ldquo;</span><span style=\"font-size: small;\"><strong>Terms</strong></span><span style=\"font-size: small;\">&rdquo;) govern your access to and use of the </span><span style=\"font-size: small;\"><strong>Pakodi</strong></span><span style=\"font-size: small;\"> Service (as defined below) and any sound recordings, videos, information, text, graphics or other content materials uploaded, downloaded or appearing on the Service. Please read these Terms carefully before downloading or using the Service. By accepting these Terms, or using the Service, you agree to be bound by them. If you do not understand the Terms, or do not accept any part of them, then you should not use the Service. The Service is provided by Sprint Apps Private Limited (&ldquo;</span><span style=\"font-size: small;\"><strong>we</strong></span><span style=\"font-size: small;\">&rdquo;, &ldquo;</span><span style=\"font-size: small;\"><strong>us</strong></span><span style=\"font-size: small;\">&rdquo; &ldquo;</span><span style=\"font-size: small;\"><strong>our</strong></span><span style=\"font-size: small;\">&rdquo; and &ldquo;</span><span style=\"font-size: small;\"><strong>SprintApps</strong></span><span style=\"font-size: small;\">&rdquo;) whose place of business is at Hyderabad, India (email:&nbsp;</span><a href=\"mailto:contact@sprintapps.in)\"><span style=\"color: #00000a;\"><span style=\"font-size: small;\">contact@sprintapps.in)</span></span></a><span style=\"font-size: small;\">.</span></p>\n<p style=\"background: #ffffff; line-height: 100%; margin: 0.05cm 0.26cm 0.05cm 0.26cm;\" align=\"JUSTIFY\"><span style=\"font-size: small;\"><strong>1. The Service</strong></span></p>\n<p style=\"background: #ffffff; line-height: 100%; margin: 0.05cm 0.26cm 0.05cm 0.26cm;\" align=\"JUSTIFY\"><span style=\"font-size: small;\">The Service is offered as mobile application &ldquo;</span><span style=\"font-size: small;\"><strong>Pakodi</strong></span><span style=\"font-size: small;\">&rdquo; which is available in Android &amp; IOS Versions </span></p>\n<p style=\"background: #ffffff; line-height: 100%; margin: 0.05cm 0.26cm 0.05cm 0.26cm;\"><span style=\"font-size: small;\"><strong>2. Alterations and Updates</strong></span></p>\n<p style=\"background: #ffffff; line-height: 100%; margin: 0.05cm 0.26cm 0.05cm 0.26cm;\"><span style=\"font-size: small;\">2.1. We may update these Terms from time to time to reflect any changes: (i) in our policies or relevant laws; (ii) in the functionality of the Service; or (iii) imposed on us by any third party suppliers. Any updates will take into account your reasonable interests in the Service and will be notified to you by email within a reasonable time before the change takes effect. Changes will not apply retrospectively and the updated Terms will become effective after they are notified to you. If you do not agree with the updated Terms you should stop using the Service. If you do not object to the updated Terms within a reasonable time after they are notified to you the updated Terms are deemed accepted by you. We will highlight the option to object to the modifications to the Terms and the deemed acceptance in the notification email.&nbsp;<br /><br />2.2. We reserve the right to withdraw, take down or amend all or part of the Service and all or part of the content available on the Service at any time to; for example, reflect changes to the law or new technical developments. Any changes will take into account your reasonable interests. Access to all or part of the Service may be restricted from time to time to allow for repairs, maintenance or updating. This may result in you not being able to use the Service until you have downloaded the latest version and accepted any new terms.</span></p>\n<p style=\"background: #ffffff; line-height: 100%; margin: 0.05cm 0.26cm 0.05cm 0.26cm;\" align=\"JUSTIFY\"><span style=\"font-size: small;\"><strong>3. Access/Use of the Service</strong></span></p>\n<p style=\"background: #ffffff; line-height: 100%; margin: 0.05cm 0.26cm 0.05cm 0.26cm;\" align=\"JUSTIFY\"><span style=\"font-size: small;\">3.1. You can access the Service by downloading the App, creating an account, listen to selected audio clips from the Pakodi catalogue, and recording a video in relation to that audio clips. This will result in the audio clip being combined with the video, creating a &ldquo;</span><span style=\"font-size: small;\"><strong>Dub</strong></span><span style=\"font-size: small;\">&rdquo;. Dubs are stored in your device&rsquo;s local memory and can be shared with your contacts via certain third party services, such as Face book, Twitter, Whatsapp and Google+.</span></p>\n<p style=\"background: #ffffff; line-height: 100%; margin: 0.05cm 0.26cm 0.05cm 0.26cm;\"><span style=\"font-size: small;\">3.2. To use the service you must be eighteen (18) years old or older. By using the Service you promise to us that you accept these Terms and that: (a) you are 18 years of age or over, or (b) you are 13 years of age or over and have permission to use the Service from your parent or legal guardian. If we reasonably believe that you do not sufficiently fulfil these criteria, we may suspend your use of the Service until you have provided us with acceptable proof of age.&nbsp;<br /><br />3.3. We advise parents who permit their children to use the Service to be aware that the Service is not intended for children under 18. The content made available on the Service is from &ldquo;Pakodi&rdquo; will also contain user generated and may not be suitable for children.&nbsp;<br /><br />3.4. To access certain functions on the Service, you will need to register with us. To register, you must provide us with your Name, Mobile Number, email address, age. Your Name will appear alongside any content you upload to the Service. You must make sure that your Name complies with these Terms.&nbsp;<br /><br />3.5. You are responsible for your account with us and any activity that takes place on your account, whether or not such activity was authorized by you. You must ensure that the details you provide to us are correct and kept up to date. You must inform us of any changes to the details you provided when registering with us.&nbsp;<br /><br />3.6. We reserve the right to suspend or remove your account, cancel, reassign or disable your accountand prohibit your use of the Service, without prior notice, if we believe there may have been a breach of security or if activities occur on your account that we believe breach these Terms.&nbsp;<br /><br />3.7. Access to and use of the Service requires a compatible device and internet connection. Although we are working to ensure that the Service is compatible across various devices, we cannot guarantee that the Service will work with all devices. The Service currently requires smartphones with a video camera function, 30MB of spare storage capacity and running either the Android 4.3 (or later) or iOS7 (or later) operating systems.</span></p>\n<p style=\"background: #ffffff; line-height: 100%; margin: 0.05cm 0.26cm 0.05cm 0.26cm;\"><span style=\"font-size: small;\">3.8. It is your responsibility to ensure that your device complies with these requirements. Your use of the Service may vary in functionality, availability and quality depending on the type of the device and the operating system that it uses and Sprint Apps accepts no responsibility for any lack of functionality that is due to your equipment (including your device, internet connection, operating system or settings and software).&nbsp;<br /><br />3.9. It is your responsibility to pay for all costs and expenses that you may incur while using the Service (including, but not limited to, all telephone call or line charges or Internet data service access charges).</span></p>\n<p style=\"background: #ffffff; line-height: 100%; margin: 0.05cm 0.26cm 0.05cm 0.26cm;\" align=\"JUSTIFY\"><span style=\"font-size: small;\"><strong>4. User-Generated Content</strong></span></p>\n<p style=\"background: #ffffff; line-height: 100%; margin: 0.05cm 0.26cm 0.05cm 0.26cm;\"><span style=\"font-size: small;\">4.1. You are solely responsible for your use of the Service and any recordings (&ldquo;</span><span style=\"font-size: small;\"><strong>Video Recordings</strong></span><span style=\"font-size: small;\">&rdquo;), Dubs, words, information, messages and any other content that you upload to or create via the Service, whether privately transmitted or made publicly available (together, &ldquo;</span><span style=\"font-size: small;\"><strong>User Content</strong></span><span style=\"font-size: small;\">&rdquo;). You retain ownership of your User Content.&nbsp;<br /><br />4.2. Video Recordings that you upload to the Service are made public to other users of the Service. By uploading, you understand and agree that your Name will be made public in relation to each Recording and that you grant Sprint Apps and our affiliates the right to display and 