 be governed by and construed in accordance with Indian law and the parties hereby submit to the exclusive jurisdiction of the Indian courts to settle any claim or matter arising in relation to these Terms or its subject matter or formation (including non-contractual disputes or claims).&nbsp;</span></p>\n<p style=\"background: #ffffff; line-height: 100%; margin: 0.05cm 0.26cm 0.05cm 0.26cm;\"><span style=\"font-size: small;\"><strong>Effective: August 2015</strong></span></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>',2,'2015-06-25 06:37:31'),(3,2,'About us - Telugu','<p><strong><span style=\"color: #ff0000; background-color: #ffffff;\">పకోడి గురించి</span></strong></p>\n<p>సంభాషణలు విసుగ్గానూ మరియు నీరసంగానూ ఉన్నరోజులు పోయాయి.</p>\n<p><br /> ప్రియతములు మరియు స్నేహితులతో చేసే ఛాట్స్ నేడు తెలివైన యాప్స్ సరళితో ఒక క్రొత్త జీవాన్ని సంతరించుకున్నాయి. ఇప్పుడు, సంభాషణలలో &rsquo;ఎక్స్&rsquo; ఫ్యాక్టర్ ఎంత శక్తివంతంగా ఉంటే, వక్త గురించి అంత తెలివైన అంచనా ఉంటుంది.</p>\n<p>చమత్కార వాక్యాలు, సినిమా డైలాగులు, కామెడీ క్లిప్స్ మరియు ఊహించదగినదేదైనా సరే, ఇలాంటి వాటి కొరకు తనదంటూ ఒక ప్రత్యేక శైలిని కలిగి ఉన్నదే పకోడి. ఇప్పుడు, మీరు ఆడియో క్లిప్స్ పంపవచ్చు, వీడియోలను రికార్డ్ చేయవచ్చు మరియు వాటిని మూవీ లేదా సౌండ్ క్లిప్స్ తో డబ్ చేయవచ్చు. వీటన్నిటినీ సామాజిక వేదికలైన వాట్స్&zwnj;యాప్, గూగుల్+, ఫేస్&zwnj;బుక్, ట్విట్టర్ వంటి వాటితో పంచుకోవడానికి పకోడి మీకు వీలుకల్పిస్తుంది.</p>',1,'2015-07-24 15:44:55'),(4,2,'Terms and Conditions - Telugu','<p>(ఎప్పటికప్పుడు నవీకరించబడింది, <strong>\"</strong><strong>నిబంధనలు</strong><strong>\")</strong> ఈ సేవా నిబంధనలను మీ ఆక్సెస్ పాలించడానికి మరియు <strong>Pakodi</strong> సర్వీస్ ఉపయోగించడం (క్రింద నిర్వచించిన విధంగా) అప్లోడ్ ఏ ధ్వని రికార్డింగ్, వీడియోలు, సమాచారం, టెక్స్ట్, గ్రాఫిక్స్ లేదా ఇతర కంటెంట్ పదార్థాలు, డౌన్లోడ్ లేదా సేవలో కనిపించే.జాగ్రత్తగా డౌన్లోడ్ లేదా సేవను ఉపయోగించడం ముందు ఈ నిబంధనలను చదవండి. ఈ నిబంధనలను అంగీకరించడం, లేదా సేవను ఉపయోగించడం ద్వారా, మీరు వాటిని కట్టుబడి ఉంటారని మీరు అంగీకరిస్తున్నారు. మీరు నిబంధనలను అర్థం లేదు, లేదా వాటిని ఏ భాగం అంగీకరించాలి లేదు, అప్పుడు మీరు సేవా ఉపయోగించరాదు. (: ఇమెయిల్ సర్వీస్ దీని స్థానంలో వ్యాపార హైదరాబాద్, భారతదేశం వద్ద ఉంది స్ప్రింట్ Apps ప్రైవేట్ లిమిటెడ్ <strong>(\"</strong><strong>మేము</strong><strong>\", \"</strong><strong>మాకు</strong><strong>\" \"</strong><strong>మా</strong><strong>\"</strong> మరియు <strong>\"SprintApps\")</strong> ద్వారా అందించబడుతుంది <a href=\"mailto:contact@sprintapps.in)\">contact@sprintapps.in)</a> .</p>\n<ol>\n<li><strong>సర్వీస్</strong></li>\n</ol>\n<p>సర్వీస్ Android &amp; IOS వెర్షన్లలో అందుబాటులో ఉంది మొబైల్ అప్లికేషన్ <strong>\"Pakodi\"</strong> గా ఇచ్చింది</p>\n<ol start=\"2\">\n<li><strong>మార్పులు</strong> <strong>మరియు</strong> <strong>నవీకరణలు</strong></li>\n</ol>\n<p>2.1. మేము ఏ మార్పులు ప్రతిబింబించేలా ఎప్పటికప్పుడు ఈ నిబంధనలు నవీకరించవచ్చు: (i) మా విధానాలను లేదా సంబంధిత చట్టాలు; (Ii) సేవ పనితీరు లో; లేదా (iii) ఏ మూడవ పార్టీ సరఫరాదారులు మాకు విధించిన. ఏదైనా నవీకరణలను సర్వీస్ పరిగణలోకి మీ సహేతుకమైన అభిరుచులు పడుతుంది మరియు మార్పు ప్రభావితం కావడానికి ముందు ఒక సహేతుకమైన సమయం లోపల ఇమెయిల్ ద్వారా మీకు తెలియజేయబడుతుంది. మార్పులు సింహావలోకనం వర్తించవు మరియు అవి మీకు తెలియజేయబడుతుంది తర్వాత నవీకరించబడింది నిబంధనలు సమర్థవంతమైన అవుతుంది. మీరు నవీకరించబడింది నిబంధనలు అంగీకరిస్తున్నారు లేకపోతే మీరు సేవను ఉపయోగించడం ఆపాలి. వారు మీకు తెలియజేయబడుతుంది తర్వాత మీరు ఒక సహేతుకమైన సమయం లోపల నవీకరించబడింది నిబంధనలు అభ్యంతరం లేకపోతే నవీకరించబడింది నిబంధనలు మీరు అంగీకరించారు భావించాయి. మేము నియమాలు మరియు నోటిఫికేషన్ ఇమెయిల్ లో డీమ్డ్ సమ్మతి మార్పులు వస్తువుతో ఎంపికను హైలైట్ చేస్తుంది. &nbsp;<br /> <br /> 2.2. మేము ఉపసంహరించుకోవాలని రాసుకోదగిన లేదా ఏ సమయంలో సర్వీస్ ఉంచిన కంటెంట్ను అన్ని లేదా సేవ భాగమైన మరియు అన్ని లేదా భాగంగా చక్కదిద్దు హక్కు; ఉదాహరణకు, చట్టంలో లేదా కొత్త సాంకేతిక పరిణామాలను మార్పులను ప్రతిబింబించడం.ఏదైనా మార్పులు ఖాతాలోకి మీ సహేతుకమైన అభిరుచులు పడుతుంది. సేవ యొక్క అన్ని లేదా భాగంగా ఆక్సెస్ మరమ్మతు, నిర్వహణ లేదా నవీకరణ కోసం అనుమతించేందుకు ఎప్పటికప్పుడు పరిమితం కావచ్చు. ఈ మీరు తాజా వెర్షన్ డౌన్లోడ్ మరియు ఏ కొత్త నిబంధనలు అంగీకరించారు వరకు మీరు సేవా ఉపయోగించడానికి సాధ్యపడదు దారితీయవచ్చు.</p>\n<ol start=\"3\">\n<li><strong>సేవా</strong> <strong>యాక్సెస్</strong><strong> / </strong><strong>ఉపయోగించండి</strong></li>\n</ol>\n<p>3.1. Y ou ఖాతాను సృష్టించడం, App డౌన్లోడ్ ద్వారా సర్వీస్ యాక్సెస్ వినండి ఎంచుకోబడిన ఆడియో క్లిప్లను Pakodi జాబితా నుండి, మరియు ఆ ఆడియో క్లిప్లను సంబంధించి ఒక వీడియో రికార్డింగ్ చేయవచ్చు.ఈ ఒక <strong>\"</strong><strong>డబ్</strong><strong>\"</strong> సృష్టించడం, వీడియో కలిపి చేస్తున్నారు ఆడియో క్లిప్ కారణమౌతుంది.బిరుదు మీ పరికరం యొక్క స్థానిక మెమరీలో నిల్వ మరియు ఫేస్ బుక్, ట్విట్టర్, WhatsApp మరియు Google+ వంటి కొన్ని మూడవ పార్టీ సేవలు ద్వారా మీ పరిచయాలను భాగస్వామ్యం చేయవచ్చు.</p>\n<p>3.2. సేవను ఉపయోగించడానికి మీరు పద్దెనిమిది (18) సంవత్సరాలు లేదా పాత ఉండాలి. సేవను ఉపయోగించడం ద్వారా మీరు ఈ నిబంధనలు మరియు అంగీకరించాలి అని మాకు హామీ: (ఎ) మీరు 18 సంవత్సరాలు లేదా పైగా, లేదా (బి) మీరు పైగా 13 సంవత్సరాలు లేదా మరియు మీ పేరెంట్ నుండి సేవను ఉపయోగించడానికి అనుమతి ఉంటాయి లేదా చట్టపరమైన సంరక్షకుడు. మేము సహేతుక మీరు తగినంత ఈ ప్రమాణాన్ని పూర్తి లేదు అని భావిస్తే మీరు వయస్సు ఆమోదయోగ్యమైన ఆధారాలను అందించిన వరకు, మేము మీ సేవ ఉపయోగాన్ని తాత్కాలికంగా ఉండవచ్చు. &nbsp;<br /> <br /> 3.3. మేము వారి పిల్లలకు సర్వీస్ 18 కింద పిల్లలు కోసం ఉద్దేశించినది కాదు తెలుసు ఉండాలి సర్వీస్ ఉపయోగించడానికి అనుమతించడం తల్లిదండ్రులకు సలహా. సేవా అందుబాటులో కంటెంట్ సృష్టించిన \"Pakodi\" కూడా ఉంటాయి వినియోగదారు నుండి మరియు పిల్లలకు అనుకూలంగా ఉండకపోవచ్చు.<br /> <br /> 3.4. సేవా నిర్దిష్ట విధులు యాక్సెస్, మీరు మాతో నమోదు చేసుకోవాలి. నమోదు, మీరు మీ పేరు, మొబైల్ నంబర్, ఇమెయిల్ చిరునామా, వయస్సు తో మాకు కల్పించాలి.మీ n ఆంఏ మీరు సేవకు అప్లోడ్ ఏ కంటెంట్ పాటు కనిపిస్తుంది.మీరు మీ పేరు ఈ నిబంధనలు పాటిస్తుంది నిర్ధారించాలి.<br /> <br /> 3.5. మీరు మాకు మరియు అటువంటి చైతన్యం మీరు ద్వారా అధికారం లేదో, మీ ఖాతాలో జరుగుతుంది ఏ శ్రమ మీ ఖాతాను బాధ్యత.మీరు మాకు అందించే వివరాలు సరైనవని నిర్ధారించడానికి మరియు తాజాగా ఉంచిన ఉండాలి.మీరు మాతో నమోదు చేసినప్పుడు మీరు అందించిన వివరాలు ఏ మార్పులు మాకు సమాచారం ఉండాలి. &nbsp;<br /> <br /> 3.6. మేము భద్రతా ఒక ద్రోహానికి ఉండవచ్చు నమ్మకం ఉంటే మేము, తెలియజేయకుండా, ఉంచేందుకు లేదా మీ accountand సేవ యొక్క మీ నిషేధిస్తున్నామని డిసేబుల్, సస్పెండ్ లేదా మీ ఖాతాను తొలగించడానికి, రద్దు హక్కు లేదా కార్యకలాపాలు మీ ఖాతాలో సంభవించవచ్చు ఉంటే మేము నమ్మకం ఈ నిబంధనలు ఉల్లంఘించినప్పుడు.<br /> <br /> 3.7. సేవా మరియు ఉపయోగించడానికి యాక్సెస్ ఒక అనుకూలమైన పరికరం మరియు ఇంటర్నెట్ కనెక్షన్ అవసరం. మేము సర్వీస్ వివిధ పరికరాలు అంతటా అనుకూలంగా ఉంది నిర్ధారించడానికి పని ఉన్నప్పటికీ, మేము సర్వీస్ అన్ని పరికరాలు పని అని హామీ కాదు. సర్వీస్ ప్రస్తుతం ఒక వీడియో కెమెరా ఫంక్షన్ తో స్మార్ట్ఫోన్లు అవసరం, విడి నిల్వ సామర్థ్యాన్ని మరియు నడుస్తున్న గాని (లేదా తర్వాత) Android 4.3 లేదా (లేదా తర్వాత) iOS7 ఆపరేటింగ్ వ్యవస్థలు 30MB.</p>\n<p>3.8. ఇది మీ పరికరం ఈ అవసరాలు అనుగుణంగా ఉండేలా మీ బాధ్యత. సేవ యొక్క మీ ఉపయోగం (మీ పరికరం, ఇంటర్నెట్ సహా పరికరం మరియు ఇది ఉపయోగిస్తుంది మరియు స్ప్రింట్ Apps మీ పరికరాలు కారణంగా అని కార్యాచరణను ఏ లేకపోవడంతో ఎటువంటి బాధ్యత అంగీకరిస్తుంది ఆపరేటింగ్ సిస్టమ్ యొక్క రకాన్ని బట్టి కార్యాచరణ, లభ్యత, నాణ్యత మారవచ్చు కనెక్షన్, ఆపరేటింగ్ సిస్టమ్ లేదా సెట్టింగులు మరియు సాఫ్ట్వేర్).<br /> <br /> 3.9. అది సేవ ఉపయోగించి మీరు బాధ ఉండవచ్చు అన్ని ఖర్చులన్నీ చెల్లించడానికి మీ బాధ్యత (సహా కానీ, అన్ని టెలిఫోన్ కాల్ లేదా లైన్ ఆరోపణలు లేదా ఇంటర్నెట్ డేటా సేవ యాక్సెస్ ఆరోపణలు పరిమితం కాదు).</p>\n<ol start=\"4\">\n<li><strong>వినియోగదారు</strong> <strong>రూపొందించిన</strong> <strong>కంటెంట్</strong></li>\n</ol>\n<p>4.1. మీరు కలిసి (కేవలం సర్వీస్ మరియు ఏ రికార్డింగ్ <strong>(\"</strong><strong>వీడియో</strong> రికార్డింగ్\") యొక్క మీ ఉపయోగం బాధ్యత, డబ్స్, పదాలు, మీరు అప్లోడ్ లేదా సర్వీస్ ద్వారా సృష్టించే సమాచారం, సందేశాలు మరియు ఇతర కంటెంట్, ప్రైవేటు బదిలీ లేదా లేదో బహిరంగంగా అందుబాటులో ఉన్నాయి , <strong>\"</strong><strong>వాడుకరి</strong> <strong>కంటెంట్</strong><strong>\").</strong><strong>మీరు</strong> <strong>మీ</strong> <strong>యూజర్</strong> <strong>కంటెంట్</strong> <strong>యాజమాన్యాన్ని</strong> <strong>మీరే</strong> <strong>కలిగి</strong> <strong>ఉంటారు</strong><strong>.</strong> &nbsp;<br /> <br /> 4.2. మీరు సేవకు అప్లోడ్ వీడియో రికార్డింగ్ సేవ యొక్క ఇతర వినియోగదారులకు బహిర్గతం చేయబడతాయి.అప్లోడ్ ద్వారా, మీరు అర్థం మరియు మీ పేరు ప్రతి రికార్డింగ్ సంబంధించి పబ్లిక్ ఉంటుందని అంగీకరిస్తున్నారు మరియు మీరు రికార్డింగ్స్ తో కనెక్షన్ లో మీ పేరు ఉపయోగించడానికి ప్రదర్శించడానికి మరియు ఇతరత్రా హక్కు స్ప్రింట్ Apps మరియు మా అనుబంధ ప్రసాదించే.<br /> <br /> 4.3. మీరు సేవతో పడుతుంది ఏ డబ్స్ / వీడియోలను స్థానికంగా నిల్వ చేయబడతాయి మరియు మీరు ద్వారా ప్రజలకు ఉన్నప్పుడు సర్వీస్ ఎక్కుతున్నాయి<br /> <br /> 4.4. మీరు అర్థం మరియు సేవ మరియు వినియోగదారు కంటెంట్ మీ ఉపయోగంతో సంబంధించి వర్తించే అన్ని చట్టాలు లోబడి అంగీకరిస్తున్నారు. &nbsp;<br /> <br /> 4.5. మీరు అన్ని సమయాల్లో మీ వినియోగదారు కంటెంట్ లేదని నిర్థారించుకోవాలి:</p>\n<ol>\n<li>కాపీరైట్ ట్రేడ్ మార్క్ హక్కులు, రహస్య సమాచారాన్ని లేదా గోప్యతా హక్కులను సహా ఏ మూడవ పార్టీ యొక్క హక్కులను ఉల్లంఘించే ఏదైనా కంటెంట్, సమాచారం లేదా పదార్థం కలిగి;</li>\n<li>ఏ చట్టాలు ఉల్లంఘించే;</li>\n<li>ప్రోత్సహిస్తుంది లేదా హింస, తీవ్రవాదం లేదా ఏ ఇతర చట్టవిరుద్దమైన ప్రోత్సహిస్తుంది లేదా కలత, వేధించడానికి అవకాశం ఉంది దీనిలో, అసభ్య, లైంగికపరంగా స్పష్టమైన, ప్రమాదకర అసంబద్ధం, అపఖ్యాతికర, అసత్య, అమర్యాదకరమైన, బెదిరింపు, వివక్షాపూరిత, అశ్లీల, హింసాత్మక ఏ కంటెంట్ లేదా పదార్థం కలిగి , అలారం, అసౌకర్యానికి ఇబ్బంది లేదా ఏ వ్యక్తి బాధించు;</li>\n<li>ఏ విధంగా ప్రోత్సహించడానికి లేదా కమిట్ లేదా ఏ చట్టవిరుద్ధ లేదా నేర లేదా సంఘవిద్రోహ ప్రవర్తనలను సహాయపడేందుకు, ఇతరుల భద్రత లేదా శ్రేయస్సు ప్రమాదమే చేసే కార్యకలాపాలు ప్రోత్సహించడానికి ఎవరైనా ప్రేరేపించారు;</li>\n<li>వారు వయస్సు 18 సంవత్సరాల కింద ఉంటే వారి అనుమతి లేకుండా ఏ వ్యక్తి, లేదా వారి తల్లిదండ్రులు లేదా చట్టపరమైన సంరక్షకుడు సమ్మతి గుర్తించడానికి;</li>\n<li>ఎవరి వ్యక్తిగత సంప్రదింపు వివరాలు బహిర్గతం లేదా వారి గోప్యతా దాడి;</li>\n<li>ఏ వైరస్లు లేదా ఇతర హానికరమైన లేదా హానికరమైన కార్యక్రమాలు కలిగి; లేదా</li>\n<li>ఏ ప్రకటన లేదా ప్రచార సందేశాలు కూడా.</li>\n</ol>\n<p><br /> 4.6. ఇంకా, మీరు అర్థం మరియు మీరు లేదా అలా లేదా చేయాలని ప్రయత్నించిన ఏ మూడవ పార్టీ ప్రయత్నాలు, లేదా కారణం కాదని అంగీకరిస్తున్నారు సేవ యొక్క మీ ఉపయోగం తో కనెక్షన్ లో కింది ఏ:</p>\n<ol>\n<li>ఈ నిబంధనలు మరియు సేవా సాధారణ కార్యాచరణను అనుమతించబడిన దాని కంటే ఇతర సేవ అందుబాటులో సేవా లేదా వాడుకరి కంటెంట్ ఉపయోగించండి;</li>\n<li>క్రెడిట్ కార్డు నంబర్లు, ఖాతా పాస్వర్డ్లు etc వంటి ఇతర వ్యక్తుల వ్యక్తిగత మరియు / లేదా రహస్య సమాచారాన్ని ప్రసారం .;</li>\n<li>ఒక అశాస్త్రీయ పద్ధతిలో లేదా ఈ నిబంధనలు భిన్నంగా ఏ పద్ధతిలో, ఏ అక్రమ ప్రయోజనం కోసం సేవను ఉపయోగించడం;</li>\n<li>అనుకరించడానికి లేదా సేవ యొక్క మీ ఉపయోగం ద్వారా ఎవరితోనూ ఉంటుంది నటిస్తారు;</li>\n<li>సర్వీస్, మా వ్యవస్థలు లేదా భద్రతా లేదా ఇతర వినియోగదారులు జోక్యం, అధికబరువు, డిసేబుల్, దెబ్బతినకుండా బలహీనపరిచే లేదా రాజీ అని ఒక విధంగా సేవను ఉపయోగించడం;</li>\n<li>సేకరించేందుకు డౌన్లోడ్, ఇండెక్స్, గని, గీరిన, పునరుత్పత్తి లేదా ప్రదర్శన, ఆపరేషన్ లేదా సేవా ఉద్దేశించిన ఉపయోగం లేదా ఏ లక్షణాలు తప్పించుకునేందుకు, లేదో మానవీయంగా లేదా ఆటోమేటిక్గా సహా కానీ స్క్రిప్ట్స్, సాలీడులు మరియు రోబోట్లు పరిమితం కాదు, ఏ కార్యక్రమం లేదా ఇతర మార్గాల ఉపయోగించడానికి లేదా అది విధులు;</li>\n<li>కాపీ, సవరించడానికి సేవా ఏ భాగం జోక్యం లేకపోతే decompile లేదా;</li>\n<li>కు మార్పులు లేదా సవరణలు సేవ యొక్క మొత్తం లేదా కొంత భాగం తయారు, లేదా సేవా లేదా దాని ఏదైనా భాగం అనుమతిని తో కలపవలసిన, లేదా, ఏ ఇతర కార్యక్రమాలు విలీనం కావడం;</li>\n<li>హాక్, లేదా, సేవ లోకి వైరస్లు, లేదా హానికరమైన డేటా సహా హానికరమైన కోడ్, ఇన్సర్ట్; లేదా</li>\n<li>సేవ యొక్క మీ ఉపయోగంతో సంబంధించి మా మేధో సంపత్తిని అతిక్రమించినట్లు.</li>\n</ol>\n<p>4.7. మీరు గుర్తించి మనం కేవలం ఒక నిష్క్రియాత్మక మధ్యవర్తిగా మరియు యూజర్ కంటెంట్ కోసం హోస్టింగ్ సేవ అంగీకరిస్తున్నారు మరియు మేము వినియోగదారు కంటెంట్ పంపిణీ లేదా ప్రదర్శనను ఏ చురుకైన పాత్ర పోషించాలని. &nbsp;<br /> <br /> 4.8. మేము వినియోగదారు కంటెంట్ సర్వీస్ పోస్ట్ మానిటర్ ఎటువంటి బాధ్యత మరియు మేము మరియు యూజర్ కంటెంట్ కోసం ఏ బాధ్యత తీసుకోవాలని లేదు కాదు, కానీ మేము మద్దతు ఆమోదించడానికి లేదా ద్వారా పోస్ట్ ఏ యూజర్ కంటెంట్ లేదా కమ్యూనికేషన్ యొక్క సంపూర్తి, నిర్దిష్టత లేదా విశ్వసనీయత హామీ లేదు సేవలు లేదా అభిప్రాయాలను అందులో వ్యక్తం చేశారు. ఏ యూజర్ కంటెంట్ లేదా పదార్థాలు సర్వీస్ ద్వారా పోస్ట్ లేదా సేవ ద్వారా మీరు పొందిన లో ఉపయోగం లేదా విశ్వసనీయత మీ స్వంత ప్రమాదం ఉంది. &nbsp;<br /> <br /> 4.9. SprintApps, ఏ లోపాలు లేదా లోపాల విషయంలో కలిగి, లేదా పోస్ట్ ఏ యూజర్ కంటెంట్ ఉపయోగం ఫలితంగా వాటిల్లిన రకమైన ఏ నష్టం లేదా నష్టం సహా వాడుకరి కంటెంట్, ఏ విధంగా బాధ్యత వుండదు, కానీ వీటికే పరిమితం కాదు కమిటీ, ఇమెయిల్, బదిలీ లేదా సేవా ద్వారా అందుబాటులో లేదా మరెక్కడైనా ప్రసారం.&nbsp;<br /> <br /> 4.10. మేము మా స్వంత అభీష్టానుసారం, ఈ నిబంధనల ఉల్లంఘనకు ఉంది నమ్మకం, లేదా మేము మీరు ఈ నిబంధనలు అతిక్రమించలేదని అవకాశం నమ్ముతారు సమంజసమైన ఆధారాలు కలిగి ఉంటే, మేము భావించే ఏ చర్య సర్వీస్ మరియు రక్షణ అవసరం పట్టవచ్చు దాని వినియోగదారులు. మేము (మేము తిరిగి ఆ మొత్తాన్ని పొందడానికి వహిస్తాయని మేము ఎందుకంటే మీ వినియోగదారు కంటెంట్ చెల్లించాలని కలిగి ఉంటే, ఉదాహరణకు), సర్వీస్ ఉపయోగించడానికి సేవ నుండి మీ వినియోగదారు కంటెంట్ తొలగించడానికి, మీరు వ్యతిరేకంగా న్యాయ విచారణల్లో తీసుకోవాలని మీ కుడి ఉపసంహరించుకోవాలని ఉండవచ్చు మరియు ఇతర చర్య మేము తగిన పరిగణించు.</p>\n<ol start=\"5\">\n<li><strong>సేవా</strong> <strong>లైసెన్సు</strong></li>\n</ol>\n<p>ఈ నిబంధనలతో మీ సమ్మతి లోబడి, స్ప్రింట్ Apps మీరు ఈ నిబంధనలు మరియు గోప్యతా విధానానికి లోబడి సర్వీస్ డౌన్లోడ్ మరియు / లేదా ఉపయోగించడానికి వ్యక్తిగత, ప్రపంచవ్యాప్త, రాయల్టీ రహిత, బదిలీ మరియు మినహాయింపు లేని లైసెన్స్ను మంజూరు.</p>\n<p><br /> &nbsp;</p>\n<ol start=\"6\">\n<li><strong>స్ప్రింట్</strong><strong> Apps </strong><strong>హక్కుల</strong></li>\n</ol>\n<p>6.1. అన్ని హక్కులు, శీర్షికలు మరియు సర్వీసుకు అభిరుచులు (మినహాయించి కంటెంట్ అప్లోడ్ లేకపోతే వినియోగదారులను అందించిన) మరియు స్ప్రింట్ Apps మరియు దాని లైసెన్సర్లు ప్రత్యేక ఆస్తి ఉంటుంది.<br /> <br /> 6.2. / అప్లోడ్ సర్వీస్ పబ్లిక్ ఏ రికార్డింగ్స్ చేయడం ద్వారా, మీరు తో కనెక్షన్ లో ఒక ప్రపంచవ్యాప్త, మీరు మీ పేరుతో పాటు, సర్వీస్ అప్లోడ్ ఏ రికార్డింగ్స్ ఉపయోగించడానికి అనియంత్రిత, కాని ప్రత్యేకమైన, రాయల్టీ రహిత, బదిలీ లైసెన్స్, స్ప్రింట్ Apps మంజూరు సర్వీస్, ఈ నిబంధనలు మరియు మా గోప్యతా విధానానికి లోబడి.</p>\n<ol start=\"7\">\n<li><strong>కాపీరైట్</strong><strong>, </strong><strong>నివేదన</strong> <strong>మరియు</strong> <strong>నోటీస్</strong><strong> &amp; </strong><strong>అవమానానికి</strong> <strong>విధానం</strong></li>\n</ol>\n<p>7.1. స్ప్రింట్ Apps ఇతరుల మేధో సంపత్తి హక్కులను గౌరవిస్తుంది మరియు సేవా వినియోగదారులు అదే చేయాలని ఆశించారు.&nbsp;<br /> <br /> 7.2. మీరు మీ కాపీరైట్ను ఉల్లంఘిస్తుందని ఆ వేదిక మీద ఏ కంటెంట్ కనుగొనడంలో ఉంటే, కింది సమాచారాన్ని సహా రచన మాకు ఈ రిపోర్ట్ చెయ్యండి:</p>\n<ol>\n<li>మీరు మీ కాపీరైట్ లేదా మీరు పని అర్హులు దీని తరపున ఒక మూడవ పార్టీ కాపీరైట్ ఉల్లంఘిస్తోందని వేదిక కంటెంట్ గుర్తించారు ప్రకటన;</li>\n<li>మీరు ఉల్లంఘించిన ఆరోపిస్తున్న కాపీరైట్ పని యొక్క వర్ణన;</li>\n<li>మీరు ఉల్లంఘిస్తోందని వివరాలను పేర్కొన్నారు కంటెంట్ ఒక వివరణ ఎక్కడ వేదిక మీరు చూడవచ్చు ఉల్లంఘించబడుతోందని వాదించే కంటెంట్;</li>\n<li>మీ పూర్తి పేరు, చిరునామా, టెలిఫోన్ నంబర్ మరియు మీరు సంప్రదించవచ్చు ఇది ఒక చెల్లుబాటు అయ్యే ఇమెయిల్ చిరునామా సహా మీ సంప్రదింపు సమాచారాన్ని;</li>\n<li>మీరు పదార్థం యొక్క వివాదాస్పద కాపీరైట్ యజమాని, దాని ఏజెంట్ లేదా చట్టం ద్వారా అధికారం లేని మంచి నమ్మకాన్ని కలిగి మీరు ప్రకటన; మరియు</li>\n<li>మీరు చేసిన ప్రకటన మీ ప్రకటన సమాచారం ఖచ్చితమైనది మరియు మీరు ఆరోపిత ఉల్లంఘన ప్రత్యేక హక్కు యజమాని తరపున వ్యవహరించడానికి అధికారం ఆ.</li>\n</ol>\n<p>మీరు మీ నోటీసు కోరుకుంటూ ఉంటే అదనంగా, భారత డిజిటల్ మిలీనియం కాపీరైట్ చట్టం నోటీస్ అందుకున్నప్పుడు పరిగణిస్తారు, క్రింది చేర్చండి</p>\n<ol>\n<li>ఒక ప్రకటన, అసత్య ప్రమాణం జరిమానా క్రింద, మీరు అక్రమంగా ఉల్లంఘించిన ప్రత్యేక కాపీరైట్ యజమాని తరపున వ్యవహరించడానికి అధికారం యజమాని లేదా అని; మరియు</li>\n<li>(ఒక స్కాన్ కాపీని కావచ్చు) మీ ఎలక్ట్రానిక్ లేదా భౌతిక సంతకం.</li>\n</ol>\n<p>7.3. మీ నోటీసును మాకు లేదా ఇమెయిల్ ద్వారా మా నియమించబడిన కాపీరైట్ ఏజెంట్ పంపిన చేయాలి <a href=\"mailto:copyright@dubsmash.com\">కాపీరైట్ @</a> <span style=\"text-decoration: underline;\">sprintapps.in</span> లేదా కింది చిరునామాకు మెయిల్ ద్వారా:<br /> <br /> స్ప్రింట్ Apps ప్రైవేట్ లిమిటెడ్.,&nbsp;<br /> మొదటి అంతస్తులో, H.NO. 8-2-269 / 19 / S / 1,</p>\n<p>ROAD NO. 2 బంజారా హిల్స్, హైదరాబాద్ 500 034, తెలంగాణ, INDIA<br /> సావధానత: కాపీరైట్ టీమ్&nbsp;<br /> <br /> 7.4. మీరు అందుకున్న లేదా ఎన్కౌంటర్ రికార్డింగ్ లేదా ఇతర కంటెంట్ మీరు ఈ సేవ ద్వారా అభ్యంతరకరమైన ఇది, లేదా మీరు విశ్వసిస్తే యూజర్ ఈ నిబంధనలు మరియు / లేదా గోప్యతా విధానాన్ని ఉల్లంఘించి, మేము నేరుగా సంబంధిత యూజర్ సంప్రదించడం మరియు ఒక పరస్పర సమ్మతమైన పరిష్కారం చేరుకోవడానికి ప్రయత్నం సిఫార్సు . ఈ ఒక సంతృప్తికరమైన ఫలితాన్ని దారి లేదు ఉంటే, ఇమెయిల్ ద్వారా మాకు నివేదించండి దయచేసి <a href=\"mailto:copyright@dubsmash.com\">కాపీరైట్ @</a> సంబంధిత రికార్డింగ్ యొక్క \"నివేదిక\" లింక్ ద్వారా సేవా అందుబాటులో ఒక ధ్వని రికార్డింగ్ సంబంధించి ఉంటే, <span style=\"text-decoration: underline;\">sprintapps.in</span> లేదా.</p>\n<p>&nbsp;</p>\n<ol start=\"8\">\n<li><strong>ప్రకటనలు</strong></li>\n</ol>\n<p>మేము మీ సేవ వినియోగంతో మీకు ప్రకటనలు విడుదల.</p>\n<ol start=\"9\">\n<li><strong>గోప్యతా</strong></li>\n</ol>\n<p>మీరు స్ప్రింట్ Apps కు సరఫరా చేసే సమాచారం మా సేకరణ మరియు వ్యక్తిగత డేటా ఉండవచ్చు మీ సమాచారాన్ని ఉపయోగించడం పాలించే ఇది మా గోప్యతా విధానం, సంబంధించినది.సేవా మా నియమం యొక్క భాగంగా, మేము సేవ ప్రకటనలు మరియు నిర్వహణ సందేశాలను వంటి కొన్ని సమాచార, మీకు అందించడానికి అవసరం. ఈ సమాచార మీరు వెయ్యడానికి స్వీకరించడం నుండి పోవచ్చునని సేవలకు భాగంగా పరిగణిస్తారు.</p>\n<ol start=\"10\">\n<li><strong>మూడవ</strong> <strong>పార్టీ</strong> <strong>సేవలు</strong></li>\n</ol>\n<p>సేవ కలిగి మరియు ఒక మూడవ పార్టీ ద్వారా అందించిన ఆ (ఫేస్ బుక్ మరియు WhatsApp వంటి, సాంఘిక అనువర్తనాలను పరిమితం కాదు, వీటితో సహా) లక్షణాలు మరియు సేవలకు లింకులు.మేము అటువంటి మూడవ పార్టీ సైట్లు లేదా సేవల నియంత్రించడానికి కాదు మరియు అలాంటి సైట్లు లేదా సేవల కంటెంట్ లేదా కార్యాచరణను బాధ్యత కాదు లేదు. లింకులు యొక్క అవర్ చేర్చడం వారి ఆపరేటర్లు ఏ సూచనను లేదా అసోసియేషన్ అర్థం కాదు. ఇటువంటి మూడవ పార్టీ సేవల ఉపయోగానికి వర్తించే షరతులు వర్తించవచ్చు ఉంటుంది మరియు మేము వారి సేవ యొక్క మీ ఉపయోగం తో కనెక్షన్ లో మీరు లేదా మూడవ పార్టీ సేవా ప్రదాత ద్వారా జరుగుతుంది ఏదైనా బాధ్యత వుండదు.</p>\n<ol start=\"11\">\n<li><strong>రద్దు</strong></li>\n</ol>\n<p>11.1. మేము తాత్కాలికంగా లేదా మా స్వంత అభీష్టానుసారం, ఏ సమయంలో మరియు ఏ కారణం సేవకు మీ ఉపయోగం మరియు ఆక్సెస్ ముగించవచ్చు. ఇటువంటి సస్పెన్షన్ లేదా ముగింపు మేము తగిన పరిగణలోకి మీరు వ్యతిరేకంగా ఏ ఇతర చర్య తీసుకోవాలని మా కుడి పరిమితం తెలియచేస్తుంది. &nbsp;<br /> <br /> 11.2. మీరు మీ పరికరం నుండి App సర్వీస్ ఉపయోగించడానికి నిలిచిపోయిన మరియు / లేదా తొలగించడం ద్వారా ఏ సమయంలో మీ సేవ యొక్క ఉపయోగం ముగించవచ్చు. మీ ప్రొఫైల్ మరియు మీరు Pakodi జాబితా ఉంటుంది అప్లోడ్ చేసిన ఏ రికార్డింగ్స్ తొలగించదు ఒక పరికరం నుండి అనువర్తనాన్ని తొలగిస్తోంది, గమనించండి.మీరు మీ ప్రొఫైల్ తొలగించాలని అనుకుంటున్నారా ఉంటే, రాస్తున్న మాకు సంప్రదించండి దయచేసి <a href=\"mailto:contact@sprintapps.in\">contact@sprintapps.in</a><br /> <br /> 11.3. ఏ పార్టీ ద్వారా అటువంటి ముగిస్తే, ఈ నిబంధనలు ముగుస్తాయి, కానీ క్రింది నిబంధనలు వర్తిస్తే కొనసాగుతుంది: విభాగాలు 3, 4, 6, 7, 9, 10, 11, 12, 13 మరియు 14.</p>\n<ol start=\"12\">\n<li><strong>విజ్ఞాపనలు</strong> <strong>మరియు</strong> <strong>వారంటీలు</strong></li>\n</ol>\n<p>12.1. మీరు మాకు ఆ వాగ్దానం:</p>\n<ol>\n<li>ఏదైనా మేధో సంపత్తి హక్కులు, రహస్య సమాచారాన్ని లేదా గోప్యతా హక్కులను హక్కులను సహా ఏ మూడవ పార్టీ హక్కులు, ఉల్లంఘించలేదని మీ వినియోగదారు కంటెంట్;</li>\n<li>మీరు యూజర్ కంటెంట్ లో కనిపించే ఏ వ్యక్తుల నుంచి అన్ని అవసరమైన అనుమతులు మరియు సమ్మతించే పొందిన; మరియు</li>\n<li>మీ వినియోగదారు కంటెంట్ ఈ నిబంధనలు పాటించాలి.</li>\n</ol>\n<p>12.2. ఈ నిబంధనలు సెక్షన్ 13 లోబడి, మీరు మేము సహేతుక మరియు బొత్తిగా మీరు అటువంటి ఉల్లంఘన తప్పు ఎక్కడ ఈ నిబంధనల మీరు ఏ ఉల్లంఘన ఫలితంగా బాధ ఉండవచ్చు ఏ నష్టాలు లేదా ఖర్చులు కోసం మాకు భర్తీ అంగీకరిస్తున్నారు. మీరు ఈ నిబంధనలలో మీ ఉల్లంఘన మా నిర్లక్ష్యం లేదా ఈ నిబంధనల మా ఉల్లంఘన బయటకు పుడుతుంది ఉంటే ఈ సెక్షన్ కింద మాకు భర్తీ అవసరం లేదు.</p>\n<ol start=\"13\">\n<li><strong>అస్వీకారములు</strong> <strong>మరియు</strong> <strong>పరిమితులు</strong></li>\n</ol>\n<p>13.1. సేవ యొక్క మీ ఉపయోగం మరియు \"అందుబాటులో\" ఆధారం \"ఉన్నది ఉన్నట్టుగా\" ఒక ఆన్ IS. SERVICE ప్రదర్శించబడుతుంది SERVICE మరియు ఏ కంటెంట్ లేదా పదార్థం దాని ఖచ్చితత్వం సామీప్యాన్ని, పరిపూర్ణత లేదా విశ్వసనీయత, ఏవైనా హామీలు, షరతులు లేదా హామీ లేకుండా అందించబడింది. మేము సేవ చేయలేనని లేదా వైఫల్యానికి మీకు బాధ్యతను వహించరు. &nbsp;<br /> <br /> 13.2. మేము స్పష్టంగా ఈ నిబంధనల విరుద్ధంగా ఏ వ్యక్తి యొక్క ఉపయోగానికి నుంచి తలెత్తే నష్టం కోసం మా బాధ్యత మినహాయించాలని. మీరు తింటాడు, SERVICE అందుబాటులో సౌండ్ రికార్డింగ్లు మరియు ఏ ఇతర కంటెంట్ సంయుక్త యూజర్లచే అందచేసిన అర్థం, మరియు మేము SERVICE ఈ కంటెంట్ను మీకు కాదు బాధ్యులెవరో LIABILE వ్యవహరించము. &nbsp;<br /> <br /> 13.3. మేము స్పష్టంగా ఏ బాధ్యత (ఒక) ఏ నష్టం లేదా మాకు ద్వారా సహేతుకంగా బలవంతంకాని కాదని మరియు లాభాలు కోల్పోవడంతో సహా SERVICE ముడిపడివున్న మీ వల్ల జరిగిన ఏది హానికి మినహాయించబడిన; మరియు (బి) ఏ నష్టం లేదా హానికి ఈ నిబంధనల్లోని మీ ఉల్లంఘన ఫలితంగా మీరు పేర్కొన్న వాటి. &nbsp;<br /> <br /> 13.4. చట్టం అనుమతించిన పూర్తిసామర్థ్యం మేరకు, మేము లేకుండా ఏ దావా యాక్షన్ లేదా మూలంలో రూపంతో మీరు లేదా ఏదైనా నష్టం లేదా హానికి ఏదైనా ఇతర పక్షానికి వహించరు. మీరు గుర్తించి మాతో ఏదైనా వివాదానికి మీ ఏకైక మరియు ప్రత్యేక పరిహారం సేవ యొక్క మీ ఉపయోగం స్వస్తి అంగీకరిస్తున్నారు. &nbsp;<br /> <br /> 13.5. పరిమితం లేదా మా బాధ్యత మినహాయించాలని కమిటీ ఈ నిబంధనలు: (i) మరణం లేదా మా నిర్లక్ష్యం వలన వ్యక్తిగత గాయం; (Ii) ఉద్దేశ్యపూర్వకంగా చేసినవి, మోసం లేదా మోసపూరిత మాయ; మరియు (iii) మినహాయించాలి లేదా చట్టం ద్వారా పరిమితం సాధ్యం కాదు ఆ ఏ ఇతర బాధ్యత.</p>\n<ol start=\"14\">\n<li><strong>రద్దు</strong></li>\n</ol>\n<p>మేము ఈ నిబంధనలను రద్దు మరియు మేము సేవ అందించడానికి ఉపసంహరించుకుంటే ఉంటే, నోటీసు లేకుండా ఏ సమయంలోనైనా మీ ఖాతాను మూసివేయవచ్చు.</p>\n<ol start=\"15\">\n<li><strong>ఇతర</strong> <strong>నిబంధనలు</strong></li>\n</ol>\n<p>15.1. స్ప్రింట్ Apps, కేటాయించవచ్చు ఉప ఒప్పందం మరియు / లేదా ఏ కంపెనీ, సంస్థ లేదా వ్యక్తి ఈ నిబంధనల కింద మా హక్కులు మరియు / లేదా బాధ్యతలు ఏ లేదా అన్ని బదిలీ చేస్తాయి.మీరు ఎవరైనా ఈ నిబంధనల కింద మీ హక్కులు లేదా బాధ్యతలను బదిలీ పోవచ్చు. &nbsp;<br /> <br /> 15.2. ఈ నిబంధనలకు ప్రతి విడిగా నిర్వహించే. ఈ నిబంధనలు కేటాయింపులను ఏ చట్టవిరుద్ధ లేదా అమలు నిర్వహించలేరు సందర్భంలో, ఆ నిబంధనల పరిమితమై ఉంటుంది లేదా కనీస మేరకు అవసరమైన తొలగించింది, మరియు ఈ నిబంధనల యొక్క మిగిలిన నియమాలు పూర్తి ప్రభావంతో ఉంటుంది. &nbsp;<br /> <br /> 15.3. ఈ నిబంధనలు మరియు మా గోప్యతా విధానం మరియు మాకు మధ్య మొత్తం ఒప్పందం ఉన్నారు మరియు అన్ని ముందు మరియు సమకాలీనమైన ఒప్పందాలు లేదా సమాచార రద్దు. &nbsp;<br /> <br /> 15.4. ఈ నిబంధనలకు పార్టీ కాదు ఎవరు ఏ వ్యక్తి ఏ పదం చేస్తాయి. &nbsp;<br /> <br /> 15.5. ఈ నిబంధనలు మరియు ఏ వివాదం లేదా (కాని ఒప్పంద వివాదాల లేక దావాలను సహా) బయటకు లేదా లేదా దాని విషయాన్ని లేదా ఏర్పాటుతో విషయంలో తలెత్తే దావా ద్వారా పాలించబడుతుంది మరియు భారతీయ చట్టం ప్రకారం ఆటంకాలు మరియు పార్టీలు దీన్ని ఇందుమూలముగా విస్తృత అధికార పరిధిలో సమర్పించడానికి కమిటీ భారతీయ న్యాయస్థానాలు ఏ దావా పరిష్కరించడానికి లేదా ఈ నిబంధనలు లేదా (కాని ఒప్పంద వివాదాల లేదా వాదనలు సహా) దాని విషయాన్ని లేదా ఏర్పడటానికి సంబంధించి తలెత్తే పట్టింపు.</p>\n<p><strong>ఎఫెక్టివ్</strong><strong>: 2015 </strong><strong>ఆగస్టు</strong></p>',2,'2015-07-24 15:44:55'),(5,3,'About Us - Tamil','<p><strong><span style=\"color: #ff0000;\">பகோடி குறித்து</span></strong></p>\n<p>உரையாடல்கள் சலிப்பானதாகவும் சாதாரண பேச்சு விழாக்களாகவும் இருந்த நாட்கள் கடந்துசென்றுவிட்டன.&nbsp;</p>\n<p>புத்திசாலித்தனமான செயலிகள் மூலமாக நேசிப்பவர்களோடும் நண்பர்களோடும் அரட்டை அடிப்பது இன்று ஒரு புதிய வாழ்வை பெற்றுள்ளது. இப்போது, உரையாடலில் &lsquo;X&rsquo; காரணி எவ்வளவு வலிமையானதாக இருக்கிறதோ, பேச்சாளரை குறித்த கருத்தும் அவ்வளவு விவேகமுள்ளதாக இருக்கிறது.</p>\n<p>பகோடி என்பது ஒரு வரி நகைச்சுவையாளர்கள், திரைப்பட வசனங்கள், நகைச்சுவை கிளிப்கள் மற்றும் ஒருவர் கனவு காணக்கூடிய எந்த ஒரு காரியத்திற்குமான தனித்துவமான கண்டுபிடிப்பு தளம் ஆகும். இப்போது நீங்கள் ஒலி கிளிப்களை அனுப்பலாம், வீடியோக்களை பதிவுசெய்து அவற்றை திரைப்படம் அல்லது ஒலி கிளிப்களுடன் டப் செய்யலாம். பகோடி இவை அனைத்தையும் நீங்கள் சமூக ஊடக தளங்களாகிய வாட்சப், கூகுள்+,ஃபேஸ்புக், டிவிட்டர், உள்ளிட்டவற்றில் பகிர்ந்துகொள்ள அனுமதிக்கிறது.</p>',1,'2015-07-24 15:53:52'),(6,3,'Terms and Conditions - Tamil','<p>(அவ்வப்போது மேம்படுத்தப்பட்டது என, <strong>\"</strong><strong>விதிமுறைகள்</strong><strong>\")</strong> இந்த சேவை விதிமுறைகள் உங்கள் அணுகல் ஆட்சி மற்றும் <strong>Pakodi</strong> சேவை பயன்பாடு (கீழே வரையறுக்கப்பட்டுள்ளவாறு) மற்றும் பதிவேற்றிய எந்த ஒலி பதிவுகள், வீடியோக்கள், தகவல், உரை, கிராஃபிக்ஸ் அல்லது மற்ற உள்ளடக்கம் பொருட்கள், அல்லது பதிவிறக்கம் சேவையில் தோன்றும்.கவனமாக பதிவிறக்கம் அல்லது சேவையை பயன்படுத்தி முன் இந்த நிபந்தனைகளை படிக்க கொள்ளவும். இந்த விதிமுறைகள் ஏற்று, அல்லது சேவை மூலம், நீங்கள் அவர்கள் உடன்படுவதாக ஒப்புக்கொள்கிறீர்கள். விதிமுறைகளை புரியவில்லை, அல்லது அவர்கள் எந்த ஒரு பகுதியாக நாம் ஏற்கவில்லை என்றால், நீங்கள் சேவை பயன்படுத்த கூடாது. (: மின்னஞ்சல் சேவை யாருடைய வர்த்தகம் நடைபெறும் ஹைதெராபாத், இந்தியா உள்ளது ஸ்பிரிண்ட் ஆப்ஸ் பிரைவேட் லிமிடெட் <strong>(\"</strong><strong>நாம்</strong><strong>\", \"</strong><strong>எங்களுக்கு</strong><strong>\" \"</strong><strong>எங்கள்</strong><strong>\"</strong> மற்றும் <strong>\"SprintApps\")</strong> ஆல் வழங்கப்பட்ட <a href=\"mailto:contact@sprintapps.in)\">contact@sprintapps.in)</a> .</p>\n<ol>\n<li><strong>சேவை</strong></li>\n</ol>\n<p>சேவை அண்ட்ராய்டு &amp; iOS பதிப்புகள் கிடைக்க கூடிய மொபைல் பயன்பாடு <strong>\"Pakodi\"</strong> என வழங்கப்படுகிறது</p>\n<ol start=\"2\">\n<li><strong>விதிமுறைகள்</strong> <strong>மற்றும்</strong> <strong>மேம்படுத்தல்கள்</strong></li>\n</ol>\n<p>2.1. நாம் எந்த மாற்றங்களை பிரதிபலிக்கும் அவ்வப்போது இந்த விதிமுறைகள் புதுப்பிக்கலாம்: (நான்) எங்கள் கொள்கைகள் அல்லது தொடர்புடைய சட்டங்கள் உள்ள; (Ii) இந்த சேவை செயல்பாடு; அல்லது (iii) ஏதாவது மூன்றாவது சப்ளையர்கள் மீது திணிக்கப்பட்ட. எந்த மேம்படுத்தல்கள் சேவை கணக்கில் உங்கள் நியாயமான நலன்களை கருத்தில் எடுத்துக் மற்றும் மாற்றம் ஆவதற்கு ஒரு நியாயமான நேரத்தில் மின்னஞ்சலை உங்களுக்கு அறிவிக்கப்படும். மாற்றங்கள் நடமுறையில் பொருந்தாது அவர்கள் உங்களுக்கு அறிவிக்கப்படும் பின்னர் புதுப்பிக்கப்பட்ட விதிமுறைகள் நடைமுறைக்கு வரும். நீங்கள் புதுப்பிக்கப்பட்ட விதிமுறைகள் உடன்பாடு இல்லை என்றால், உங்களுக்கு சேவை பயன்படுத்தி நிறுத்த வேண்டும். அவர்கள் உங்களுக்கு அறிவிக்கப்படும் பிறகு நீங்கள் ஒரு நியாயமான நேரத்தில் புதுப்பிக்கப்பட்ட விதிமுறைகள் எதிர்க்கவில்லை என்றால் புதுப்பிக்கப்பட்ட விதிமுறைகள் நீங்கள் ஏற்று. நாம் விதிமுறைகள் மற்றும் அறிவிப்பு மின்னஞ்சல் கருதப்படும் ஏற்று மாற்றங்களை எதிர்க்கவில்லை விருப்பத்தை முன்னிலைப்படுத்த வேண்டும். &nbsp;<br /> <br /> 2.2. நாம், திரும்ப கீழே எடுத்து அல்லது எந்த நேரத்திலும் சேவை உள்ள உள்ளடக்கத்தை அனைத்து அல்லது சேவையின் ஒரு பகுதியாக மற்றும் அனைத்து அல்லது பகுதியாக திருத்தும் உரிமையை உதாரணமாக, சட்டம் அல்லது புதிய தொழில்நுட்ப அபிவிருத்திகளை மாற்றங்களை பிரதிபலிக்கும்.ஏதேனும் மாற்றங்கள் கணக்கில் உங்கள் நியாயமான நலன்களை எடுக்கும். சேவை அல்லது அதில் ஒரு பகுதியையோ அணுகல் ரிப்பேர், பராமரிப்பு அல்லது மேம்படுத்தும் அனுமதிக்கும் அவ்வப்போது தடை செய்யப்பட்டிருக்கலாம். இந்த நீங்கள் சமீபத்திய பதிப்பை பதிவிறக்கம் மற்றும் எந்த புதிய நிபந்தனைகளை ஏற்றுக்கொண்டது வரை நீங்கள் இந்த சேவையை பயன்படுத்த முடியாது ஏற்படலாம்.</p>\n<ol start=\"3\">\n<li><strong>சேவை</strong> <strong>அணுகலாம்</strong><strong> / </strong><strong>பயன்பாட்டு</strong></li>\n</ol>\n<p>3.1. என்றால் Y OU கணக்கு உருவாக்குதல், பயன்பாட்டை நிறுவ மூலம் சேவையைப் கேட்க தேர்ந்தெடுத்த ஆடியோ கிளிப்புகள் Pakodi அட்டவணை இருந்து, அந்த ஆடியோ கிளிப்புகள் தொடர்பாக ஒரு வீடியோ பதிவு செய்யலாம்.இது ஒரு <strong>\"</strong><strong>டப்</strong><strong>\"</strong> உருவாக்கி, வீடியோ இணைந்து வருகின்றன ஆடியோ கிளிப்பை ஏற்படுத்தும்.Dubs உங்கள் சாதனத்தின் உள்ளூர் நினைவக சேமிக்கப்படும் மற்றும் போன்ற முகம் புத்தகம், ட்விட்டர்,, Whatsapp மற்றும் Google+ போன்ற சில மூன்றாம் கட்சி சேவைகள் வழியாக உங்கள் தொடர்புகள் பகிர்ந்து கொள்ள முடியும்.</p>\n<p>3.2. சேவையைப் பயன்படுத்த நீங்கள் பதினெட்டு (18) வயது அல்லது பழைய இருக்க வேண்டும். சேவை பயன்படுத்தி நீங்கள் இந்த விதிமுறைகள் மற்றும் ஏற்று அந்த எங்களுக்கு சத்தியம் என்று: (அ) நீங்கள் 18 வயது அல்லது மீது, அல்லது (ஆ) 13 க்கும் மேற்பட்ட வயது அல்லது அவை உங்கள் பெற்றோர் சேவை பயன்படுத்த அனுமதி உங்களிடம் அல்லது சட்டபூர்வமான காப்பாளரிடம். நாம் நியாயமாக நீங்கள் போதுமான இந்த நிபந்தனையுடன் பூர்த்தி செய்வதில்லை நம்பினால் உங்களுக்கு வயது ஏற்று சான்றை வழங்கிய வரை, நாங்கள் உங்கள் சேவையின் பயன்பாட்டை நிறுத்தி இருக்கலாம். &nbsp;<br /> <br /> 3.3. நாம் அவர்களுடைய பிள்ளைகளை சேவை 18 வயதுக்கு கீழ் நோக்கம் அல்ல என்பதை அறிவார்கள் சேவை பயன்படுத்த அனுமதித்தால் பெற்றோர்கள் ஆலோசனை. சேவை கிடைக்க உள்ளடக்கம் \"Pakodi\" மேலும் கொண்டிருக்க வேண்டும் பயனர் மற்றும் குழந்தைகள் பொருத்தமான இருக்கலாம்.<br /> <br /> 3.4. சேவை செய்யும் சில செயல்பாடுகளை அணுக, நீங்கள் எங்களுடன் பதிவு செய்ய வேண்டும். பதிவு செய்ய, உங்கள் பெயர், மொபைல் எண், மின்னஞ்சல் முகவரி, வயது எங்களுக்கு வழங்க வேண்டும்.உங்கள் n AME நீங்கள் சேவை பதிவேற்றும் எல்லா உள்ளடக்கத்தை இணைந்து தோன்றும்.நீங்கள் உங்கள் பெயர் இந்த விதிகளுக்கு என்று உறுதி செய்ய வேண்டும்.<br /> <br /> 3.5. நீங்கள் எங்களுக்கும் அத்தகைய நடவடிக்கை நீங்கள் ஆல் அங்கீகரிக்கப்பட்டது இருந்தாலும், இல்லாவிட்டாலும், உங்கள் கணக்கில் இருக்கும் நடைபெறுகிறது என்று எந்த நடவடிக்கை மூலம் உங்கள் கணக்கின் பொறுப்பு.நீங்கள் வழங்கியதாகும் விவரங்கள் சரியாக உள்ளதா என்பதை உறுதிப்படுத்த, மற்றும் தேதி வரை வைக்கப்படும் வேண்டும்.நீங்கள் எங்களுடன் பதிவு போது நீங்கள் வழங்கிய விவரங்கள் எந்த மாற்றங்கள் எங்களுக்கு தெரிவிக்க வேண்டும். &nbsp;<br /> <br /> 3.6. நாங்கள் பாதுகாப்பு மீறல்கள் ஏதாவது என்று நீங்கள் நினைத்தால் நாம் முன்னறிவிப்பு ஏதுமின்றி, மறுஒதுக்கீடு அல்லது உங்கள் accountand சேவை பயன்பாட்டை தடை முடக்க, இடைநிறுத்த அல்லது உங்கள் கணக்கை நீக்க, ரத்து உரிமையை அல்லது நடவடிக்கைகள், உங்கள் கணக்கில் ஏற்படும் என்றால் நாம் நம்புகிறோம் என்று இந்த விதிமுறைகள் மீறி.<br /> <br /> 3.7. சேவை மற்றும் பயன்படுத்த Access ஒரு சாதனம் இணக்கமான மற்றும் இணைய இணைப்பு தேவை. நாங்கள் சேவை பல்வேறு சாதனங்கள் முழுவதும் பொருந்தும் என்று உறுதி உழைக்கும் என்றாலும், சேவை அனைத்து சாதனங்கள் வேலை என்று உத்தரவாதம் அளிக்க முடியாது. தற்போது சேவை ஒரு வீடியோ கேமரா செயல்பாடு ஸ்மார்ட்போன்கள் தேவைப்படுகிறது, உதிரி சேமிப்பு திறன் மற்றும் இயக்குதல் (அல்லது பின்னர்) ஆண் போன்ற 4.3 அல்லது (அல்லது பின்னர்) iOS7 கொண்டு இயக்க முறைமைகள் 30MB.</p>\n<p>3.8. உங்கள் சாதனத்தில் இந்த தேவைகள் இணங்கியுள்ள உறுதிப்படுத்த வேண்டியது உங்கள் பொறுப்பு உள்ளது. சேவை பயன்பாட்டை (உங்கள் சாதனம், இணைய உட்பட சாதனம் மற்றும் அதை பயன்படுத்தும் மற்றும் ஸ்பிரிண்ட் Apps உங்களுடைய உபகரணங்கள் காரணமாக உள்ளது என்று செயல்பாடு எந்த இல்லாததால் எந்த பொறுப்பானவரோ அந்த இயங்கு வகையை பொறுத்து செயல்பாடு, கிடைக்கும் மற்றும் தரம் மாறுபடும் இணைப்பு, இயக்க முறைமை அல்லது அமைப்புகள் மற்றும் மென்பொருள்).<br /> <br /> 3.9. அது சேவை பயன்படுத்தி போது நீங்கள் விதிக்கப்படலாம் என்று அனைத்து செலவுகள் மற்றும் செலவுகள் கொடுக்க வேண்டியது உங்கள் பொறுப்பு, (உள்ளிட்ட, ஆனால் அனைத்து தொலைபேசி அழைப்பு அல்லது வரி கட்டணங்கள் அல்லது இணைய தரவு சேவை அணுக குற்றச்சாட்டுக்களை மட்டுமே அல்ல).</p>\n<ol start=\"4\">\n<li><strong>பயனர்</strong><strong>-</strong><strong>உருவாக்கிய</strong> <strong>உள்ளடக்க</strong></li>\n</ol>\n<p>4.1. நீங்கள் ஒன்றாக (முற்றிலும் ஏதேனும் பதிவுகள் <strong>(\"</strong><strong>வீடியோ</strong> பதிவுகளை\") பயன்படுத்துவதற்கு பொறுப்பு, Dubs, வார்த்தைகள், நீங்கள் பதிவேற்ற அல்லது சேவை வழியாக உருவாக்க என்று தகவல், செய்திகள் மற்றும் வேறு எந்த உள்ளடக்கம், ஆகியவை அல்லது அதை பகிரங்கமாக கிடைக்க மேற்கொள்ளப்பட்டன இருந்தால் <strong>\"</strong><strong>பயனர்</strong> <strong>உள்ளடக்கம்</strong><strong>\").</strong><strong>நீங்கள்</strong> <strong>உங்கள்</strong> <strong>பயனர்</strong> <strong>உள்ளடக்கத்தின்</strong> <strong>உரிமையை</strong> <strong>தக்க</strong> <strong>வைத்துக்</strong> <strong>கொண்டுள்ளன</strong><strong>.</strong> &nbsp;<br /> <br /> 4.2. நீங்கள் சேவை பதிவேற்றும் வீடியோ சேவை மற்ற செய்த பகிரங்கப்படுத்தப்படவில்லை.பதிவேற்றுவதால், புரிந்து உங்கள் பெயர் ஒவ்வொரு ரெக்கார்டிங் தொடர்பாக பகிரங்கமாக வெளியிட வேண்டும் என்பதை ஒப்புக்கொள்கிறீர்கள் நீங்கள் பதிவுகளை தொடர்பாக உங்கள் பெயரையே காட்ட மற்றும் இல்லையெனில் உரிமை ஸ்பிரிண்ட் Apps மற்றும் எங்கள் இணை வழங்க வேண்டும் என்று.<br /> <br /> 4.3. நீங்கள் சேவை தொடர்பாக எடுத்து என்று எந்த Dubs / வீடியோக்களை உள்ளமைவாக சேமிக்கப்படும் மற்றும் நீங்கள் வெளிப்படுத்திக் கொண்ட போது, சேவை பதிவேற்றப்படும்<br /> <br /> 4.4. நீங்கள் புரிந்து சேவை மற்றும் பயனர் உள்ளடக்கம் மற்றும் உங்கள் பயன்படுத்துவது தொடர்பாக, அனைத்து சட்டங்கள் இணங்க ஒப்புக்கொள்கிறேன். &nbsp;<br /> <br /> 4.5. நீங்கள் எல்லா நேரங்களிலும் உங்கள் உள்ளடக்கம் இல்லை என்று உறுதி:</p>\n<ol>\n<li>பதிப்புரிமை, வர்த்தக குறி உரிமைகள், ரகசிய தகவல் அல்லது தனியுரிமை உரிமைகள் உட்பட எந்த மூன்றாம் கட்சி அரசியல் உரிமைகளை மீறும் எந்த உள்ளடக்கத்தையும், தகவல் அல்லது பொருள் கொண்டிருக்கின்றன;</li>\n<li>பொருந்தக்கூடிய சட்டங்கள் முறித்தே வருகின்றனர்;</li>\n<li>ஊக்குவிக்கிறது அல்லது வன்முறை, பயங்கரவாதம் அல்லது வேறு எந்த சட்டவிரோத செயல்கள் ஊக்குவிக்கிறது அல்லது வருத்தம், தொல்லை வாய்ப்பு உள்ளது, இது, இது அநாகரீகமான, வெளிப்படையான பாலியல், தாக்குதல் தவறான, அவதூறான, பதிவேற்றம், இடுகை, தரக்குறைவான, கொடுமைப்படுத்துதல், பாரபட்சம் காட்டும், ஆபாசமான, வன்முறையான என்று எந்த உள்ளடக்கமும் அல்லது பொருளைக் கொண்டிருக்கும் ,, எச்சரிக்கை, சிரமத்திற்கு தர்மசங்கடமாக்குகின்றன அல்லது எந்த நபர் தொந்தரவு;</li>\n<li>எந்த வழியில் ஊக்குவிக்க அல்லது ஈடுபடுவதற்கு அல்லது எந்த சட்டவிரோத அல்லது கிரிமினல் நடவடிக்கை அல்லது சமூக விரோத நடத்தை உதவ, அல்லது மற்றவர்கள் பாதுகாப்பு அல்லது நன்மைக்காக ஆபத்து விளைவிக்கும் அவை நடவடிக்கைகள் ஊக்குவிக்க யாரும் தூண்டவில்லை;</li>\n<li>அவர்கள் 18 வயதுக்கு கீழ் இருந்தால் அனுமதியில்லாமல் நபர், அல்லது அவர்களின் பெற்றோர் அல்லது பாதுகாவலரின் ஒப்புதல் கண்டறிதல்;</li>\n<li>யாருடைய தனிப்பட்ட தொடர்பு விவரங்களை வெளியிட அல்லது அவர்களின் தனியுரிமை படையெடுத்து;</li>\n<li>எந்தவித வைரஸ்கள் அல்லது தீங்கிழைக்கும் அல்லது தீங்கு திட்டங்கள் கொண்டுள்ளன; அல்லது</li>\n<li>எந்த விளம்பர அல்லது விளம்பர செய்திகளை உள்ளடக்கியுள்ளது.</li>\n</ol>\n<p><br /> 4.6. மேலும், நீங்கள் புரிந்து நீங்கள் செய்ய அல்லது செய்ய அல்லது செய்ய முயற்சிக்கும் எந்த மூன்றாம் தரப்பு செய்ய முயற்சிக்கும், அல்லது ஏற்படுத்தாது என்பதை ஒப்புக்கொள்கிறேன் சேவை பயன்பாட்டை தொடர்பாக பின்வரும் எந்த:</p>\n<ol>\n<li>என வெளிப்படையாக இந்த விதிமுறைகள் மற்றும் சேவை சாதாரண செயல்பாடு மூலம் அனுமதி தவிர சேவையின் கிடைக்கும் சேவை அல்லது பயனர் உள்ளடக்கத்தை பயன்படுத்த;</li>\n<li>கடன் அட்டை எண்கள், கணக்கு கடவுச்சொற்கள் போன்றவை, மற்ற மக்களின் தனிப்பட்ட மற்றும் / அல்லது ரகசியமான தகவலை .;</li>\n<li>ஒரு சட்டவிரோத முறையில் அல்லது இந்த விதிமுறைகள் இணக்கமாக ஏதாவது விதத்தில் எந்த சட்டவிரோத நோக்கத்திற்காக பயன்படுத்த;</li>\n<li>ஆள்மாறாட்டம் அல்லது சேவை பயன்பாட்டின் மூலமாக வேறு யாரையும் பாசாங்கு;</li>\n<li>சேவை எங்கள் அமைப்புகள் அல்லது பாதுகாப்பு அல்லது பிற பயனர்களை தலையிட, பழுதாக்கவோ, முடக்க, சேதப்படுத்தும் முடக்குகின்றன, அல்லது சமரசம் என்று ஒரு வழியில் சேவை பயன்படுத்த;</li>\n<li>பிரித்தெடுக்க பதிவிறக்க, குறியீட்டு, என்னுடைய, சுரண்டு, இனப்பெருக்கம் அல்லது வழங்கல், அறுவை சிகிச்சை அல்லது சேவை அவர்களுடைய பயன்படுத்தி அல்லது எந்த அம்சங்கள் கடக்கும் வகையில், என்பதை கைமுறையாக அல்லது தானாக உள்ளிட்ட, ஆனால் திரைக்கதை, சிலந்திகள் மற்றும் ரோபாட்டுகளின் மட்டுமே அல்ல, எந்த நிரல் அல்லது மற்ற வழிகளில் பயன்படுத்த அல்லது அது சார்புகள்;</li>\n<li>நகல், மாற்ற சேவையின் ஏதேனும் ஒரு பகுதியில் தலையிட இல்லையெனில் தொகுப்பைப் பிரித்தல் அல்லது;</li>\n<li>மாற்றங்களை, அல்லது மாற்றங்களை சேவை, சேவை, முழு அல்லது பகுதி, அல்லது சேவை அல்லது அது எந்த பகுதி அனுமதி இணைந்து வேண்டும், அல்லது, மற்ற நிரல்கள் இணைக்கப்பட்டது ஆக;</li>\n<li>ஹேக், அல்லது, சேவை ஒரு வைரஸ்கள், அல்லது தீங்கு தரவு உட்பட தீங்கிழைக்கும் குறியீடு, நுழைக்க; அல்லது</li>\n<li>சேவை பயன்பாட்டை தொடர்பான எமது அறிவுசார் சொத்து மீறாது.</li>\n</ol>\n<p>4.7. நீங்கள் ஒப்புக்கொள்ள மற்றும் நாம் வெறுமனே ஒரு செயலற்ற காண்டூயிடை மற்றும் பயனர் உள்ளடக்க ஹோஸ்டிங் சேவை என்று ஏற்றுக் என்று நாம் பயனர் உள்ளடக்கம் மற்றும் விநியோக அல்லது வழங்கல் தற்போது எந்த பங்கு வகிக்கின்றன. &nbsp;<br /> <br /> 4.8. நாம் உள்ளடக்கம் சேவை அன்று கண்காணிக்க தரவில்லை கீழ் உள்ளன, நாம் போன்ற பயனர் உள்ளடக்கத்தை எந்த பொறுப்பை எடுத்து கொள்ள கூடாது என்றோ, அல்லது நாங்கள், ஆதரவு ஒப்புதல் அல்லது வழியாக இடப்பட்டவை எந்த உள்ளடக்கம் அல்லது தகவல் தொடர்பு முழுமை, துல்லியம் அல்லது நம்பகத்தன்மை உத்தரவாதம் செய்ய சேவைகள் அல்லது கருத்துக்களை அதில் வெளிப்படுத்தினார். எந்த உள்ளடக்கம் அல்லது பொருட்கள் சேவை மூலமாக இடுகை அல்லது சேவை வாயிலாக பெறப்படும் மீது பயன்பாடு அல்லது நம்பகத்தன்மை உங்களுடைய சொந்த ஆபத்து உள்ளது. &nbsp;<br /> <br /> 4.9. SprintApps, எந்த பிழைகளை அல்லது விட்டுவிடுதல் அதிலுள்ள, அல்லது ஏதேனும் பயனர் உள்ளடக்கம் மற்றும் பயன்படுத்துவதன் விளைவாக ஏற்படும் எந்த வகையான எந்த இழப்பு அல்லது சேதம் உள்ளிட்ட பயனர் உள்ளடக்கம், எந்த வழியில் பொறுப்பாக இருக்க, ஆனால் இது மட்டுமே வேண்டாம், மின்னஞ்சலில், பரவும் அல்லது சேவை வழியாக கிடைக்கும் அல்லது வேறு வேறு ஒளிபரப்பப்பட்டது.&nbsp;<br /> <br /> 4.10. நாங்கள் எங்கள் சொந்த விருப்பத்தின் பேரில், இந்த விதிமுறைகளை மீறல்கள் ஏதாவது என நம்புகின்றனர், அல்லது நாம் இந்த விதிமுறைகளை மீற வாய்ப்பு உள்ளது என்று நம்ப நியாயமான அடிப்படையில் இருந்தால், நாம் என்று எந்த நடவடிக்கை சேவை மற்றும் பாதுகாக்க வேண்டும் ஆகலாம் அதன் பயனர்கள். நாம் (நாம் என்று திரும்பி தொகையை பெற சொல்வார்கள் நாம் ஏனெனில், உங்கள் பயனர் உள்ளடக்கம் மற்றும் சேதம் செலுத்த வேண்டியிருந்தது என்றால், எடுத்துக்காட்டாக), இந்த சேவையை பயன்படுத்த சேவையில் இருந்து, உங்கள் பயனாளர் உள்ளடக்கத்தையும், நீங்கள் சட்டபூர்வ நடவடிக்கை எடுக்க உங்கள் வலது திரும்ப மற்றும் பிற நடவடிக்கை பொருத்தமான, நாம் கருதுகிறோம்.</p>\n<ol start=\"5\">\n<li><strong>சேவை</strong> <strong>உரிமம்</strong></li>\n</ol>\n<p>இந்த விதிமுறைகள் உங்கள் தவிர்ந்த, ஸ்பிரிண்ட் ஆப்ஸ் இந்த விதிமுறைகள் மற்றும் தனியுரிமை கொள்கை உட்பட்டு சேவை பதிவிறக்க மற்றும் / அல்லது பயன்படுத்த ஒரு தனிப்பட்ட, உலகளாவிய, ராயல்டி இலவச, அல்லாத பரிமாற மற்றும் அல்லாத உரிமத்தை வழங்குகிறது.</p>\n<p><br /> &nbsp;</p>\n<ol start=\"6\">\n<li><strong>ஸ்பிரிண்ட்</strong> <strong>ஆப்ஸ்</strong> <strong>உரிமைகள்</strong></li>\n</ol>\n<p>6.1. அனைத்து உரிமைகளும், தலைப்புகள் மற்றும் மற்றும் சேவை நலன்களை (தவிர்க்கும் உள்ளடக்கத்தைப் பதிவேற்றிய அல்லது இல்லையெனில் பயனர்களால் வழங்கப்பட்டது) மற்றும் ஸ்பிரிண்ட் Apps மற்றும் அதன் உரிமம் தனிப்பட்ட சொத்து இருக்கும், என்றார்.<br /> <br /> 6.2. / ஏற்றும் சேவை பொது எந்த பதிவுகள் மூலம், நீங்கள் தொடர்பாக ஒரு உலகளாவிய, நீங்கள் உங்கள் பெயரை சேர்த்து, சேவை பதிவேற்றும் எந்த பதிவுகள் பயன்படுத்த கட்டுப்பாடற்ற, எல்லையற்ற, இலவச ஆதாய பரிமாற முடியாத உரிமத்தையும், ஸ்பிரிண்ட் ஆப்ஸ் வழங்க சேவை இந்த விதிகள் மற்றும் எங்கள் கொள்கை உட்பட்டது.</p>\n<ol start=\"7\">\n<li><strong>பதிப்புரிமை</strong><strong>, </strong><strong>அறிக்கையிடல்</strong> <strong>மற்றும்</strong> <strong>அறிவிப்பு</strong><strong> &amp; </strong><strong>தரமிறக்குதல்</strong> <strong>கொள்கையை</strong></li>\n</ol>\n<p>7.1. ஸ்பிரிண்ட் ஆப்ஸ் மற்றவர்கள் அறிவுசார் சொத்து உரிமைகளை மதிக்கிறது மற்றும் சேவை பயனர்கள் அதே செய்ய எதிர்பார்க்கிறது.&nbsp;<br /> <br /> 7.2. நீங்கள் உங்கள் பதிப்புரிமை மீறுவதாக நம்பும் மேடை எந்த உள்ளடக்கம் கண்டறிய என்றால், பின்வரும் தகவல் உட்பட எழுத்து வடிவில் நமக்கு இந்த புகார் செய்க:</p>\n<ol>\n<li>உங்கள் பதிப்புரிமை அல்லது நீங்கள் நடிக்க என்ற தலைப்பில், அதன் சார்பாக ஒரு மூன்றாம் தரப்பு பதிப்புரிமையை மீறுவதாக மேடை மீது உள்ளடக்க அடையாளம் என்று அறிக்கை;</li>\n<li>மீறப்பட்டுள்ளதாக நீங்கள் கூறுவது என்று காப்புரிமை வேலை விவரம்;</li>\n<li>மீறுவதாக நீங்கள் மற்றும் விவரங்களை கூறுவது என்று உள்ளடக்கம் இடத்தின் விவரம் மேடை நீங்கள் காணலாம் மீறும் வகையில் உள்ளது என்று கூறுகின்றனர் உள்ளடக்கத்தைத் தொடர்ந்து</li>\n<li>உங்கள் முழுப்பெயர், முகவரி, தொலைபேசி எண் மற்றும் நீங்கள் தொடர்பு கொள்ள முடியும் ஒரு செல்லுபடியாகும் மின்னஞ்சல் முகவரி உள்ளிட்ட, உங்கள் தொடர்பு தகவல்களை;</li>\n<li>நீங்கள் பொருள் பிரச்சினைக்குரிய பயன்பாடானது, பதிப்புரிமை உரிமையாளர், அதன் முகவர் அல்லது சட்டத்தால் அங்கீகரிக்கப்படவில்லை என்று ஒரு நல்ல நம்பிக்கை உண்டு என்று நீங்கள் அறிக்கை; மற்றும்</li>\n<li>உங்கள் அறிக்கையில் உங்கள் கவனத்திற்கு தகவல் துல்லியமாக உள்ளது மற்றும் நீங்கள் மீறப்பட்டுள்ளதாகக் கூறப்படும் பிரத்யேக உரிமையின் உரிமையாளர் சார்பாக செயல்பட அங்கீகரிக்கப்பட்ட என்று.</li>\n</ol>\n<p>நீங்கள், உங்கள் அறிவிப்பை விரும்பினால் கூடுதலாக, இந்திய டிஜிட்டல் மில்லினியம் பதிப்புரிமை சட்டம் ஒரு அறிவிப்பு இணங்க கருதப்படுகிறது, மேலும் பின்வரும் பின்வருமாறு செய்க</p>\n<ol>\n<li>ஒரு அறிவிப்பு வாக்குத்தவறல் தண்டனையின் கீழ், விதிமீறல் கூறப்படும் பிரத்தியேக காப்புரிமை உரிமையாளர் சார்பாக செயல்படும் அங்கீகாரம் உரிமையாளர் அல்லது என்று; மற்றும்</li>\n<li>(ஸ்கேன் நகல் இருக்கலாம்) உங்கள் மின்னணு அல்லது உடல்சார் கையொப்பம்.</li>\n</ol>\n<p>7.3. உங்கள் அறிவிப்பு எங்களுக்கு அல்லது மின்னஞ்சல் மூலம் நாங்கள் நியமிக்கப்பட்ட பதிப்புரிமை முகவருக்கு, அனுப்ப <a href=\"mailto:copyright@dubsmash.com\">பதிப்புரிமை @</a> <span style=\"text-decoration: underline;\">sprintapps.in</span> அல்லது பின்வரும் முகவரிக்கு அனுப்பி மின்னஞ்சல் மூலம்:<br /> <br /> ஸ்பிரிண்ட் ஆப்ஸ் பிரைவேட் லிமிடெட்.,&nbsp;<br /> முதல் தளம், H.NO. 8-2-269 / 19 / எஸ் / 1,</p>\n<p>ரோடு இல்லை. 2 பஞ்சாரா ஹில்ஸ், ஹைதெராபாத் 500 034, தெலுங்கானா, இந்தியா<br /> கவனம்: பதிப்புரிமை குழு&nbsp;<br /> <br /> 7.4. நீங்கள் பெறும்போது அல்லது என்கவுண்டர் பதிவுகளை அல்லது மற்ற உள்ளடக்கம் நீங்கள் இந்த சேவை மூலம் தாக்குதலை கண்டறிய, அல்லது நீங்கள் நம்பினால், மேலும் பயனர்கள் இந்த விதிமுறைகள் மற்றும் / அல்லது தனியுரிமை கொள்கை மீறுவதாக இருந்தால், நாம் நேரடியாக தொடர்புடைய பயனர் தொடர்பு மற்றும் பரஸ்பர உடன்பாட்டு தீர்வு வரும் முயற்சியில் பரிந்துரைக்கிறோம் . இந்த ஒரு திருப்திகரமான முடிவை ஏற்படுத்தும் இல்லை என்றால், மின்னஞ்சல் வழியாக எங்களிடம் புகார் தயவு செய்து <a href=\"mailto:copyright@dubsmash.com\">பதிப்புரிமை @</a> தொடர்புடைய பதிவின் \"அறிக்கை\" இணைப்பு வழியாக சேவை கிடைக்கும், பதிவு ஒலி தொடர்பாக என்றால், <span style=\"text-decoration: underline;\">sprintapps.in</span> அல்லது.</p>\n<p>&nbsp;</p>\n<ol start=\"8\">\n<li><strong>விளம்பரம்</strong></li>\n</ol>\n<p>நாம் சேவை பயன்பாட்டை இணைந்து நீங்கள் விளம்பர கூறப்பட்டுள்ளது.</p>\n<ol start=\"9\">\n<li><strong>தனிக்</strong></li>\n</ol>\n<p>நீங்கள் ஸ்பிரிண்ட் Apps க்கு சப்ளை என்று தகவல் எங்கள் சேகரிப்பு மற்றும் தனிப்பட்ட தரவு உள்ளடக்கும் உங்கள் தகவல்களை பயன்படுத்தி ஆளும் எங்கள் கொள்கை, உட்பட்டது.எங்கள் சேவை வழங்குவதற்கான ஒரு பகுதியாக, நாங்கள் அத்தகைய சேவை அறிவிப்புகள், மற்றும் நிர்வாக செய்திகளை வழங்காமல், உங்களுக்கு வழங்க வேண்டும். இந்த தகவல் நீங்கள் விலகிக்கொள்ள பெறும் இருந்து முடியாமல் போகலாம், ஐடி சேவைகளை, பகுதியாக கருதப்படுகிறது.</p>\n<ol start=\"10\">\n<li><strong>மூன்றாம்</strong> <strong>சேவைகள்</strong></li>\n</ol>\n<p>சேவை உள்ளடக்கியது மற்றும் ஒரு மூன்றாம் தரப்பினரால் வழங்கப்பட்ட என்று (முகம் புத்தகம் மற்றும் பயன்கள் போன்ற, சமூக பயன்பாடுகள் உள்ளிட்ட ஆனால் இல்லை) அம்சங்கள் மற்றும் சேவைகளை இணைப்புகள்.நாம் அத்தகைய மூன்றாம் தளங்கள் அல்லது சேவைகள் கட்டுப்படுத்த மற்றும் அத்தகைய தளங்கள் அல்லது சேவைகள் உள்ளடக்கம் அல்லது செயல்பாடு பொறுப்பு அல்ல. இணைப்புகள் எங்கள் சேர்ப்பதற்காக தங்கள் ஆபரேட்டர்கள் மூலம் ஒப்புதல் அல்லது சங்கம் என்று அர்த்தப்படாது. அத்தகைய மூன்றாம் சேவைகள் பயன்படுத்துவதற்கு பொருந்தும் வகையில் பொருந்தும் மற்றும் நாம் அவர்களின் சேவை பயன்பாட்டை தொடர்பாக நீங்கள் அல்லது மூன்றாம் தரப்பு சேவை வழங்குநர் மூலம் செய்யப்படுகிறது என்று நீ பொறுப்பாக இருக்க முடியாது.</p>\n<ol start=\"11\">\n<li><strong>முடித்தல்</strong></li>\n</ol>\n<p>11.1. இடைநீக்கம் அல்லது எங்கள் சொந்த விருப்பத்தின் பேரில், எந்த நேரத்திலும், எந்த காரணத்திற்காகவும் சேவையை பயன்பாடு மற்றும் அணுகல் முடித்துக்கொள்ளலாம். இத்தகைய இடைநிறுத்த அல்லது முற்றிலும் பொருத்தமான, நாம் பரிசீலிக்க வேண்டும் என்று உங்களுக்கு எதிராக எந்த நடவடிக்கை எடுத்து எங்கள் உரிமையை குறைத்தல். &nbsp;<br /> <br /> 11.2. நீங்கள் உங்கள் சாதனத்தில் இருந்து, ஆப் சேவை பயன்படுத்த ஒழிந்துபோவதற்கான மற்றும் / அல்லது நீக்குவதன் மூலம் எந்த நேரத்திலும் சேவை பயன்பாட்டை முடித்துக்கொள்ளலாம். உங்கள் சுயவிவரம் மற்றும் Pakodi அட்டவணை நிலையிலேயே இருக்கும் பதிவேற்றிய எந்த பதிவுகள் நீக்கப்படாது ஒரு சாதனத்திலிருந்து ஒரு பயன்பாட்டை நீக்குகிறது, என்பதை நினைவில் கொள்ளவும்.நீங்கள் உங்கள் சுயவிவர நீக்க விரும்பினால், எழுதும் எங்களுக்கு தொடர்பு கொள்ளவும் <a href=\"mailto:contact@sprintapps.in\">contact@sprintapps.in</a><br /> <br /> 11.3. அல்லது கட்சி போன்ற முடித்துக்கொள்ளும்போது இந்த விதிகள் முறித்து, ஆனால் பின்வரும் விதிகள் தொடர்ந்து பயன்படுத்தப்படும்: பிரிவுகள் 3, 4, 6, 7, 9, 10, 11, 12, 13, 14 மற்றும்.</p>\n<ol start=\"12\">\n<li><strong>பிரதிநிதித்துவங்கள்</strong> <strong>மற்றும்</strong> <strong>உத்தரவாதங்கள்</strong></li>\n</ol>\n<p>12.1. நீங்கள் எங்களுக்கு என்று உறுதியளித்துள்ளன:</p>\n<ol>\n<li>எந்த அறிவுசார் சொத்து, ரகசிய தகவல் அல்லது தனியுரிமை உரிமைகள் உரிமைகள் உட்பட எந்த மூன்றாம் கட்சி உரிமைகள், மீறாது உங்கள் பயனர் உள்ளடக்கம்;</li>\n<li>நீங்கள் உள்ளடக்கம் காணப்படும் எந்த நபர்கள் இருந்து தேவையான அனைத்து அனுமதிகளையும் சம்மதம் பெற்றுள்ளனர்; மற்றும்</li>\n<li>உங்கள் உள்ளடக்கம் இந்த விதிமுறைகள் இணங்க வேண்டும்.</li>\n</ol>\n<p>12.2. இந்த விதிமுறைகள் 13 ஆம் பிரிவின் பொருள், நீங்கள் நாம் நியாயமாக மற்றும் மிகவும் நீங்கள் தரப்புக்கும் தவறு எங்கே இந்த விதிமுறைகளை நீங்கள் எந்த மீறி விளைவாக விதிக்கப்படலாம் எந்த இழப்புகள் அல்லது செலவுகள் எங்களுக்கு ஈடு செய்ய ஒப்புக்கொள்கிறீர்கள். இந்த விதிமுறைகளில் மீறுவது எங்கள் கவனக்குறைவு அல்லது இந்த விதிமுறைகளை எங்கள் மீறலையும் தோன்றுகின்றது என்றால் இந்த பிரிவின் கீழ் எங்களுக்கு ஈடு செய்ய தேவை இல்லை;.</p>\n<ol start=\"13\">\n<li><strong>மறுதலிப்புகள்</strong> <strong>மற்றும்</strong> <strong>கட்டுப்பாடுகள்</strong></li>\n</ol>\n<p>13.1. சேவை பயன்பாட்டை மற்றும் \"கிடைக்கப்பெறும்\" அடிப்படையில், \"உள்ளபடியே\" ஒரு உள்ளது. சேவை காட்டப்படும் ஏதேனும் உள்ளடக்கம் அல்லது பொருள் அதன் துல்லியம், பொருந்து முழுமை அல்லது நம்பகத்தன்மை குறித்த எந்த உத்தரவாதங்களை, நிபந்தனைகள் அல்லது காப்புறுதிகள் இல்லாமல் வழங்கப்படுகிறது. நாம் சேவை இன்மை அல்லது தோல்வி உங்களுக்குப் பொறுப்பேற்க முடியாது. &nbsp;<br /> <br /> 13.2. நாம் வெளிப்படையாக இந்த விதிமுறைகளை மீறுதல் எவரும் சேவையின் பயன்பாடு இருந்து எழும் இழப்பு அல்லது சேதம் எங்கள் பொறுப்பு ஒதுக்கப்பட. நீங்கள் dubs, சேவையில் இருக்கும் கிடைக்கும் இசைப்பதிவுகளும் வேறு எந்த உள்ளடக்க அமெரிக்க பயனர்களும், இல்லை வழங்கப்படும் என்று புரிந்து கொண்டு சேவையில் இருக்கும் இந்த உள்ளடக்கத்திற்கு உங்களிடம் பொறுப்பு அல்லது LIABILE இருக்கிறது. &nbsp;<br /> <br /> 13.3. நாம் வெளிப்படையாக எந்த பொறுப்பு (ஒரு) ஏதேனும் இழப்புகள் அல்லது அமெரிக்காவால் நியாயமான எதிர்பார்க்க்கூடிய இல்லை என்று, மற்றும் இலாபங்களை இழப்பு உள்ளிட்ட சேவை, மற்றும் இதனுடன் சம்பந்தப்பட்ட நீங்கள் ஏற்படுத்தப்படும் சேதத்தை விலக்கி மற்றும் (ஆ) ஏதேனும் இழப்புகள் அல்லது சேதங்கள் இந்த விதிமுறைகளை மீறுவது போன்றவற்றால் விளைவாக நீங்கள் ஏற்பட்ட. &nbsp;<br /> <br /> 13.4. சட்டத்தால் அனுமதிக்கப்பட்ட முழுமையான அளவிற்கு, எங்கள் செயற்பாடுகளைத் எந்தவொரு கூற்றையும் நடவடிக்கை அல்லது அடிப்படையிலும் வடிவில், நீங்கள் அல்லது எந்த இழப்பு அல்லது சேதம் வேறு கட்சி பொறுப்பாக இருக்க கூடாது. நீங்கள் ஒப்புக்கொள்ள மற்றும் நம்முடன் எந்த விவகாரங்களுக்கும் உங்களுடைய தனிப்பட்ட மற்றும் பிரத்தியேக தீர்வு சேவையைப் பயன்படுத்துவதற்கான முடிந்துவிடும் என்பதை ஒப்புக்கொள்கிறேன். &nbsp;<br /> <br /> 13.5. அல்லது குறைக்க எங்கள் பொறுப்பு ஒதுக்கப்பட வேண்டும் இந்த வகையில் எதுவும் அவை: (i) மரணம் அல்லது எங்கள் அலட்சியம் தனிப்பட்ட காயம்; (Ii) இந்த வேண்டுமென்றே செயல்கள், மோசடி மற்றும் மோசடி வகையில் தவறான; (iii) விலக்கப்பட்ட அல்லது சட்டத்தால் மட்டுமே இருக்க முடியும் என்று வேறு பொறுப்பு.</p>\n<ol start=\"14\">\n<li><strong>முடித்தல்</strong></li>\n</ol>\n<p>இந்த விதிமுறைகளையும், நிறுத்தவும் நாம் சேவை வழங்க நிறுத்தப்படும், என்றால், முன்னறிவிப்பு இல்லாமல் எந்த நேரத்திலும் உங்கள் கணக்கை மூடி விடலாம்.</p>\n<ol start=\"15\">\n<li><strong>பிற</strong> <strong>விதிமுறைகள்</strong></li>\n</ol>\n<p>15.1. ஸ்பிரிண்ட் ஆப்ஸ், ஒதுக்க துணை ஒப்பந்தம் மற்றும் / அல்லது எந்த நிறுவனம், நிறுவனம் அல்லது நபர் இந்த விதிமுறைகளின் கீழ், எங்கள் உரிமைகள் மற்றும் / அல்லது கடமைகளை எந்த அல்லது அனைத்து பரப்பலாம்.நீங்கள் வேறு யாரையும் இந்த விதிமுறைகளின் கீழ் உங்கள் உரிமைகள் அல்லது பொறுப்புக்களை இந்த அமைப்பிடம் ஒப்படைக்க முடியாது. &nbsp;<br /> <br /> 15.2. இந்த விதிமுறைகளுக்கு ஒவ்வொன்றும் தனித்தனியாக செயல்படுகிறது. இந்த விதிமுறைகள் உள்ள விதிகள் எந்த சட்டவிரோத அல்லது செயல்படுத்த முடியாததாக நடைபெறும் என்று நிகழ்வு அந்த விதிகள் மட்டுமே அல்லது குறைந்த பட்சம் தேவையான நீக்கப்பட்டது, இந்த விதிமுறைகளின் மீதமுள்ள விதிகள் முழு ஆற்றலுடன் அமலில் இருக்கும். &nbsp;<br /> <br /> 15.3. இந்த விதிமுறைகளும் எங்கள் கொள்கை நீங்கள் எங்களுக்கு இடையே முழு உடன்பாடு மற்றும் அனைத்து முந்தைய மற்றும் தற்போது இருக்கும் ஒப்பந்தங்களையும் அல்லது தகவல் தொடர்பு நியமி. &nbsp;<br /> <br /> 15.4. விதிமுறைகளை கட்சி அல்ல யார் இல்லை நபர் அதை எந்த கால செயல்படுத்த இருக்கலாம். &nbsp;<br /> <br /> 15.5. இந்த விதிமுறைகள், மற்றும் எந்த பிரச்சினை அல்லது (ஒப்பந்தமுறையற்ற மோதல்களில் அல்லது கூற்றுக்கள் உட்பட) வெளியே அல்லது அது அல்லது அதன் பொருளை அல்லது உருவாக்கம் தொடர்பாக எழும் கூற்று மூலம் ஆட்சி மற்றும் இந்திய சட்டப்படி உய்த்துணரப்பட்டது மற்றும் கட்சிகள் இதன்மூலம் சட்ட உரிமையையும் submit \' இந்திய நீதிமன்றங்களின் எந்த தீர்க்க அல்லது இந்த விதிமுறைகள் அல்லது (ஒப்பந்தமுறையற்ற மோதல்களில் அல்லது கூற்றுக்கள் உட்பட) அதன் பொருளை அல்லது உருவாக்கம் தொடர்பாக எழும் பிரச்சினையில்லை.</p>\n<p><strong>பயனுள்ள</strong><strong>: 2015 </strong><strong>ஆகஸ்ட்</strong></p>',2,'2015-07-24 15:53:52'),(7,4,'About Us - Kannada','<p><strong><span style=\"color: #ff0000;\">ಪಕೋಡಿ ಬಗ್ಗೆ</span></strong></p>\n<p>ಜನರು ತಮ್ಮ ಬೇಸರವಾದ ಮತ್ತು ನೀರಸ ಮಾತುಕತೆಗಳಿಂದಲೇ ದಿನಗಳನ್ನು ಕಳೆಯುತ್ತಿದ್ದ ಒಂದು ಕಾಲವಿತ್ತು, ಆದರೆ ಆ ದಿನಗಳು ಈಗಿಲ್ಲ. ಇಂದು ಅಧ್ಭುತವಾದ ಆಪ್ ಗಳ ಅನ್ವೇಷಣೆಯಿಂದಾಗಿ ಈ ನೀರಸವಾದ ಮತ್ತು ಬೇಸರವಾದ ಮಾತುಕತೆಗಳು, ಎಂದರೆ ನಿಮ್ಮ ಪ್ರೀತಿಪಾತ್ರರೊಂದಿಗಿರಬಹುದು ಮತ್ತು ನಿಮ್ಮ ಸ್ನೇಹಿತರೊಂದಿಗಿರಬಹುದು, ನೀವು ನಡೆಸುವ ಸಂಭಾಷಣೆಗಳಿಗೆ ಹೊಸ ಜೀವ ಬಂದಂತಾಗಿದೆ. ಇಂದು ಸಂಭಾಷಣೆಗಳಲ್ಲಿ &rsquo;ಎಕ್ಸ್&rsquo; ಅಂಶ ಎಷ್ಟು ದೃಢವಾಗಿರುತ್ತದೋ, ಅಷ್ಟೇ ಚುರುಕಾಗಿ ಮಾತನಾಡುವ ವ್ಯಕ್ತಿಯ ಬಗ್ಗೆಯೂ ಗ್ರಹಿಸಬಹುದಾಗಿದೆ.</p>\n<p>ಪಕೋಡಿ ಎಂಬುದು, ಸ್ವಾರಸ್ಯಕರವಾದ ಪಂಕ್ತಿಗಳು, ಸಿನಿಮಾ ಡೈಲಾಗ್ ಗಳು, ಕಾಮಿಡಿ ಕ್ಲಿಪ್ ಗಳು ಮತ್ತು ಒಬ್ಬ ವ್ಯಕ್ತಿ ತಾನು ನೋಡಬೇಕು ಅಥವಾ ಕೇಳಬೇಕೆಂದು ಕನಸು ಕಾಣುವಂತಹ ಯಾವುದನ್ನೇ ಆದರೂ ಕ್ಷಣಮಾತ್ರದಲ್ಲಿ ಹುಡುಕಬಹುದಾದ ಅನನ್ಯ ವೇದಿಕೆಯಾಗಿದೆ. ಈಗ ನೀವು ಆಡಿಯೋ ಕ್ಲಿಪ್ ಗಳನ್ನು ಕಳುಹಿಸಬಹುದು, ವೀಡಿಯೋಗಳನ್ನು ರೆಕಾರ್ಡ್ ಮಾಡಿಕೊಳ್ಳಬಹುದು, ಚಲನಚಿತ್ರ ಅಥವಾ ಸೌಂಡ್ ಕ್ಲಿಪ್ ಗಳೊಂದಿಗೆ ಅವುಗಳಿಗೆ ಡಬ್ ಮಾಡಬಹುದಾಗಿದೆ. ಪಕೋಡಿ ಆಪ್ ಇವುಗಳನ್ನು ವಾಟ್ಸ್ಆಪ್, ಗೂಗಲ್+, ಫೇಸ್ ಬುಕ್, ಟ್ವಿಟರ್, ಇತ್ಯಾದಿಗಳಂತಹ ಸಾಮಾಜಿಕ ಮಾಧ್ಯಮ ವೇದಿಕೆಗಳಲ್ಲಿ ಹಂಚಿಕೊಳ್ಳಲು ನಿಮಗೆ ಅವಕಾಶ ಮಾಡಿಕೊಡುತ್ತದೆ.</p>',1,'2015-07-24 16:01:49'),(8,4,'Terms and Conditions - Kannada','<p>(ಕಾಲಕಾಲಕ್ಕೆ ಅಪ್ಡೇಟ್ ಎಂದು, <strong>\"</strong><strong>ನಿಯಮಗಳು</strong><strong>\")</strong> ಈ ಸೇವೆಯ ನಿಯಮಗಳು ನಿಮ್ಮ ಪ್ರವೇಶವನ್ನು ಆಡಳಿತ ಮತ್ತು <strong>ಪಕೋಡಿ</strong> ಸೇವೆ ಬಳಕೆ (ಕೆಳಗೆ ವ್ಯಾಖ್ಯಾನಿಸಿದಂತೆ) ಮತ್ತು ಅಪ್ಲೋಡ್ ಯಾವುದೇ ಧ್ವನಿ ರೆಕಾರ್ಡಿಂಗ್, ವೀಡಿಯೊಗಳು, ಮಾಹಿತಿ, ಪಠ್ಯ, ಗ್ರಾಫಿಕ್ಸ್ ಅಥವಾ ಇತರ ವಿಷಯ ವಸ್ತುಗಳು, ಡೌನ್ಲೋಡ್ ಅಥವಾ ಸೇವೆ ಕಾಣಿಸುವ.ಎಚ್ಚರಿಕೆಯಿಂದ ಡೌನ್ಲೋಡ್ ಅಥವಾ ಸೇವೆ ಬಳಸುವ ಮೊದಲು ಈ ನಿಯಮಗಳನ್ನು ಒಮ್ಮೆ ಓದಿ. ಈ ನಿಯಮಗಳನ್ನು ಅಂಗೀಕರಿಸುವುದು, ಅಥವಾ ಸೇವೆ ಬಳಸಿಕೊಂಡು, ನೀವು ಅವುಗಳನ್ನು ಬದ್ಧರಾಗಿರಲು ಒಪ್ಪುತ್ತೀರಿ. ನೀವು ಕರಾರು ಅರ್ಥಮಾಡಿಕೊಳ್ಳಲಾಗಿಲ್ಲ, ಅಥವಾ ಯಾವುದೇ ಭಾಗದಲ್ಲಿ ಒಪ್ಪುವುದಿಲ್ಲ ವೇಳೆ, ನಂತರ ನೀವು ಸೇವೆ ಉಪಯೋಗಿಸಬಾರದು. (: ಇಮೇಲ್ ಸೇವೆ ಅವರ ವ್ಯವಹಾರ ಸ್ಥಳವು ಹೈದರಾಬಾದ್ ಭಾರತದ ಸ್ಪ್ರಿಂಟ್ ಅಪ್ಲಿಕೇಶನ್ಗಳು ಪ್ರೈವೇಟ್ ಲಿಮಿಟೆಡ್ <strong>(\"</strong><strong>ನಾವು</strong><strong>\", \"</strong><strong>ನಮಗೆ</strong><strong>\" \"</strong><strong>ನಮ್ಮ</strong><strong>\"</strong> ಮತ್ತು <strong>\"SprintApps\")</strong> ನೀಡುತ್ತಿದೆ <a href=\"mailto:contact@sprintapps.in)\">contact@sprintapps.in)</a> .</p>\n<ol>\n<li><strong>ಸೇವೆ</strong></li>\n</ol>\n<p>ಸೇವೆ ಆಂಡ್ರಾಯ್ಡ್ ಮತ್ತು IOS ಆವೃತ್ತಿಗಳಲ್ಲಿ ಲಭ್ಯವಿರುವ ಮೊಬೈಲ್ ಅಪ್ಲಿಕೇಶನ್ <strong>\"</strong><strong>ಪಕೋಡಿ</strong><strong>\"</strong> ನೀಡಲಾಗಿದೆ</p>\n<ol start=\"2\">\n<li><strong>ಬದಲಾವಣೆಗಳು</strong> <strong>ಮತ್ತು</strong> <strong>ಅಪ್ಡೇಟ್ಗಳು</strong></li>\n</ol>\n<p>2.1. ನಾವು ಯಾವುದೇ ಬದಲಾವಣೆಗಳನ್ನು ಪ್ರತಿಬಿಂಬಿಸಲು ಕಾಲಕಾಲಕ್ಕೆ ಈ ನಿಯಮಗಳ ನವೀಕರಿಸಬಹುದು: (ನಾನು) ನಮ್ಮ ನೀತಿಗಳ ಅಥವಾ ಸಂಬಂಧಿಸಿದ ಕಾನೂನುಗಳು ರಲ್ಲಿ; (II) ಸೇವೆಯ ಕಾರ್ಯವನ್ನು; ಅಥವಾ (iii) ಯಾವುದೇ ಮೂರನೇ ಪಕ್ಷದ ಪೂರೈಕೆದಾರರಿಂದ ನಮಗೆ ವಿಧಿಸಿದ. ಯಾವುದೇ ನವೀಕರಣಗಳನ್ನು ಸೇವೆ ಗಣನೆಗೆ ನಿಮ್ಮ ಸಮಂಜಸವಾದ ಆಸಕ್ತಿಗಳು ತೆಗೆದುಕೊಳ್ಳುತ್ತದೆ ಮತ್ತು ಬದಲಾವಣೆ ಪರಿಣಾಮವನ್ನು ಬೀರುವ ಮೊದಲು ಒಂದು ಸಮಂಜಸವಾದ ಸಮಯದಲ್ಲಿ ಇಮೇಲ್ ನಿಮಗೆ ತಿಳಿಸಲಾಗುವುದು. ಬದಲಾವಣೆಗಳು ಕಾಲಕ್ಕೆ ಅನ್ವಯವಾಗುವುದಿಲ್ಲ ಮತ್ತು ಅವರು ನಿಮಗೆ ಸೂಚಿಸಲಾಗುವುದು ನಂತರ ನವೀಕೃತ ನಿಯಮಗಳು ಪರಿಣಾಮಕಾರಿಯಾಗುವುದಿಲ್ಲ. ನೀವು ನವೀಕೃತ ನಿಯಮಗಳು ಒಪ್ಪುವುದಿಲ್ಲ ನೀವು ಸೇವೆ ಬಳಸುವುದನ್ನು ನಿಲ್ಲಿಸಬೇಕು. ಅವರು ನಿಮಗೆ ಸೂಚಿಸಲಾಗುವುದು ನಂತರ ನೀವು ಸಮಂಜಸವಾದ ಸಮಯದಲ್ಲಿ ಅಪ್ಡೇಟ್ಗೊಳಿಸಲಾಗಿದೆ ಕರಾರು ಆಕ್ಷೇಪಣೆಯಿರುವುದು ಇದ್ದರೆ ಅಪ್ಡೇಟ್ಗೊಳಿಸಲಾಗಿದೆ ಕರಾರು ನೀವು ಸ್ವೀಕರಿಸುತ್ತಾರೆ ಪರಿಗಣಿಸಲ್ಪಡುತ್ತಾರೆ. ನಾವು ನಿಯಮಗಳು ಮತ್ತು ಅಧಿಸೂಚನೆ ಇಮೇಲ್ನಲ್ಲಿ ಪರಿಗಣಿಸಲ್ಪಟ್ಟರೆ ಸ್ವೀಕಾರ ಮಾರ್ಪಾಡನ್ನು ಆಕ್ಷೇಪಣೆಯಿರುವುದು ಆಯ್ಕೆಯನ್ನು ಹೈಲೈಟ್. &nbsp;<br /> <br /> 2.2. ನಾವು ಹಿಂದಕ್ಕೆ ಕೆಳಗೆ ತೆಗೆದುಕೊಳ್ಳಲು ಅಥವಾ ಯಾವುದೇ ಸಮಯದಲ್ಲಿ ಸೇವೆ ಲಭ್ಯವಿರುವ ವಿಷಯ ಅಥವಾ ಸೇವೆಯ ಭಾಗವಾಗಿದೆ ಮತ್ತು ಎಲ್ಲಾ ಅಥವಾ ಭಾಗಶಃ ತಿದ್ದುಪಡಿ ಕಾಯ್ದಿರಿಸಿದ್ದೇವೆ; ಉದಾಹರಣೆಗೆ, ಕಾನೂನು ಅಥವಾ ಹೊಸ ತಾಂತ್ರಿಕ ಬೆಳವಣಿಗೆಗಳಿಗೆ ಬದಲಾವಣೆಗಳನ್ನು ಪ್ರತಿಬಿಂಬಿಸಲು.ಯಾವುದೇ ಬದಲಾವಣೆಗಳು ಖಾತೆಗೆ ನಿಮ್ಮ ಸಮಂಜಸವಾದ ಆಸಕ್ತಿಗಳು ತೆಗೆದುಕೊಳ್ಳುತ್ತದೆ. ಸೇವೆ ಪೂರ್ಣ ಅಥವಾ ಸ್ವಲ್ಪ ಭಾಗ ಪ್ರವೇಶವನ್ನು ರಿಪೇರಿ, ನಿರ್ವಹಣೆ ಅಥವಾ ನವೀಕರಣವು ಅವಕಾಶ ಕಾಲಕಾಲಕ್ಕೆ ಗಳಿರುತ್ತವೆ. ನೀವು ಇತ್ತೀಚಿನ ಆವೃತ್ತಿಯನ್ನು ಡೌನ್ಲೋಡ್ ಮತ್ತು ಯಾವುದೇ ಹೊಸ ನಿಯಮಗಳನ್ನು ಸ್ವೀಕರಿಸಿದ್ದೀರಿ ತನಕ ನೀವು ಸೇವೆ ಬಳಸಲು ಸಾಧ್ಯವಾಗದ ಕಾರಣವಾಗಬಹುದು.</p>\n<ol start=\"3\">\n<li><strong>ಸೇವೆಯ</strong> <strong>ಪ್ರವೇಶ</strong><strong> / </strong><strong>ಬಳಸಿ</strong></li>\n</ol>\n<p>3.1. ವೈ OU, ಖಾತೆ ಅಪ್ಲಿಕೇಶನ್ ಡೌನ್ಲೋಡ್ ಸೇವೆ ಪ್ರವೇಶಿಸಲು ಕೇಳಲು ಆಯ್ಕೆ ಆಡಿಯೋ ತುಣುಕುಗಳನ್ನು ಗೆ ಪಕೋಡಿ ಕ್ಯಾಟಲಾಗ್ನಿಂದ, ಮತ್ತು ಆಡಿಯೋ ತುಣುಕುಗಳನ್ನು ಸಂಬಂಧಿಸಿದಂತೆ ವೀಡಿಯೊ ರೆಕಾರ್ಡಿಂಗ್ ಮಾಡಬಹುದು.ಈ <strong>\"</strong><strong>ಡಬ್</strong><strong>\"</strong> ಸೃಷ್ಟಿಸುತ್ತದೆ ವಿಡಿಯೋ ಜತೆಗೂಡಿಸಲಾಯಿತು ಆಡಿಯೋ ಕ್ಲಿಪ್ ಕಾರಣವಾಗುತ್ತದೆ.ದಬ್ಸ್ ನಿಮ್ಮ ಸಾಧನದ ಸ್ಥಳೀಯ ಮೆಮೊರಿ ಸಂಗ್ರಹಿಸಲಾಗಿದೆ ಮತ್ತು ಫೇಸ್ ಬುಕ್, ಟ್ವಿಟರ್, WhatsApp ಮತ್ತು Google+ ಕೆಲವು ಮೂರನೇ ಪಕ್ಷದ ಸೇವೆಗಳನ್ನು ಮೂಲಕ ನಿಮ್ಮ ಸಂಪರ್ಕಗಳನ್ನು ಹಂಚಿಕೊಳ್ಳಬಹುದು.</p>\n<p>3.2. ಸೇವೆಯನ್ನು ಬಳಸಲು ನೀವು ಹದಿನೆಂಟು (18) ವರ್ಷ ಅಥವಾ ಹಳೆಯ ಇರಬೇಕು. ಸೇವೆ ಬಳಸಿಕೊಂಡು ನೀವು ಈ ನಿಯಮಗಳು ಮತ್ತು ಸ್ವೀಕರಿಸುವ ನಮಗೆ ಭರವಸೆ: (ಒಂದು) ನೀವು 18 ವರ್ಷ ಅಥವಾ ಹೆಚ್ಚು, ಅಥವಾ (ಬಿ) 13 ವರ್ಷ ಅಥವಾ ಮತ್ತು ನಿಮ್ಮ ಪೋಷಕರಿಂದ ಸೇವೆ ಬಳಸಲು ಅನುಮತಿ ಇವೆ ಅಥವಾ ಕಾನೂನು ಪಾಲಕರು. ನಾವು ಸಮಂಜಸವಾಗಿ ನೀವು ಸಾಕಷ್ಟು ಈ ಮಾನದಂಡಗಳನ್ನು ಪೂರೈಸುವ ನಂಬಿದರೆ ನೀವು ವಯಸ್ಸಿನ ಸ್ವೀಕಾರಾರ್ಹ ಪುರಾವೆ ಒದಗಿಸಿದ್ದಾರೆ ತನಕ, ನಾವು ಸೇವೆಯ ನಿಮ್ಮ ಬಳಕೆಯನ್ನು ರದ್ದುಗೊಳಿಸಬಹುದು. &nbsp;<br /> <br /> 3.3. ನಾವು ಅವರ ಮಕ್ಕಳ ಸೇವೆ 18 ಅಡಿಯಲ್ಲಿ ಮಕ್ಕಳಿಗೆ ಉದ್ದೇಶವನ್ನು ಹೊಂದಿಲ್ಲ ತಿಳಿದಿರಲಿ ಸೇವೆ ಬಳಸಲು ಅನುಮತಿ ದಂಪತಿಗಳಿಗೆ ಸಲಹೆ. ಸೇವೆ ಲಭ್ಯವಾಗುವುದನ್ನು ಉತ್ಪತ್ತಿಸಿದ \"ಪಕೋಡಿ\" ಸಹ ಹೊಂದಿರುತ್ತವೆ ಬಳಕೆದಾರರಿಂದ ಮತ್ತು ಮಕ್ಕಳಿಗೆ ಸೂಕ್ತವಾದ ಇರಬಹುದು.<br /> <br /> 3.4. ಸೇವೆ ಕೆಲವು ಕಾರ್ಯಗಳನ್ನು ಪ್ರವೇಶಿಸಲು, ನೀವು ನಮ್ಮೊಂದಿಗೆ ನೋಂದಾಯಿಸಿಕೊಳ್ಳಬಹುದು. ನೊಂದಣಿ, ನೀವು ನಿಮ್ಮ ಹೆಸರು, ಮೊಬೈಲ್ ಸಂಖ್ಯೆ, ಇಮೇಲ್ ವಿಳಾಸ, ವಯಸ್ಸು ನಮಗೆ ಒದಗಿಸಬೇಕು.ನಿಮ್ಮ ಎನ್ ame ನೀವು ಸೇವೆ ಅಪ್ಲೋಡ್ ಯಾವುದೇ ವಿಷಯವನ್ನು ಪಕ್ಕದಲ್ಲಿ ಕಾಣಿಸಿಕೊಳ್ಳುತ್ತದೆ.ನಿಮ್ಮ ಹೆಸರು ಈ ನಿಭಂದನೆಗಳಿಗೆ ಎಂದು ಖಚಿತಪಡಿಸಿಕೊಳ್ಳಿ ಮಾಡಬೇಕು.<br /> <br /> 3.5. ನೀವು ನಮಗೆ ಮತ್ತು ಚಟುವಟಿಕೆ ನೀವು ಅಧಿಕೃತಗೊಳಿಸಿದೆ ಇಲ್ಲದಿರಲಿ ನಿಮ್ಮ ಖಾತೆಯನ್ನು ನಡೆಯುವ ಯಾವುದೇ ಚಟುವಟಿಕೆ ನಿಮ್ಮ ಖಾತೆಯನ್ನು ಹೊಣೆ.ನೀವು ನಮಗೆ ಒದಗಿಸುವಂತಹ ವಿವರಗಳು ಸರಿಯಾಗಿವೆಯೇ ಎಂಬುದನ್ನು ಖಚಿತಪಡಿಸಿಕೊಳ್ಳಲು ಮತ್ತು ನವೀಕೃತಗೊಂಡಿದೆಯೆ ಮಾಡಬೇಕು.ನೀವು ನಮ್ಮೊಂದಿಗೆ ನೋಂದಾಯಿಸುವಾಗ ನೀವು ಒದಗಿಸಿದ ವಿವರಗಳನ್ನು ಯಾವುದೇ ಬದಲಾವಣೆಗಳನ್ನು ನಮಗೆ ಮಾಹಿತಿ ಮಾಡಬೇಕು. &nbsp;<br /> <br /> 3.6. ನಾವು ಭದ್ರತೆಯ ಉಲ್ಲಂಘನೆಯಾಗಿಲ್ಲ ಎಂದು ನೀವು ಭಾವಿಸಿದರೆ ನಾವು ಪೂರ್ವಸೂಚನೆ ಇಲ್ಲದೆ, ಮತ್ತೆ ಅಥವಾ ನಿಮ್ಮ accountand ಸೇವೆಗಳ ನಿಮ್ಮ ಬಳಕೆಯನ್ನು ನಿಷೇಧಿಸುವ ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲು, ನಿಮ್ಮ ಖಾತೆಯನ್ನು ಅಮಾನತುಗೊಳಿಸುವುದು ಅಥವಾ ತೆಗೆದು, ರದ್ದು ಕಾಯ್ದಿರಿಸಿದ್ದೇವೆ ಅಥವಾ ಚಟುವಟಿಕೆಗಳನ್ನು ನಿಮ್ಮ ಖಾತೆಯಲ್ಲಿ ಸಂಭವಿಸುತ್ತದೆ ನಾವು ನಂಬಿರುವ ಈ ನಿಯಮಗಳು ಒಡೆಯಲು.<br /> <br /> 3.7. ಸೇವೆ ಮಾಡುತ್ತವೆ ನಿಲುಕಣೆಯನ್ನು ಹೊಂದಿಕೆಯಾಗುವ ಸಾಧನ ಮತ್ತು ಇಂಟರ್ನೆಟ್ ಸಂಪರ್ಕವನ್ನು ಅಗತ್ಯವಿದೆ. ನಾವು ಸೇವೆ ವಿವಿಧ ಸಾಧನಗಳಲ್ಲಿ ಹೊಂದಬಲ್ಲ ಎಂದು ಖಚಿತಪಡಿಸಿಕೊಳ್ಳಲು ಕೆಲಸ ಆದರೂ, ನಾವು ಸೇವೆ ಎಲ್ಲಾ ಸಾಧನಗಳು ಕೆಲಸ ಎಂದು ಖಾತರಿ ಮಾಡಬಹುದು. ಸೇವೆ ಪ್ರಸ್ತುತ ವೀಡಿಯೊ ಕ್ಯಾಮರಾ ಕಾರ್ಯದಲ್ಲಿ ಸ್ಮಾರ್ಟ್ಫೋನ್ ಅಗತ್ಯವಿದೆ, ಬಿಡುವಿನ ಸಂಗ್ರಹ ಸಾಮರ್ಥ್ಯ ಮತ್ತು ಚಾಲನೆಯನ್ನು (ಅಥವಾ ನಂತರ) ಯಂತ್ರಮಾನವ 4.3 ಅಥವಾ (ಅಥವಾ ನಂತರ) iOS7 ಕಾರ್ಯಾಚರಣಾ ವ್ಯವಸ್ಥೆಗಳ 30MB.</p>\n<p>3.8. ಇದು ನಿಮ್ಮ ಸಾಧನ ಈ ಅವಶ್ಯಕತೆಗಳನ್ನು ಬದ್ಧವಾಗಿದೆಯೇ ಎಂಬುದನ್ನು ಖಚಿತಪಡಿಸಿಕೊಳ್ಳಲು ನಿಮ್ಮ ಜವಾಬ್ದಾರಿ. ನಿಮ್ಮ ಸೇವೆಯ ಬಳಕೆಗೆ (ನಿಮ್ಮ ಸಾಧನ, ಇಂಟರ್ನೆಟ್ ಸೇರಿದಂತೆ ಸಾಧನ ಮತ್ತು ಇದು ಬಳಸುತ್ತದೆ ಮತ್ತು ಸ್ಪ್ರಿಂಟ್ ಅಪ್ಲಿಕೇಶನ್ಗಳು ನಿಮ್ಮ ಸಾಧನ ಕಾರಣ ಎಂದು ಕಾರ್ಯವನ್ನು ಯಾವುದೇ ಕೊರತೆ ಯಾವುದೇ ಜವಾಬ್ದಾರಿಯನ್ನು ಸ್ವೀಕರಿಸುತ್ತದೆ ಕಾರ್ಯ ವ್ಯವಸ್ಥೆಯ ಅವಲಂಬಿಸಿದೆ ಕಾರ್ಯವನ್ನು, ಲಭ್ಯತೆ ಮತ್ತು ಗುಣಮಟ್ಟದ ಬದಲಾಗಬಹುದು ಸಂಪರ್ಕ, ಕಾರ್ಯ ವ್ಯವಸ್ಥೆ ಅಥವ ಸೆಟ್ಟಿಂಗ್ಗಳನ್ನು ಮತ್ತು ತಂತ್ರಾಂಶ).<br /> <br /> 3.9. ಇದು ಸೇವೆ ಬಳಸುವಾಗ ನೀವು ಉಂಟುಮಾಡಬಹುದು ಎಲ್ಲಾ ವೆಚ್ಚಗಳು ಪಾವತಿಸಲು ನಿಮ್ಮ ಜವಾಬ್ದಾರಿ (ಸೇರಿದಂತೆ, ಆದರೆ, ಎಲ್ಲಾ ದೂರವಾಣಿ ಕರೆ ಅಥವಾ ಲೈನ್ ಆರೋಪಗಳನ್ನು ಅಥವಾ ಇಂಟರ್ನೆಟ್ ಡೇಟಾ ಸೇವೆಯ ಪ್ರವೇಶ ಶುಲ್ಕಗಳು ಸೀಮಿತವಾಗಿಲ್ಲ).</p>\n<ol start=\"4\">\n<li><strong>ಬಳಕೆದಾರ</strong> <strong>ರಚಿಸಿದ</strong> <strong>ವಿಷಯ</strong></li>\n</ol>\n<p>4.1. ನೀವು ಒಟ್ಟಿಗೆ (ಕೇವಲ ಸೇವೆ ಮತ್ತು ಯಾವುದೇ ರೆಕಾರ್ಡಿಂಗ್ <strong>(\"</strong><strong>ವೀಡಿಯೊ</strong> ರೆಕಾರ್ಡಿಂಗ್\") ನಿಮ್ಮ ಬಳಕೆಯ ಜವಾಬ್ದಾರಿ, ದಬ್ಸ್, ಪದಗಳನ್ನು, ನೀವು ಅಪ್ಲೋಡ್ ಅಥವಾ ಸೇವೆ ಮೂಲಕ ರಚಿಸಿದ ಮಾಹಿತಿ, ಸಂದೇಶಗಳನ್ನು ಮತ್ತು ಯಾವುದೇ ಇತರ ವಿಷಯ, ಖಾಸಗಿಯಾಗಿ ಪ್ರಸಾರ ಅಥವಾ ಎಂಬುದನ್ನು ಸಾರ್ವಜನಿಕರಿಗೆ ಇವೆ , <strong>\"</strong><strong>ಬಳಕೆದಾರರ</strong> <strong>ವಿಷಯ</strong><strong>\").</strong><strong>ನಿಮ್ಮ</strong> <strong>ಬಳಕೆದಾರ</strong> <strong>ವಿಷಯ</strong> <strong>ಮಾಲೀಕತ್ವವನ್ನು</strong> <strong>ನೀವು</strong> <strong>ಪಡೆದುಕೊಳ್ಳುತ್ತೀರಿ</strong><strong>.</strong> &nbsp;<br /> <br /> 4.2. ನೀವು ಸೇವೆ ಅಪ್ಲೋಡ್ ವಿಡಿಯೋ ರೆಕಾರ್ಡಿಂಗ್ ಸೇವೆ ಇತರ ಬಳಕೆದಾರರಿಗೆ ಬಹಿರಂಗಪಡಿಸಲಾಗುತ್ತದೆ.ಅಪ್ಲೋಡ್ ಮಾಡುವುದರಿಂದ ಅರ್ಥ ಮತ್ತು ನಿಮ್ಮ ಹೆಸರು ಪ್ರತಿ ರೆಕಾರ್ಡಿಂಗ್ ಸಂಬಂಧಿಸಿದಂತೆ ಬಹಿರಂಗಗೊಳಿಸಬೇಕು ಎಂದು ಒಪ್ಪುತ್ತೀರಿ ಮತ್ತು ನೀವು ರೆಕಾರ್ಡಿಂಗ್ಸ್ ಸಂಬಂಧಿಸಿದಂತೆ ನಿಮ್ಮ ಹೆಸರನ್ನು ಬಳಸಿ ಪ್ರದರ್ಶಿಸಲು ಮತ್ತು ಇಲ್ಲದಿದ್ದರೆ ಹಕ್ಕನ್ನು ಸ್ಪ್ರಿಂಟ್ ಅಪ್ಲಿಕೇಶನ್ಗಳು ಮತ್ತು ನಮ್ಮ ಅಂಗ ನೀಡಲು.<br /> <br /> 4.3. ನೀವು ಸೇವೆ ಸಂಬಂಧಿಸಿದಂತೆ ತೆಗೆದುಕೊಳ್ಳಲು ಯಾವುದೇ ದಬ್ಸ್ / ವೀಡಿಯೊಗಳನ್ನು ಸ್ಥಳೀಯವಾಗಿ ಸಂಗ್ರಹಿಸಲಾಗುತ್ತದೆ ಮತ್ತು ನೀವು ಸಾರ್ವಜನಿಕ ಮಾಡಿದಾಗ ಸೇವೆ ಅಪ್ಲೋಡ್ ಮಾಡಲಾಗುತ್ತದೆ<br /> <br /> 4.4. ನೀವು ಅರ್ಥ ಮತ್ತು ಸೇವೆ ಮತ್ತು ಬಳಕೆದಾರ ವಿಷಯ ನಿಮ್ಮ ಬಳಕೆಗೆ ಸಂಬಂಧಿಸಿದಂತೆ ಎಲ್ಲಾ ಅನ್ವಯಿಸುವ ಕಾನೂನುಗಳು ಅನುಸರಿಸಲು ಒಪ್ಪುತ್ತೇನೆ. &nbsp;<br /> <br /> 4.5. ನೀವು ಎಲ್ಲಾ ಸಮಯದಲ್ಲೂ ನಿಮ್ಮ ಬಳಕೆದಾರ ವಿಷಯ ಎಂಬುದನ್ನು ಖಚಿತಪಡಿಸಿಕೊಳ್ಳಲು ಹಾಗಿಲ್ಲ:</p>\n<ol>\n<li>ಹಕ್ಕುಸ್ವಾಮ್ಯ, ವ್ಯಾಪಾರ ಮುದ್ರೆ ಹಕ್ಕುಗಳನ್ನು ರಹಸ್ಯ ಮಾಹಿತಿ ಅಥವಾ ಗೌಪ್ಯತೆ ಹಕ್ಕುಗಳು ಸೇರಿದಂತೆ ಯಾವುದೇ ಮೂರನೇ ಪಕ್ಷದ ಹಕ್ಕನ್ನು ಯಾವುದೇ ವಿಷಯ, ಮಾಹಿತಿ ಅಥವಾ ವಸ್ತುಗಳನ್ನು ಹೊಂದಿರುತ್ತವೆ;</li>\n<li>ಅನ್ವಯವಾಗುವ ಯಾವುದೇ ಕಾನೂನುಗಳನ್ನು ಉಲ್ಲಂಘಿಸುವುದಿಲ್ಲ;</li>\n<li>ಉತ್ತೇಜಿಸುತ್ತದೆ ಅಥವಾ ಹಿಂಸೆ, ಭಯೋತ್ಪಾದನೆ ಅಥವಾ ಯಾವುದೇ ಕಾನೂನುಬಾಹಿರ ವರ್ತನೆಗಳು ಪ್ರೋತ್ಸಾಹಿಸುವ ಅಥವಾ ಅಸಮಾಧಾನ, ಕಿರುಕುಳ ಸಂಭವವಿದೆ ಇದು ಅಸಭ್ಯ, ಲೈಂಗಿಕತೆಯನ್ನು, ಆಕ್ರಮಣಕಾರಿ ನಿಂದನಾ, ಮಾನನಷ್ಟಕರ, ಮಾನಹಾನಿಕರ, ಅವಹೇಳನಕಾರಿ, ಬೆದರಿಸುವ, ತಾರತಮ್ಯದ, ಅಶ್ಲೀಲ, ಹಿಂಸಾತ್ಮಕ ಎಂದು ಯಾವುದೇ ವಿಷಯ ಅಥವಾ ವಸ್ತುಗಳನ್ನು ಹೊಂದಿರುತ್ತವೆ , ಎಚ್ಚರಿಕೆ, ಅನಾನುಕೂಲತೆಗಾಗಿ ಮುಜುಗರ ಅಥವಾ ಯಾವುದೇ ವ್ಯಕ್ತಿ ಸಿಟ್ಟುಬರಿಸು;</li>\n<li>ಯಾವುದೇ ರೀತಿಯಲ್ಲಿ ಪ್ರಚಾರ ಅಥವಾ ಎಸಗುವ ಅಥವಾ ಯಾವುದೇ ಕಾನೂನುಬಾಹಿರ ಅಥವಾ ಕ್ರಿಮಿನಲ್ ಚಟುವಟಿಕೆ ಅಥವಾ ಸಮಾಜ ವಿರೋಧಿ ವರ್ತನೆಯನ್ನು ನೆರವಾಗುವುದು ಅಥವಾ ಇತರರು ಸುರಕ್ಷತೆ ಅಥವಾ ಯೋಗಕ್ಷೇಮವನ್ನು ಹಾನಿಕರವಾಗಬಹುದು ಸಾಧ್ಯವಿತ್ತು ಚಟುವಟಿಕೆಗಳ ಯಾರಾದರೂ ಎತ್ತಿಕಟ್ಟುತ್ತಿದ್ದಾರೆ;</li>\n<li>ತಮ್ಮ 18 ವರ್ಷಗಳ ಇದ್ದರೆ ಅವರ ಒಪ್ಪಿಗೆಯಿಲ್ಲದೇ ಯಾವುದೇ ವ್ಯಕ್ತಿ, ಅಥವಾ ತಮ್ಮ ಪೋಷಕರು ಅಥವಾ ಕಾನೂನು ಪಾಲಕರು ಒಪ್ಪಿಗೆ ಗುರುತಿಸಲು;</li>\n<li>ಯಾರ ವೈಯಕ್ತಿಕ ಸಂಪರ್ಕ ವಿವರಗಳನ್ನು ಬಹಿರಂಗ ಅಥವಾ ತಮ್ಮ ಗೌಪ್ಯತೆ ಆಕ್ರಮಣ;</li>\n<li>ಯಾವುದೇ ವೈರಸ್ಗಳು ಅಥವಾ ಇತರ ದುರಾಗ್ರಹದ ಅಥವಾ ಹಾನಿಕಾರಕ ಯೋಜನೆಗಳು ಹೊಂದಿರುತ್ತವೆ; ಅಥವಾ</li>\n<li>ಯಾವುದೇ ಜಾಹೀರಾತು ಅಥವಾ ಜಾಹೀರಾತು ಸಂದೇಶಗಳನ್ನು ಸೇರಿಸಿ.</li>\n</ol>\n<p><br /> 4.6. ಇದಲ್ಲದೆ, ನೀವು ಅರ್ಥ ಮತ್ತು ನೀವು ಅಥವಾ ಮಾಡಲು ಅಥವಾ ಮಾಡಲು ಪ್ರಯತ್ನ ಯಾವುದೇ ಮೂರನೇ ಪಕ್ಷದ ಮಾಡಲು ಪ್ರಯತ್ನದಲ್ಲಿ ಅಥವಾ ಉಂಟುಮಾಡುವುದಿಲ್ಲ, ಸೇವಾ ನಿಮ್ಮ ಬಳಕೆಗೆ ಸಂಬಂಧಿಸಿದಂತೆ ಕೆಳಗಿನ ಯಾವುದೇ:</p>\n<ol>\n<li>ಈ ನಿಯಮಗಳಲ್ಲಿ ಮತ್ತು ಸೇವೆ ಸಾಮಾನ್ಯ ಕಾರ್ಯನಿರ್ವಹಿಸಿ ಅನುಮತಿ ಹೊರತುಪಡಿಸಿ ಬೇರೆ ಲಭ್ಯವಿರುವ ಸೇವೆ ಅಥವಾ ಬಳಕೆದಾರ ವಿಷಯ ಬಳಸಿ;</li>\n<li>ಕ್ರೆಡಿಟ್ ಕಾರ್ಡ್ ಸಂಖ್ಯೆಗಳು, ಖಾತೆ ಪಾಸ್ವರ್ಡ್ಗಳು ಇತ್ಯಾದಿ, ಇತರರ ವೈಯಕ್ತಿಕ ಮತ್ತು / ಅಥವಾ ಗೌಪ್ಯ ಮಾಹಿತಿಯನ್ನು ನಾವು ರವಾನಿಸಿದಾಗ .;</li>\n<li>ಒಂದು ಕಾನೂನುಬಾಹಿರ ರೀತಿಯಲ್ಲಿ ಅಥವಾ ಈ ನಿಯಮಗಳ ಅಸಮಂಜಸವಾಗಿದೆ ಯಾವುದೇ ರೀತಿಯಲ್ಲಿ, ಯಾವುದೇ ಅಕ್ರಮ ಉದ್ದೇಶಕ್ಕಾಗಿ ಸೇವೆ ಬಳಸಿ;</li>\n<li>ಸೋಗು ಅಥವಾ ಸೇವೆ ನಿಮ್ಮ ಬಳಕೆಯ ಮೂಲಕ ಯಾರಾದರೂ ಎಂದು ನಟಿಸುವುದು;</li>\n<li>ಸೇವೆ ನಮ್ಮ ವ್ಯವಸ್ಥೆಗಳು ಅಥವಾ ಭದ್ರತಾ ಅಥವಾ ಇತರ ಬಳಕೆದಾರರು ಹಸ್ತಕ್ಷೇಪ, ಅತಿಭಾರ, ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲು, ಹಾನಿ ಕುಗ್ಗಿಸುವ ಅಥವಾ ರಾಜಿ ಎಂದು ರೀತಿಯಲ್ಲಿ ಸೇವೆ ಬಳಸಿ;</li>\n<li>, ಹೊರತೆಗೆಯಲು ಡೌನ್ಲೋಡ್, ಸೂಚ್ಯಂಕ, ಗಣಿ, ಉಜ್ಜುವುದು, ಸಂತಾನೋತ್ಪತ್ತಿ ಅಥವಾ ಪ್ರಸ್ತುತಿ, ಕಾರ್ಯಾಚರಣೆ ಅಥವಾ ಸೇವೆ ಉದ್ದೇಶಿತ ಬಳಕೆ ಅಥವಾ ಯಾವುದೇ ಲಕ್ಷಣಗಳನ್ನು ತಪ್ಪಿಸಿಕೊಳ್ಳುವ, ಎಂಬುದನ್ನು ಕೈಯಾರೆ ಅಥವಾ ಸ್ವಯಂಚಾಲಿತವಾಗಿ, ಸೇರಿದಂತೆ ಆದರೆ ಲಿಪಿಗಳು, ಜೇಡಗಳು ಮತ್ತು ರೊಬೊಟ್ ಸೀಮಿತವಾಗಿಲ್ಲ, ಯಾವುದೇ ಪ್ರೋಗ್ರಾಂ ಅಥವಾ ಇತರ ವಿಧಾನಗಳನ್ನು ಬಳಸುತ್ತಾರೆ ಅಥವಾ ಇದು ಕಾರ್ಯಗಳನ್ನು;</li>\n<li>ಪ್ರತಿಯನ್ನು, ಮಾರ್ಪಡಿಸಲು ಸೇವೆ ಯಾವುದೇ ಭಾಗದಲ್ಲಿ ಹಸ್ತಕ್ಷೇಪ ಇಲ್ಲದಿದ್ದರೆ decompile ಅಥವಾ;</li>\n<li>ಬದಲಾವಣೆಗಳನ್ನು, ಅಥವಾ ಯಾವುದೇ ಪರಿವರ್ತನೆಯಾಗಿ, ಸೇವೆ ಇಡೀ ಅಥವಾ ಭಾಗಶಃ, ಅಥವಾ ಸೇವೆ ಅಥವಾ ಅದರ ಯಾವುದೇ ಭಾಗವನ್ನಾದರೂ ಅನುಮತಿ ಸಂಯೋಜಿಸಲ್ಪಟ್ಟ ಮಾಡಬೇಕು, ಅಥವಾ, ಯಾವುದೇ ಕಾರ್ಯಕ್ರಮಗಳು ಸಂಘಟಿತ ಆಗಿ;</li>\n<li>ಹ್ಯಾಕ್, ಅಥವಾ, ಸೇವೆಗೆ ವೈರಸ್, ಅಥವಾ ಹಾನಿಕಾರಕ ಡೇಟಾ ಸೇರಿದಂತೆ ದುರುದ್ದೇಶಪೂರಿತ ಕೋಡ್, ಸೇರಿಸಲು; ಅಥವಾ</li>\n<li>ನಿಮ್ಮ ಸೇವೆಯ ಬಳಕೆಗೆ ಸಂಬಂಧಿಸಿದಂತೆ ನಮ್ಮ ಬೌದ್ಧಿಕ ಹಕ್ಕುಸ್ವಾಮ್ಯವನ್ನು ಉಲ್ಲಂಘಿಸುತ್ತದೆ.</li>\n</ol>\n<p>4.7. ನೀವು ಅಂಗೀಕರಿಸುತ್ತೀರಿ ಮತ್ತು ನಾವು ಕೇವಲ ಒಂದು ನಿಷ್ಕ್ರಿಯ ವಾಹಿನಿಯಾಗಿ ಮತ್ತು ಬಳಕೆದಾರ ವಿಷಯ ಹೋಸ್ಟಿಂಗ್ ಸೇವೆ ಎಂದು ಒಪ್ಪುತ್ತೀರಿ ಮತ್ತು ನಾವು ಬಳಕೆದಾರ ವಿಷಯ ವಿತರಣೆ ಅಥವಾ ಪ್ರಸ್ತುತಿ ಯಾವುದೇ ಸಕ್ರಿಯ ಪಾತ್ರವನ್ನು. &nbsp;<br /> <br /> 4.8. ನಾವು ಬಳಕೆದಾರ ವಿಷಯ ಸೇವೆ ಪೋಸ್ಟ್ ಮೇಲ್ವಿಚಾರಣೆ ಯಾವುದೇ ಬಾಧ್ಯತೆ ಅಡಿಯಲ್ಲಿ ಮತ್ತು ನಾವು ಬಳಕೆದಾರನ ವಿಷಯ ಯಾವುದೇ ಜವಾಬ್ದಾರಿ ತೆಗೆದುಕೊಳ್ಳುವುದಿಲ್ಲ ಸಾಧ್ಯವಿಲ್ಲ, ಅಥವಾ ನಾವು, ಬೆಂಬಲ ಒಪ್ಪಿಗೆ ಅಥವಾ ಮೂಲಕ ಪ್ರಕಟಿಸಿರುವ ಯಾವುದೇ ಬಳಕೆದಾರ ವಿಷಯ ಅಥವಾ ಸಂವಹನ ಸಂಪೂರ್ಣತೆಯನ್ನು, ನಿಖರತೆ ಅಥವಾ ವಿಶ್ವಾಸಾರ್ಹತೆ ಖಾತರಿ ಇಲ್ಲ ಸೇವೆಗಳು ಅಥವಾ ಅಭಿಪ್ರಾಯಗಳನ್ನು ಅಲ್ಲಿನ ವ್ಯಕ್ತಪಡಿಸಿದರು. ಯಾವುದೇ ಬಳಕೆದಾರ ವಿಷಯ ಅಥವಾ ವಸ್ತುಗಳನ್ನು ಸೇವೆ ಮೂಲಕ ಪೋಸ್ಟ್ ಅಥವಾ ಸೇವೆ ಮೂಲಕ ನೀವು ಪಡೆದ ಮೇಲೆ ಬಳಕೆ ಅಥವಾ ರಿಲಯನ್ಸ್ ನಿಮ್ಮ ಸ್ವಂತ ಅಪಾಯ ಹೊಂದಿದೆ. &nbsp;<br /> <br /> 4.9. SprintApps, ಯಾವುದೇ ದೋಷಗಳು ಅಥವಾ ಲೋಪಗಳಿಗೆ ಇದರಲ್ಲಿ ಒಳಗೊಂಡಿರುವ, ಅಥವಾ ಪೋಸ್ಟ್ ಯಾವುದೇ ಬಳಕೆದಾರ ವಿಷಯ ಬಳಕೆಯ ಪರಿಣಾಮವಾಗಿ ಉಂಟಾದ ಯಾವುದೇ ರೀತಿಯ ಯಾವುದೇ ನಷ್ಟ ಅಥವಾ ಹಾನಿ ಒಳಗೊಂಡಂತೆ ಬಳಕೆದಾರ ವಿಷಯ, ಯಾವುದೇ ರೀತಿಯಲ್ಲಿ ಜವಾಬ್ದಾರರಾಗಿರುವುದಿಲ್ಲ, ಆದರೆ ಸೀಮಿತವಾಗಿಲ್ಲ ಹಾಗಿಲ್ಲ, ಇಮೇಲ್, ಹರಡುವ ಅಥವಾ ಸೇವೆ ಮೂಲಕ ಲಭ್ಯವಾಗುವಂತೆ ಅಥವಾ ಬೇರೆಡೆ ಪ್ರಸಾರ.&nbsp;<br /> <br /> 4.10. ನಾವು ನಮ್ಮ ವಿವೇಚನೆಗೆ, ಈ ನಿಯಮಗಳ ಉಲ್ಲಂಘನೆಯಾಗಿಲ್ಲ ಎಂದು ನಂಬುತ್ತಾರೆ, ಅಥವಾ ನಾವು ಈ ಸೇವೆಗಳನ್ನು ನೀವು ಒಡೆಯಲು ಸಾಧ್ಯತೆಗಳಿವೆ ಎಂದು ನಂಬಲು ಸಮಂಜಸ ಆಧಾರದ ಹೊಂದಿದ್ದರೆ, ನಾವು ಯೋಚಿಸುವುದು ಯಾವುದೇ ಕ್ರಮ ಸೇವೆ ಮತ್ತು ರಕ್ಷಿಸಲು ಅಗತ್ಯ ತೆಗೆದುಕೊಳ್ಳಬಹುದು ತನ್ನ ಬಳಕೆದಾರರು. ನಾವು (, ನಾವು ಮತ್ತೆ ಎಂದು ಪ್ರಮಾಣವನ್ನು ಪಡೆಯಲು ಹಕ್ಕು ಆದರೆ, ನಿಮ್ಮ ಬಳಕೆದಾರ ವಿಷಯ ದಂಡವನ್ನು ಪಾವತಿಸಲು ಹೊಂದಿದ್ದವು ವೇಳೆ, ಉದಾಹರಣೆಗೆ), ಸೇವೆ ಬಳಸಲು ಸೇವೆಯಿಂದ ನಿಮ್ಮ ಬಳಕೆದಾರ ತೆಗೆದುಹಾಕುವ, ನೀವು ವಿರುದ್ಧ ಕಟ್ಟಳೆ ತೆಗೆದುಕೊಳ್ಳಲು ನಿಮ್ಮ ಬಲ ಹಿಂಪಡೆಯಲು ಮತ್ತು ಇತರ ಆಕ್ಷನ್ ನಾವು ಸೂಕ್ತವೆಂದು ಭಾವಿಸುವ.</p>\n<ol start=\"5\">\n<li><strong>ಸೇವೆಯ</strong> <strong>ಪರವಾನಗಿ</strong></li>\n</ol>\n<p>ಈ ನಿಯಮಗಳು ನಿಮ್ಮ ಅನುಸರಣೆಗೆ ಸಂಬಂಧಿಸಿದ ವಿಷಯ, ಸ್ಪ್ರಿಂಟ್ ಅಪ್ಲಿಕೇಶನ್ ಈ ನಿಯಮಗಳು ಮತ್ತು ಗೌಪ್ಯತೆ ನೀತಿ ಗೆ ವಿಷಯದ ಸೇವೆ, ಡೌನ್ಲೋಡ್ ಮತ್ತು / ಅಥವಾ ಬಳಸಲು ವೈಯಕ್ತಿಕ, ಜಗತ್ತಿನಾದ್ಯಂತ, ಗೌರವಧನ, ವರ್ಗಾಯಿಸಲಾಗದ ಮತ್ತು ವಿಶೇಷವಲ್ಲದ ಪರವಾನಗಿಯನ್ನು ನೀಡುತ್ತದೆ.</p>\n<p><br /> &nbsp;</p>\n<ol start=\"6\">\n<li><strong>ಸ್ಪ್ರಿಂಟ್</strong> <strong>ಅಪ್ಲಿಕೇಶನ್ಗಳು</strong> <strong>ಹಕ್ಕುಗಳ</strong></li>\n</ol>\n<p>6.1. ಎಲ್ಲ ಹಕ್ಕುಗಳನ್ನು ಪ್ರಶಸ್ತಿಗಳನ್ನು ಮತ್ತು ಮತ್ತು ಸೇವೆಗೆ ಆಸಕ್ತಿಗಳು (ಹೊರತುಪಡಿಸಿ ವಿಷಯ ಅಪ್ಲೋಡ್ ಅಥವಾ ಬಳಕೆದಾರರನ್ನು ಒದಗಿಸಿದ) ಮತ್ತು ಸ್ಪ್ರಿಂಟ್ ಅಪ್ಲಿಕೇಶನ್ಗಳು ಮತ್ತು ಅದರ ಪರವಾನಗಿದಾರರು ಪ್ರತ್ಯೇಕ ಆಸ್ತಿ ಉಳಿಯುತ್ತದೆ.<br /> <br /> 6.2. / ಅಪ್ಲೋಡ್ ಸೇವೆ ಸಾರ್ವಜನಿಕ ಯಾವುದೇ ರೆಕಾರ್ಡಿಂಗ್ಸ್ ಮೂಲಕ, ಸಂಬಂಧಿಸಿದಂತೆ ವಿಶ್ವಾದ್ಯಂತ, ನಿಮ್ಮ ಹೆಸರು ಜೊತೆಗೆ, ಸೇವೆ ಅಪ್ಲೋಡ್ ಯಾವುದೇ ರೆಕಾರ್ಡಿಂಗ್ಸ್ ಬಳಸಲು ಅನಿರ್ಬಂಧಿತ, ಪ್ರತ್ಯೇಕವಲ್ಲದ, ಗೌರವಧನ, ವರ್ಗಾವಣೆ ಪರವಾನಗಿ, ಸ್ಪ್ರಿಂಟ್ ಅಪ್ಲಿಕೇಶನ್ಗಳು ನೀಡುವ ಸೇವೆ, ಈ ನಿಯಮಗಳು ಮತ್ತು ನಮ್ಮ ಗೌಪ್ಯತೆ ನೀತಿ ಗೆ ಒಳಪಟ್ಟಿರುತ್ತದೆ.</p>\n<ol start=\"7\">\n<li><strong>ಕೃತಿಸ್ವಾಮ್ಯ</strong><strong>, </strong><strong>ವರದಿ</strong> <strong>ಮತ್ತು</strong> <strong>ಸೂಚನೆ</strong><strong> &amp; </strong><strong>ತೆಗೆದುಕೊಳ್ಳುವ</strong> <strong>ನೀತಿ</strong></li>\n</ol>\n<p>7.1. ಸ್ಪ್ರಿಂಟ್ ಅಪ್ಲಿಕೇಶನ್ಗಳು ಇತರರ ಬೌದ್ಧಿಕ ಆಸ್ತಿ ಹಕ್ಕುಗಳು ವಿಷಯಗಳಲ್ಲಿ ಮತ್ತು ಸೇವೆಯ ಬಳಕೆದಾರರು ಅದೇ ಮಾಡಲು ನಿರೀಕ್ಷಿಸುತ್ತದೆ.&nbsp;<br /> <br /> 7.2. ನಿಮ್ಮ ಹಕ್ಕುಸ್ವಾಮ್ಯ ಉಲ್ಲಂಘನೆಯ ಆರೋಪ ನಂಬಿರುವ ವೇದಿಕೆಯಲ್ಲಿ ಯಾವುದೇ ವಿಷಯ ಅನ್ವೇಷಿಸಲು ವೇಳೆ, ಕೆಳಗಿನ ಮಾಹಿತಿ ಸೇರಿದಂತೆ ಬರವಣಿಗೆಯಲ್ಲಿ ನಮಗೆ ಈ ವರದಿ ಮಾಡಿ:</p>\n<ol>\n<li>ನಿಮ್ಮ ಹಕ್ಕುಸ್ವಾಮ್ಯ ಅಥವಾ ನೀವು ಕೆಲಸ ಅರ್ಹರಾಗಿರುತ್ತಾರೆ ಅವರ ಪರವಾಗಿ ಮೂರನೇ ವ್ಯಕ್ತಿಯ ಹಕ್ಕುಸ್ವಾಮ್ಯ ಉಲ್ಲಂಘನೆಯ ಆರೋಪ ವೇದಿಕೆ ವಿಷಯ ಗುರುತಿಸಿದ್ದೇವೆ ಎಂದು ಹೇಳಿಕೆ;</li>\n<li>ನೀವು ಚ್ಯುತಿಯುಂಟಾಗಿದೆ ಹಕ್ಕುಸ್ವಾಮ್ಯವನ್ನು ಕೆಲಸದ ವಿವರಣೆ;</li>\n<li>ನೀವು ಉಲ್ಲಂಘನೆ ಮತ್ತು ವಿವರಗಳನ್ನು ತೋರಿಸಿದ್ದಾರೆ, ಎಂದು ವಿಷಯ ಒಂದು ವಿವರಣೆ ಪ್ಲ್ಯಾಟ್ಫಾರ್ಮ್ ನೀವು ಕಾಣಬಹುದಾಗಿದೆ ಉಲ್ಲಂಘಿಸುತ್ತಿದೆ ಎಂದು ಹೇಳಿಕೊಳ್ಳುವ ವಿಷಯ ಮೇಲೆ;</li>\n<li>ನಿಮ್ಮ ಪೂರ್ಣ ಹೆಸರು, ವಿಳಾಸ ಮತ್ತು ದೂರವಾಣಿ ಸಂಖ್ಯೆ ಮತ್ತು ನೀವು ಸಂಪರ್ಕಿಸಬಹುದು ಮಾಡಬಲ್ಲರು ಮಾನ್ಯ ಇಮೇಲ್ ವಿಳಾಸ ಸೇರಿದಂತೆ ನಿಮ್ಮ ಸಂಪರ್ಕ ಮಾಹಿತಿಯನ್ನು;</li>\n<li>ನೀವು ವಸ್ತುಗಳ ವಿವಾದಿತ ಬಳಸಿ ಹಕ್ಕುಸ್ವಾಮ್ಯ ಮಾಲೀಕರು, ಏಜೆಂಟ್, ಅಥವಾ ಕಾನೂನಿನಿಂದ ಅಧಿಕೃತಗೊಂಡಿಲ್ಲ ಸದ್ಭಾವನೆಯನ್ನು ಹೊಂದಿರುವ ನೀವು ಒಂದು ಹೇಳಿಕೆ ಮತ್ತು</li>\n<li>ನಿಮ್ಮ ಒಂದು ಹೇಳಿಕೆ ನಿಮ್ಮ ಎಚ್ಚರಿಕೆ ಮಾಹಿತಿ ನಿಖರ ಎಂದು ಮತ್ತು ನೀವು ಉಲ್ಲಂಘಿಸಲಾಗಿದೆ ಎನ್ನಲಾದ ವಿಶೇಷ ಹಕ್ಕಿನ ಮಾಲೀಕರ ಪರವಾಗಿ ಅಧಿಕಾರ ಎಂದು.</li>\n</ol>\n<p>ನಿಮ್ಮ ಅಧಿಸೂಚನೆಯನ್ನು ಬಯಸಿದರೆ ಜೊತೆಗೆ ಭಾರತೀಯ ಡಿಜಿಟಲ್ ಮಿಲೆನಿಯಮ್ ಕಾಪಿರೈಟ್ ಆಕ್ಟ್ ನೋಟಿಸ್ ಅನುಸಾರವಾಗಿ ಪರಿಗಣಿಸಲಾಗುತ್ತದೆ, ಈ ಕೆಳಗಿನ ಒಳಗೊಂಡಿರುತ್ತದೆ ಮಾಡಿ</p>\n<ol>\n<li>ಘೋಷಣೆ, ಪ್ರಮಾಣ, ನೀವು ಉಲ್ಲಂಘಿಸಿದೆ ಹೇಳಲಾದ ಎಂದು ವಿಶೇಷ ಹಕ್ಕುಸ್ವಾಮ್ಯ ಮಾಲೀಕರ ಪರವಾಗಿ ಅಧಿಕೃತ ಮಾಲೀಕರಿಗೆ ಅಥವಾ ಎಂದು; ಮತ್ತು</li>\n<li>(ಸ್ಕ್ಯಾನ್ ಪ್ರತಿಯನ್ನು ಇರಬಹುದು) ನಿಮ್ಮ ವಿದ್ಯುನ್ಮಾನ ಅಥವಾ ಭೌತಿಕ ಸಹಿ.</li>\n</ol>\n<p>7.3. ನಿಮ್ಮ ಗಮನಕ್ಕೆ ನಮಗೆ ಅಥವಾ ಇಮೇಲ್ ಮೂಲಕ ನಮ್ಮ ಗೊತ್ತುಪಡಿಸಿದ ಹಕ್ಕುಸ್ವಾಮ್ಯ ದಳ್ಳಾಲಿ ಕಳುಹಿಸಬೇಕು <a href=\"mailto:copyright@dubsmash.com\">ಹಕ್ಕುಸ್ವಾಮ್ಯ @</a> <span style=\"text-decoration: underline;\">sprintapps.in</span> ಅಥವಾ ಕೆಳಗಿನ ವಿಳಾಸಕ್ಕೆ ಮೇಲ್ ಮೂಲಕ:<br /> <br /> ಸ್ಪ್ರಿಂಟ್ ಅಪ್ಲಿಕೇಶನ್ಗಳು ಪ್ರೈವೇಟ್ ಲಿಮಿಟೆಡ್.,&nbsp;<br /> ಮೊದಲ ಮಹಡಿ, H.NO. 8-2-269 / 19 / ಎಸ್ / 1,</p>\n<p>ROAD ಯಾವುದೇ. 2 ಬಂಜಾರ ಹಿಲ್ಸ್, ಹೈದರಾಬಾದ್ 500 034, ತೆಲಂಗಾಣ, ಭಾರತ<br /> ಗಮನಿಸಿ: ಕೃತಿಸ್ವಾಮ್ಯ ತಂಡ&nbsp;<br /> <br /> 7.4. ನೀವು ಸ್ವೀಕರಿಸುವ ಅಥವಾ ಎನ್ಕೌಂಟರ್ ರೆಕಾರ್ಡಿಂಗ್ ಅಥವಾ ಇತರ ವಿಷಯ ನೀವು ಸೇವೆ ಮೂಲಕ ಆಕ್ರಮಣಕಾರಿ ಹೇಗೆ ಇದು, ಅಥವಾ ನೀವು ಭಾವಿಸಿದರೆ ಒಂದು ಬಳಕೆದಾರ ಈ ನಿಯಮಗಳು ಮತ್ತು / ಅಥವಾ ಗೌಪ್ಯತೆ ನೀತಿ ಉಲ್ಲಂಘನೆಯಾಗಿದೆ, ನಾವು ನೇರವಾಗಿ ಸಂಬಂಧಿಸಿದ ಬಳಕೆದಾರ ಸಂಪರ್ಕಿಸುವ ಮತ್ತು ಪರಸ್ಪರ ಪ್ರಿಯವಾದ ಪರಿಹಾರ ತಲುಪಲು ಯತ್ನಿಸುತ್ತಿರುವ ಶಿಫಾರಸು . ಈ ತೃಪ್ತಿದಾಯಕ ಫಲಿತಾಂಶದ ಕಾರಣವಾಗುತ್ತದೆ ಎಂಬುದನ್ನು ವೇಳೆ, ಇಮೇಲ್ ಮೂಲಕ ನಮಗೆ ವರದಿ ಮಾಡಿ <a href=\"mailto:copyright@dubsmash.com\">ಹಕ್ಕುಸ್ವಾಮ್ಯ @</a> ಸಂಬಂಧಿತ ರೆಕಾರ್ಡಿಂಗ್ ನ \"ವರದಿ\" ಲಿಂಕ್ ಮೂಲಕ ಸೇವೆ ಲಭ್ಯವಿರುವ ರೆಕಾರ್ಡಿಂಗ್ ಧ್ವನಿ ಸಂಬಂಧಿಸಿದಂತೆ ವೇಳೆ, <span style=\"text-decoration: underline;\">sprintapps.in</span> ಅಥವಾ.</p>\n<p>&nbsp;</p>\n<ol start=\"8\">\n<li><strong>ಜಾಹೀರಾತು</strong></li>\n</ol>\n<p>ನಾವು ನಿಮ್ಮ ಸೇವೆಯ ಬಳಕೆಗೆ ಜೊತೆಯಲ್ಲಿ ನಿಮಗೆ ಜಾಹೀರಾತು ಸೂಚಿಸಬಹುದು.</p>\n<ol start=\"9\">\n<li><strong>ಖಾಸಗಿ</strong></li>\n</ol>\n<p>ನೀವು ಸ್ಪ್ರಿಂಟ್ ಅಪ್ಲಿಕೇಶನ್ಗಳು ಪೂರೈಸುವ ಮಾಹಿತಿ ನಮ್ಮ ಸಂಗ್ರಹ ಮತ್ತು ವೈಯಕ್ತಿಕ ಮಾಹಿತಿ ಅದರಲ್ಲಿ ನಿಮ್ಮ ಮಾಹಿತಿ, ಬಳಕೆ ಕುರಿತು ಇದು ನಮ್ಮ ಗೌಪ್ಯತೆ ನೀತಿ, ಒಳಪಟ್ಟಿರುತ್ತದೆ.ಸೇವೆ ನಮ್ಮ ನಿಬಂಧನೆಯ ಭಾಗವಾಗಿ, ನಾವು ಅಂದರೆ ಸೇವೆಗಳ ಘೋಷಣೆ ಮತ್ತು ಆಡಳಿತಾತ್ಮಕ ಸಂದೇಶಗಳನ್ನು ಕೆಲವು ಸಂವಹನಗಳು, ನಿಮಗೆ ಒದಗಿಸಲು ಮಾಡಬೇಕಾಗುತ್ತದೆ. ಈ ಸಂವಹನಗಳನ್ನು ನೀವು ಹೊರಗುಳಿಯುವುದು ಪಡೆಯುವುದನ್ನು ಸಾಧ್ಯವಾಗುವುದಿಲ್ಲ ಇದು ಸೇವೆಗಳ ಭಾಗವಾಗಿ ಪರಿಗಣಿಸಲಾಗುತ್ತದೆ.</p>\n<ol start=\"10\">\n<li><strong>ಮೂರನೇ</strong> <strong>ಪಕ್ಷದ</strong> <strong>ಸೇವೆಗಳನ್ನು</strong></li>\n</ol>\n<p>ಸೇವೆ ಹಾಗೂ ಮೂರನೇ ವ್ಯಕ್ತಿಯ ಒದಗಿಸುವುದಕ್ಕೆ (ಫೇಸ್ ಬುಕ್ ಮತ್ತು WhatsApp ಹಾಗೆ, ಸಾಮಾಜಿಕ ಅನ್ವಯಗಳನ್ನು ಸೀಮಿತವಾಗಿಲ್ಲ ಸೇರಿದಂತೆ ಆದರೆ) ಲಕ್ಷಣಗಳನ್ನು ಮತ್ತು ಸೇವೆಗಳನ್ನು ಲಿಂಕ್ಗಳನ್ನು.ನಾವು ಮೂರನೇ ವ್ಯಕ್ತಿ ಸೈಟ್ಗಳು ಅಥವಾ ಸೇವೆಗಳನ್ನು ನಿಯಂತ್ರಿಸಲು ಮತ್ತು ಸೈಟ್ಗಳಿಗೆ ನೀವು ವಿಷಯ ಅಥವಾ ಕಾರ್ಯವನ್ನು ಹೊಣೆಯಲ್ಲ ಇಲ್ಲ. ಕೊಂಡಿಗಳು ನಮ್ಮ ಸೇರ್ಪಡೆ ತಮ್ಮ ನಿರ್ವಾಹಕರು ಯಾವುದೇ ಜಾಹಿರಾತು ಅಥವಾ ಸಂಘದ ಅರ್ಥವಲ್ಲ. ಇಂತಹ ಮೂರನೇ ಪಕ್ಷದ ಸೇವೆಗಳನ್ನು ಬಳಕೆಗೆ ಅನ್ವಯಿಸುವ ನಿಯಮಗಳು ಅನ್ವಯವಾಗುತ್ತದೆ ಮತ್ತು ನಾವು ತಮ್ಮ ಸೇವೆಯ ನಿಮ್ಮ ಬಳಕೆಗೆ ಸಂಬಂಧಿಸಿದಂತೆ ನೀವು ಅಥವಾ ಮೂರನೆಯ ಸರ್ವಿಸ್ ಒದಗಿಸುವವರು ಮಾಡಲಾಗುತ್ತದೆ ಏನು ಜವಾಬ್ದಾರಿ ಆಗುವುದಿಲ್ಲ.</p>\n<ol start=\"11\">\n<li><strong>ಮುಕ್ತಾಯ</strong></li>\n</ol>\n<p>11.1. ನಾವು ರದ್ದುಗೊಳಿಸಬಹುದು ಅಥವಾ ನಮ್ಮ ವಿವೇಚನೆಗೆ, ಯಾವುದೇ ಸಮಯದಲ್ಲಿ ಮತ್ತು ಯಾವುದೇ ಕಾರಣಕ್ಕೆ ಸೇವೆ ನಿಮ್ಮ ಬಳಕೆ ಮತ್ತು ಪ್ರವೇಶ ರದ್ದುಗೊಳಿಸಬಹುದು. ಇಂತಹ ಅಮಾನತು ಅಥವಾ ಮುಕ್ತಾಯ ನಾವು ಸೂಕ್ತ ಪರಿಗಣಿಸಿದ ನೀವು ವಿರುದ್ಧ ಯಾವುದೇ ಕ್ರಮ ತೆಗೆದುಕೊಳ್ಳಲು ನಮ್ಮ ಬಲ ಮಿತಿ ವಿಧಿಸಬಾರದು. &nbsp;<br /> <br /> 11.2. ನಿಮ್ಮ ಸಾಧನದಿಂದ ಅಪ್ಲಿಕೇಶನ್ ಸೇವೆ ಬಳಸಲು ನಿಲ್ಲಿಸುತ್ತಿರುವುದಾಗಿ ಮತ್ತು / ಅಥವಾ ತೆಗೆದುಹಾಕಲು ಯಾವುದೇ ಸಮಯದಲ್ಲಿ ನಿಮ್ಮ ಸೇವೆಯ ಬಳಕೆಗೆ ರದ್ದುಗೊಳಿಸಬಹುದು. ನಿಮ್ಮ ಪ್ರೊಫೈಲ್ ಮತ್ತು ನೀವು ಪಕೋಡಿ ಕ್ಯಾಟಲಾಗ್ ಉಳಿಯುತ್ತದೆ ಅಪ್ಲೋಡ್ ಯಾವುದೇ ರೆಕಾರ್ಡಿಂಗ್ಸ್ ಅಳಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ ಒಂದು ಸಾಧನದಿಂದ ಅಪ್ಲಿಕೇಶನ್ ಅಳಿಸುವುದು ದಯವಿಟ್ಟು ಗಮನಿಸಿ.ನಿಮ್ಮ ಪ್ರೊಫೈಲ್ ಅನ್ನು ಅಳಿಸಲು ನೀವು ಬಯಸಿದರೆ, ನಲ್ಲಿ ಬರೆಯಲು ನಮಗೆ ಸಂಪರ್ಕಿಸಿ <a href=\"mailto:contact@sprintapps.in\">contact@sprintapps.in</a><br /> <br /> 11.3. ಯಾವುದೇ ವ್ಯಕ್ತಿಯಿಂದ ಇಂತಹ ರದ್ದತಿಯ ಸಂದರ್ಭದಲ್ಲಿ, ಈ ನಿಯಮಗಳು ರದ್ದುಗೊಳ್ಳುತ್ತದೆ, ಆದರೆ ಕೆಳಗಿನ ಒದಗಿಸುತ್ತದೆ ಅನ್ವಯವು ಮುಂದುವರಿಯುವುದು: ಪರಿಚ್ಛೇದ 3, 4, 6, 7, 9, 10, 11, 12, 13 ಮತ್ತು 14.</p>\n<ol start=\"12\">\n<li><strong>ನಿರೂಪಣೆಗಳು</strong> <strong>ಮತ್ತು</strong> <strong>ಖಾತರಿ</strong> <strong>ಕರಾರುಗಳು</strong></li>\n</ol>\n<p>12.1. ನೀವು ನಮಗೆ ಎಂದು ಭರವಸೆ:</p>\n<ol>\n<li>ಯಾವುದೇ ಹಕ್ಕು, ರಹಸ್ಯ ಮಾಹಿತಿ ಅಥವಾ ಗೌಪ್ಯತೆ ಹಕ್ಕುಗಳ ಹಕ್ಕುಗಳ ಸೇರಿದಂತೆ ಯಾವುದೇ ಮೂರನೇ ಪಕ್ಷದ ಹಕ್ಕುಗಳನ್ನು ಉಲ್ಲಂಘಿಸುವುದಿಲ್ಲ ನಿಮ್ಮ ಬಳಕೆದಾರ ವಿಷಯ;</li>\n<li>ನೀವು ಬಳಕೆದಾರ ವಿಷಯ ಕಾಣಿಸಿಕೊಳ್ಳುವ ಯಾವುದೇ ವ್ಯಕ್ತಿಗಳಿಂದ ಎಲ್ಲಾ ಅಗತ್ಯ ಅನುಮತಿಗಳನ್ನು ಮತ್ತು ಅಂಗೀಕಾರಗಳನ್ನು ಪಡೆದ; ಮತ್ತು</li>\n<li>ನಿಮ್ಮ ಬಳಕೆದಾರ ವಿಷಯ ಈ ನಿಯಮಗಳು ಅನುಸರಿಸಲು ಮಾಡುತ್ತದೆ.</li>\n</ol>\n<p>12.2. ಈ ನಿಯಮಗಳ ಪರಿಚ್ಛೇದ 13 ಒಳಪಟ್ಟಿರುತ್ತದೆ, ನೀವು ನಾವು ಸಮಂಜಸವಾಗಿ ತೀರ ನೀವು ಉಲ್ಲಂಘನೆ ತಪ್ಪಿದೆ ಅಲ್ಲಿ ಈ ನಿಯಮಗಳ ನೀವು ಯಾವುದೇ ಉಲ್ಲಂಘನೆ ಪರಿಣಾಮವಾಗಿ ಉಂಟುಮಾಡಬಹುದು ಯಾವುದೇ ನಷ್ಟ ಅಥವಾ ವೆಚ್ಚಗಳನ್ನು ನಮಗೆ ಸರಿದೂಗಿಸಲು ಒಪ್ಪುತ್ತೇನೆ. ಈ ನಿಯಮಗಳ ನಿಮ್ಮ ಉಲ್ಲಂಘನೆ ನಮ್ಮ ಉದಾಸೀನತೆ ಅಥವಾ ಈ ನಿಯಮಗಳ ನಮ್ಮ ಉಲ್ಲಂಘನೆ ಉದ್ಭವಿಸಿದೆ ವೇಳೆ ಈ ವಿಭಾಗದಲ್ಲಿ ನಮಗೆ ಸರಿದೂಗಿಸಲು ಅಗತ್ಯ ಆಗುವುದಿಲ್ಲ.</p>\n<ol start=\"13\">\n<li><strong>ಹಕ್ಕುನಿಕಾರಣೆಗಳು</strong> <strong>ಮತ್ತು</strong> <strong>ನಿಬಂಧನೆಗಳು</strong></li>\n</ol>\n<p>13.1. ನಿಮ್ಮ ಸೇವೆಯ ಬಳಕೆಗೆ ಮತ್ತು \"ಲಭ್ಯವಿರುವಂತೆ\" ತಳಹದಿ \"ಇದ್ದದ್ದು ಇದ್ದಂತೆ\" ಎಎನ್ ಮೇಲೆ. ಸೇವಾ ತೋರಿಸಲ್ಪಡುತ್ತದೆ ಸೇವೆ ಮತ್ತು ಯಾವುದೇ ವಿಷಯದ ಅಥವಾ ವಸ್ತುವಿನ ಖಚಿತತೆಯನ್ನು, ಹೊಂದಾಣಿಕೆ, ಸಂಪೂರ್ಣತೆ ಅಥವಾ ವಿಶ್ವಾಸಾರ್ಹತೆ ಬಗ್ಗೆ ಯಾವುದೇ ಖಾತರಿಗಳು, ಸ್ಥಿತಿ ಅಥವಾ ಖಾತರಿ ಇಲ್ಲದೆ ಒದಗಿಸಲಾಗುತ್ತದೆ. ನಾವು ಸೇವೆ ಅಲಭ್ಯತೆ ಅಥವಾ ವೈಫಲ್ಯದ ನಿಮಗೆ ಜವಾಬ್ದಾರರಾಗಿರುವುದಿಲ್ಲ. &nbsp;<br /> <br /> 13.2. ನಾವು ಈ ನಿಯಮಗಳಲ್ಲಿ ಉಲ್ಲಂಘಿಸಿ ಯಾವುದೇ ವ್ಯಕ್ತಿ ಸೇವೆಯ ಬಳಕೆಯಿಂದ ಉಂಟಾಗುವ ನಷ್ಟ ಅಥವಾ ಹಾನಿ ಹೊಣೆಗಾರಿಕೆಯ ಬಹಿಷ್ಕರಿಸುತ್ತೇವೆ. ನೀವು ಅಡ್ಡಹೆಸರಿನಿಂದ, ಸೇವೆ ಲಭ್ಯವಿರುವ ಧ್ವನಿ ಗ್ರಹಣ ಮತ್ತು ಯಾವುದೇ ಇತರ ವಿಷಯ ಅಮೇರಿಕಾದ ಬಳಕೆದಾರರು ಅಲ್ಲ ಒದಗಿಸಿದ ಎಂದು ಅರ್ಥ, ಮತ್ತು ನಾವು ಸೇವೆಯಲ್ಲಿ ಈ ವಿಷಯವನ್ನು ನಿಮಗೆ ಜವಾಬ್ದಾರಿಯುತ ಅಥವಾ LIABILE ಆರ್. &nbsp;<br /> <br /> 13.3. ನಾವು ವ್ಯಕ್ತವಾಗಿ ಯಾವುದೇ ಹೊಣೆಗಾರಿಕೆ (ಎ) ಯಾವುದೇ ನಷ್ಟ ಅಥವಾ ನಮ್ಮಿಂದ ಸಮಂಜಸವಾಗಿ ನಿರೀಕ್ಷಿತ ಎಂದು ಮತ್ತು ಲಾಭಗಳ ನಷ್ಟ ಒಳಗೊಂಡಿರುವಂತೆ, ಸಂಬಂಧಿಸಿದಂತೆ ನೀವು ಉಂಟಾಗುವ ಇದು ಹಾನಿಯ ಬಹಿಷ್ಕರಿಸುತ್ತೇವೆ; ಮತ್ತು (b) ಯಾವುದೇ ನಷ್ಟ ಅಥವಾ ಹಾನಿ ಈ ನಿಯಮಗಳಲ್ಲಿ ನಿಮ್ಮ ಉಲ್ಲಂಘನೆಗೆ ಫಲಿತಾಂಶವೆಂಬಂತೆ ನೀವು ಉಂಟಾಗುವ. &nbsp;<br /> <br /> 13.4. ಕಾನೂನು ಸಮ್ಮತಿಸಿದ ಪೂರ್ಣ ಪ್ರಮಾಣದವರೆಗೆ, ಲೆಕ್ಕಿಸದೆ ಯಾವುದೇ ಹಕ್ಕಿನ ಕ್ರಿಯೆ ಅಥವಾ ಆಧಾರವು ರೂಪ, ನೀವು ಅಥವಾ ಯಾವುದೇ ನಷ್ಟ ಅಥವಾ ಹಾನಿ ಯಾವುದೇ ಪಕ್ಷಕ್ಕೆ ಬಾಧ್ಯತೆ ಹೊಂದಿರುವುದಿಲ್ಲ ಎಂದು. ನೀವು ಅಂಗೀಕರಿಸುತ್ತೀರಿ ಮತ್ತು ನಮ್ಮೊಂದಿಗೆ ಯಾವುದೇ ಪ್ರಕರಣಕ್ಕಾಗಿ ನಿಮ್ಮ ಏಕೈಕ ಮತ್ತು ವಿಶೇಷ ಪರಿಹಾರ ಸೇವೆಗಳ ನಿಮ್ಮ ಬಳಕೆಯನ್ನು ಅಂತ್ಯಗೊಳಿಸಲು ಒಪ್ಪಿಕೊಂಡಿದ್ದರು. &nbsp;<br /> <br /> 13.5. ಮಿತಿ ಅಥವಾ ನಮ್ಮ ಹೊಣೆಗಾರಿಕೆ ಹಾಕುವಂತೆ ಹಾಗಿಲ್ಲ ಈ ವಿಷಯದಲ್ಲಿ ಏನೂ: (I) ಸಾವಿನ ಅಥವಾ ನಮ್ಮ ಉದಾಸೀನತೆ ಪರಿಣಾಮವಾಗಿ ವೈಯಕ್ತಿಕ ಗಾಯ; (II) ಉದ್ದೇಶಪೂರ್ವಕ ಕೃತ್ಯಗಳು, ವಂಚನೆ ಅಥವಾ ಮೋಸದ ತಪ್ಪು; ಮತ್ತು (iii) ಹೊರತುಪಡಿಸಿದ ಅಥವಾ ಕಾನೂನಿನಿಂದ ಸೀಮಿತ ಸಾಧ್ಯವಿಲ್ಲ ಎಂದು ಯಾವುದೇ ಹೊಣೆಗಾರಿಕೆ.</p>\n<ol start=\"14\">\n<li><strong>ಮುಕ್ತಾಯ</strong></li>\n</ol>\n<p>ಈ ನಿಯಮಗಳು ಅಂತ್ಯಗೊಳಿಸಿ ನಾವು ಸೇವೆ ಒದಗಿಸಲು ನಿಲ್ಲಿಸಲು ವೇಳೆ, ಸೂಚನೆ ಇಲ್ಲದೆ ಯಾವುದೇ ಸಮಯದಲ್ಲಿ ನಿಮ್ಮ ಖಾತೆಯನ್ನು ಮುಚ್ಚಿ ಮಾಡಬಹುದು.</p>\n<ol start=\"15\">\n<li><strong>ಇತರೆ</strong> <strong>ಕರಾರು</strong></li>\n</ol>\n<p>15.1. ಸ್ಪ್ರಿಂಟ್ ಅಪ್ಲಿಕೇಶನ್ಗಳು, ನಿಯೋಜಿಸಲು ಒಳ ಒಪ್ಪಂದ ಮತ್ತು / ಅಥವಾ ಯಾವುದೇ ಕಂಪನಿ, ಸಂಸ್ಥೆ ಅಥವಾ ವ್ಯಕ್ತಿ ಈ ನಿಯಮಗಳ ಪ್ರಕಾರ ನಮ್ಮ ಹಕ್ಕುಗಳನ್ನು ಮತ್ತು / ಅಥವಾ ಹೊಣೆಗಾರಿಕೆಗಳನ್ನು ಅಥವಾ ಎಲ್ಲಾ ವರ್ಗಾವಣೆ ಮಾಡಬಹುದು.ನೀವು ಯಾರಾದರೂ ಈ ನಿಯಮಗಳ ಪ್ರಕಾರ ನಿಮ್ಮ ಹಕ್ಕು ಅಥವಾ ಹೊಣೆಗಾರಿಕೆಗಳನ್ನು ವರ್ಗಾಯಿಸುವುದು. &nbsp;<br /> <br /> 15.2. ಈ ನಿಯಮಗಳ ಕರಾರುಗಳನ್ನು ಪ್ರತ್ಯೇಕವಾಗಿ ಕಾರ್ಯನಿರ್ವಹಿಸುತ್ತದೆ. ಈ ವಿಷಯದಲ್ಲಿ ನಿಬಂಧನೆಗಳ ಯಾವುದೇ ಕಾನೂನುಬಾಹಿರ ಅಥವಾ ನಿರ್ಬಂಧಿಸಲಾಗದ ಎಂದು ನಡೆಸಲಾಗುತ್ತದೆ ಎಂದು ಸಂದರ್ಭದಲ್ಲಿ, ಆ ನಿಬಂಧನೆಗಳನ್ನು ಮಿತಿಯನ್ನು ಅಥವಾ ಕನಿಷ್ಠ ಮಟ್ಟಿಗೆ ಅಗತ್ಯ ತೆಗೆದು, ಮತ್ತು ಈ ಬಾಕಿ ಉಳಿದ ನಿಯಮಗಳ ಸೌಲಭ್ಯಗಳು ಪೂರ್ಣ ಶಕ್ತಿ ಮತ್ತು ಪ್ರಭಾವವನ್ನು ಉಳಿಯುತ್ತದೆ. &nbsp;<br /> <br /> 15.3. ಈ ನಿಯಮಗಳು ಮತ್ತು ನಮ್ಮ ಗೌಪ್ಯತೆ ನೀತಿ ನೀವು ಮತ್ತು ನಮಗೆ ನಡುವೆ ಸಂಪೂರ್ಣ ಒಪ್ಪಂದದ ಇದ್ದಾರೆ ಮತ್ತು ಎಲ್ಲಾ ಮೊದಲು ಮತ್ತು ಸಮಕಾಲೀನ ಒಪ್ಪಂದಗಳು ಅಥವಾ ಸಂಪರ್ಕ ರದ್ದುಗೊಳಿಸುವ. &nbsp;<br /> <br /> 15.4. ಈ ನಿಯಮಗಳು ಪಕ್ಷದ ಅಲ್ಲ ಯಾವುದೇ ವ್ಯಕ್ತಿ ಯಾವುದೇ ಪದವನ್ನು ಹೇರಲಾಗಿದೆ. &nbsp;<br /> <br /> 15.5. ಈ ನಿಯಮಗಳು ಮತ್ತು ಯಾವುದೇ ವಿವಾದ ಅಥವಾ (ಅ ಕರಾರಿನ ವಿವಾದಗಳು ಅಥವಾ ಹಕ್ಕು ಸೇರಿದಂತೆ) ಹೊರಗೆ ಅಥವಾ ಇದು ಅಥವಾ ಆಟಂ ಅಥವಾ ರಚನೆಗೆ ಸಂಬಂಧಿಸಿದಂತೆ ಹುಟ್ಟುವ ಹಕ್ಕು ಆಡಳಿತ ಮತ್ತು ಭಾರತೀಯ ಕಾನೂನಿನ ಅನುಸಾರವಾಗಿ ನಿರ್ಬಂಧಿಸಿತು ಮತ್ತು ಪಕ್ಷಗಳು ಇದರ ವ್ಯಾಪ್ತಿಯನ್ನು ಸಲ್ಲಿಸಲು ಹಾಗಿಲ್ಲ ಭಾರತೀಯ ನ್ಯಾಯಾಲಯಗಳ ಯಾವುದೇ ಹಕ್ಕು ನೆಲೆಗೊಳ್ಳಲು ಈ ನಿಯಮಗಳು ಅಥವಾ (ಅ ಕರಾರಿನ ವಿವಾದಗಳು ಅಥವಾ ಹಕ್ಕು ಸೇರಿದಂತೆ) ಆಟಂ ಅಥವಾ ರಚನೆಗೆ ಸಂಬಂಧಿಸಿದಂತೆ ಹುಟ್ಟುವ ಪರವಾಗಿಲ್ಲ.</p>\n<p><strong>ಪರಿಣಾಮಕಾರಿ</strong><strong>: 2015 </strong><strong>ಆಗಸ್ಟ್</strong></p>',2,'2015-07-24 16:01:49'),(9,5,'About Us - Malayalam','<p><strong><span style=\"color: #ff0000;\">പകകോഡിയെ കുറിച്ച ്&nbsp;</span></strong></p>\n<p>സംഭോഷണങ്ങൾ ഇകപോൾ പണ്ടയെകപോയെ വിരസവും ശുഷ ്കവുമോെ വോദപ്പതിവോദങ്ങളെല .</p>\n<p>വിദഗ്ദമോെ ആപുകളുയെ വരകവോെുകൂെി നമ്മളിഷ ്െയപെുന്നവരുമോെുള്ള സെല ോപം പുതിെ തെങ്ങളികെെ ്കുെർന്നിരികുകെോണ ്. ഇകപോൾ, സെല ോപങ്ങളിൽ എപ്തമോപ്തം \'എക ്സ ്\' ഫോക ്െർ ഉകണ്ടോ, സംസോരികുന്ന ആളിയനകുറിച്ചുള്ള മതിപ ് അപ്തെും ഏറും.&nbsp;</p>\n<p>അെരെിെുള്ള, സരസമോെ വൺലെനുകളും, സിനിമോ സംഭോഷണങ്ങളും, കകോമഡി കലിപുകളും കൂെോയത നിങ്ങൾക ് സവപ ്നം കോണോൻ കഴിെുന്ന എന്ും പകകോഡിെിൽ ഉൾയപട്ടിരികുന്നു. നിങ്ങൾക ് ഇകപോൾ ഓഡികെോ കലിപുകൾ അെെ ്കോനും, വീഡികെോകൾ യറകകോർഡ ് യെെ ്ത ് അവെിൽ സിനിമെുയെകെോ സൗണ്ട ് കലിപുകളുയെകെോ ശബ ്ദം ഡബ്ബ ് യെെ ്ത ് കെർകുവോനും കഴിെുന്നതോണ ്. കൂെോയത വോട്ട ്സ ്ആപ ്, ഗൂഗിൾ+, കഫസ ്ബുക ്, െവിറ്റർ തുെങ്ങിെ സോമൂഹിക മോധ്യമ പലോറ്റുകഫോമുകളികെെ ്ക ് ഇവ അെെ ്കോനും പകകോഡി നിങ്ങയള അനുവദികുന്നു.</p>',1,'2015-07-24 16:03:47'),(10,5,'Terms and Conditions - Malayalam','<p>(സമയാസമയങ്ങളിൽ പുതുക്കുന്ന, <strong>\"</strong><strong>നിബന്ധനകൾ</strong><strong>\")</strong> സേവനം ഈ നിബന്ധനകൾ നിങ്ങളുടെ ആക്സസ് <strong>Pakodi</strong> സേവനം (താഴെ പറയുന്ന പോലെ) ഏതെങ്കിലും ശബ്ദ റെക്കോർഡിങ്ങുകൾ, വീഡിയോകൾ, വിവരം, ടെക്സ്റ്റ്, ഗ്രാഫിക്സ് അല്ലെങ്കിൽ അപ്ലോഡ് മറ്റ് ഉള്ളടക്കം വസ്തുക്കളുടെ ഉപയോഗം നിയന്ത്രിക്കുകയും, ഡൗൺലോഡ് അല്ലെങ്കിൽ സേവനം പ്രത്യക്ഷപ്പെടുന്നത്.സേവനം ഡൌൺലോഡ് അല്ലെങ്കിൽ ഉപയോഗിക്കുന്നതിന് മുമ്പ് ഈ നിബന്ധനകൾ ശ്രദ്ധാപൂർവ്വം വായിക്കുക. ഈ നിബന്ധനകൾ അംഗീകരിച്ചതിനുശേഷം, അല്ലെങ്കിൽ സേവനം ഉപയോഗിക്കുന്നതിലൂടെ, അവരെ ബാധ്യസ്ഥരാണെന്ന് സമ്മതിക്കുന്നു. നിങ്ങൾ നിബന്ധനകൾ മനസ്സിലാകുന്നില്ല അല്ലെങ്കിൽ അവരുടെ ഏതെങ്കിലും ഭാഗത്ത് അംഗീകരിക്കില്ല, നിങ്ങൾ സേവനം ഉപയോഗിക്കരുത്. സേവന സ്പ്രിൻറ് അപ്ലിക്കേഷനുകൾ പ്രൈവറ്റ് ലിമിറ്റഡ് ആരുടെ സ്ഥലം ബിസിനസ്സിന്റെ ഹൈദരാബാദ്, ഇന്ത്യ (: ഇമെയിൽ ആണ് <strong>(\"</strong><strong>ഞങ്ങൾ</strong><strong>\", \"</strong><strong>നമുക്ക്</strong><strong>\" \"</strong><strong>നമ്മുടെ</strong><strong>\"</strong> എന്നും <strong>\"SprintApps\")</strong> നൽകുന്ന ആണ് <a href=\"mailto:contact@sprintapps.in)\">contact@sprintapps.in)</a> .</p>\n<ol>\n<li><strong>സേവനം</strong></li>\n</ol>\n<p>സേവനം ആൻഡ്രോയിഡ് &amp; ഐഒഎസ് പതിപ്പുകൾ ലഭ്യമാണ് ഏത് മൊബൈൽ ആപ്ലിക്കേഷൻ <strong>\"Pakodi\"</strong> ആയി ഓഫർ</p>\n<ol start=\"2\">\n<li><strong>പരിവർത്തനങ്ങൾ</strong> <strong>അപ്ഡേറ്റുകളും</strong></li>\n</ol>\n<p>2.1. നാം മാറ്റങ്ങൾ പ്രതിഫലിക്കുന്നത് കാലാകാലങ്ങളിൽ ഈ നിബന്ധനകൾ അപ്ഡേറ്റ് ചെയ്യാം (i) ഞങ്ങളുടെ നയങ്ങൾ ഉചിതമായ നിയമങ്ങളിൽ; (Ii) പ്രവർത്തനം ലെ; അല്ലെങ്കിൽ (iii) മൂന്നാം കക്ഷി വിതരണക്കാരുടെയും ഞങ്ങളെ ഏർപ്പെടുത്തിയിട്ടുണ്ട്. ഏത് അപ്ഡേറ്റുകൾ അക്കൗണ്ടിൽ സേവന നിങ്ങളുടെ ന്യായമായ താൽപ്പര്യങ്ങൾ എടുത്തു മാറ്റം പ്രാബല്യത്തിൽ വരുന്നതിനുമുമ്പ് ന്യായമായ ഒരു സമയത്തിനുള്ളിൽ ഇമെയിൽ വഴി നിങ്ങൾക്ക് അറിയിക്കും. മാറ്റങ്ങൾ അതിനാല് ബാധകമാക്കില്ല അവർ നിങ്ങളെ അറിയിക്കും ശേഷം അപ്ഡേറ്റ് നിബന്ധനകൾ പ്രാബല്യത്തിൽ വരുകയുമില്ല. അപ്ഡേറ്റ് നിബന്ധനകൾ യോജിപ്പില്ല ഇല്ലെങ്കിൽ സേവനം ഉപയോഗിക്കുന്നതിലൂടെ അവസാനിപ്പിക്കണം. ന്യായമായ സമയത്തിനുള്ളിൽ അപ്ഡേറ്റ് നിബന്ധനകൾ എതിർക്കാനും ഇല്ലെങ്കിൽ അവർ നിങ്ങളെ അറിയിക്കും ശേഷം അപ്ഡേറ്റ് നിബന്ധനകൾ നിങ്ങൾ സ്വീകരിച്ചു കരുതപ്പെടുമെന്ന്. നാം നിബന്ധനകളും അറിയിപ്പ് ഇമെയിൽ കല്പിത സ്വീകാര്യത മാറ്റങ്ങൾ എതിർക്കുന്നതിനും ഉപാധി ഹൈലൈറ്റ് ചെയ്യും. &nbsp;<br /> <br /> 2.2. നാം പിൻവലിക്കാൻ ഇറക്കി ഏത് സമയത്തും ഒട്ടും സേവനത്തിന്റെ ഭാഗമായി എല്ലാ അല്ലെങ്കിൽ സേവനത്തിൽ ലഭ്യമാണ് ഉള്ളടക്കം ഭാഗം ഭേദഗതി നിക്ഷിപ്തമായിരിക്കും; ഉദാഹരണത്തിന്, ന്യായ പുതിയ സാങ്കേതിക വികാസങ്ങൾ മാറ്റങ്ങൾ പ്രതിഫലിപ്പിക്കുന്നത്.മാറ്റങ്ങളൊന്നും അക്കൗണ്ടിലേക്ക് നിങ്ങളുടെ ന്യായമായ താൽപര്യങ്ങൾ എടുക്കും. സേവന എല്ലാ ഭാഗികമായോ ആക്സസ് അറ്റകുറ്റപ്പണി, അറ്റകുറ്റപ്പണി അല്ലെങ്കിൽ കാലികമാക്കുന്നതോ അനുവദിക്കുന്നതിന് സമയാസമയങ്ങളിൽ പരിമിതപെടുത്തിരിയിരിക്കുന്നു. ഇത് നിങ്ങൾ ഏറ്റവും പുതിയ പതിപ്പ് ഡൗൺലോഡ് ഏത് പുതിയ നിബന്ധനകളും സ്വീകരിച്ചു വരെ നിങ്ങൾക്ക് സേവനം ഉപയോഗിക്കാൻ കഴിയാതിരിക്കുക കാരണമായേക്കാം.</p>\n<ol start=\"3\">\n<li><strong>സേവന</strong> <strong>ആക്സസ്</strong><strong> / </strong><strong>ഉപയോഗിക്കുക</strong></li>\n</ol>\n<p>3.1. രക്ഷെക്കും, അപ്ലിക്കേഷൻ ഡൗൺലോഡ് ഒരു അക്കൗണ്ട് സൃഷ്ടിക്കുന്നത്, Pakodi കാറ്റലോഗ് നിന്നും തിരഞ്ഞെടുത്ത ഓഡിയോ ക്ലിപ്പുകൾ കേൾക്കുകയും ആ ഓഡിയോ ക്ലിപ്പുകൾ ബന്ധപ്പെട്ട് ഒരു വീഡിയോ റിക്കോർഡ് ചെയ്തു് സേവനം കഴിയും.ഇത് ഒരു <strong>\"DUB\"</strong> സൃഷ്ടിക്കുന്നു വീഡിയോ സംയോജിപ്പിക്കുമ്പോൾ ചേരുന്നതിൽ ഓഡിയോ ക്ലിപ്പ് പരിണമിക്കും.സിസറോ നിങ്ങളുടെ ഉപകരണത്തിന്റെ പ്രാദേശിക മെമ്മറി സൂക്ഷിക്കുന്നു അത്തരം മുഖം പുസ്തകം, ട്വിറ്റർ, ആദരവ്, Google+ ചില മൂന്നാം കക്ഷി സേവനങ്ങൾ, വഴി നിങ്ങളുടെ കോൺടാക്റ്റുകൾക്കൊപ്പം പങ്കിടാൻ കഴിയും.</p>\n<p>3.2. സേവനം ഉപയോഗിക്കുന്നതിന് നിങ്ങൾ പതിനെട്ട് (18) വയസ്സുള്ള അല്ലെങ്കിൽ പഴയ ആയിരിക്കണം. (എ) 18 വയസ് അല്ലെങ്കിൽ കാര്യത്തോട് അല്ലെങ്കിൽ (ബി) 13 വയസ് അല്ലെങ്കിൽ മേലും നിങ്ങളുടെ മാതാപിതാക്കളിൽ നിന്നും സേവനം ഉപയോഗിക്കാൻ അനുമതിയില്ല: സേവന ഉപയോഗിക്കുന്നത് വഴി നിങ്ങൾ ഈ നിബന്ധനകൾ ആ സ്വീകരിക്കാൻ നമുക്കു വാഗ്ദാനം അല്ലെങ്കിൽ നിയമപരമായ രക്ഷിതാവിന്റെ. യുക്തിസഹമായി നിങ്ങൾ വേണ്ടത്ര ഈ മാനദണ്ഡം നിറവേറ്റാൻ ഇല്ല എന്നു വിശ്വസിക്കുന്നു എങ്കിൽ പ്രായം സ്വീകാര്യമായ പ്രൂഫ് ഞങ്ങൾക്ക് നൽകിയ വരെ ഞങ്ങൾ സേവനം ഉപയോഗിക്കുന്നത് താൽക്കാലികമായി. &nbsp;<br /> <br /> 3.3. നാം സേവന 18 പ്രകാരം കുട്ടികൾക്ക് ഉദ്ദേശിച്ചുകൊണ്ടല്ല അറിഞ്ഞിരിക്കുക സേവനം ഉപയോഗിക്കുക തങ്ങളുടെ കുട്ടികളെ അനുവദിക്കുന്നില്ല മാതാപിതാക്കളാണ് ഉപദേശിക്കുകയാണ്. ഉള്ളടക്കം സേവനം ലഭ്യമാക്കും \"Pakodi\" നിന്ന് പുറമേ ഉപയോക്താവ് സൃഷ്ടിച്ച കുട്ടികൾക്കും അനുയോജ്യമാകാനിടയില്ലാത്ത അടങ്ങിയിരിക്കും.<br /> <br /> 3.4. സേവനം ചില ഫംഗ്ഷനുകൾ പ്രവേശിക്കുന്നതിന്, നീ ഞങ്ങളോട് രജിസ്റ്റർ ചെയ്യണം. രജിസ്റ്റർ, നിങ്ങളുടെ പേര്, മൊബൈൽ നമ്പർ, ഇമെയിൽ വിലാസം, പ്രായം ഞങ്ങളെ നൽകണം.നിങ്ങളുടെ എൻ ല്തയ്യാറാക്കിയതാണ് സേവനത്തിൽ അപ്ലോഡ് ഏതെങ്കിലും ഉള്ളടക്കം അരികെയായി ദൃശ്യമാകും.നിങ്ങളുടെ പേര് ഈ നിബന്ധനകൾ പാലിക്കുന്നുവെന്ന് ഉറപ്പുവരുത്തുക.<br /> <br /> 3.5. അത്തരം പ്രവർത്തനം നിങ്ങൾ അംഗീകാരം ചെയ്തു ഇല്ലയോ, ഞങ്ങൾക്കും നിങ്ങളുടെ അക്കൗണ്ടിൽ നടക്കുന്ന ഏതെങ്കിലും പ്രവർത്തനം ഉപയോഗിച്ച് നിങ്ങളുടെ അക്കൗണ്ട് ഉത്തരവാദികൾ.നിങ്ങൾ ഞങ്ങൾക്കു നൽകുന്ന വിശദാംശങ്ങൾ ശരിയാണോ അഭിനവവും കാത്തു ഉറപ്പു വരുത്തുക.നീ ഞങ്ങളോടു രജിസ്റ്റർ നൽകിയ വിശദാംശങ്ങൾ ഏതെങ്കിലും മാറ്റങ്ങൾ ഞങ്ങളെ വിവരം അറിയിക്കേണ്ടതാണ്. &nbsp;<br /> <br /> 3.6. ഞങ്ങൾ സുരക്ഷാ ഒരു പൊട്ടൽ ചെയ്തിട്ടുണ്ട് വിശ്വസിക്കുന്ന അല്ലെങ്കിൽ പ്രവർത്തനങ്ങൾ നിങ്ങളുടെ അക്കൗണ്ടിൽ ഉണ്ടാവുകയാണെങ്കില് ഞങ്ങൾ വിശ്വസിക്കുന്ന, നിങ്ങളുടെ accountand മുൻകൂർ അറിയിപ്പ് കൂടാതെ, സേവനം ഉപയോഗിക്കുന്നത് നിരോധിക്കുന്നു താൽക്കാലികമായി നീക്കം നിങ്ങളുടെ അക്കൗണ്ട് റദ്ദാക്കുന്നതിന്, വീണ്ടും നൽകുക അപ്രാപ്തമാക്കുകയോ അവകാശം ഞങ്ങളിൽ നിക്ഷിപ്തമാണ് ഈ നിബന്ധനകൾ ഒടിവു.<br /> <br /> 3.7. പ്രവേശനം സേവന ഉപയോഗം അനുയോജ്യമായ ഡിവൈസ് ഇന്റർനെറ്റ് കണക്ഷൻ ആവശ്യമാണ്. ഞങ്ങൾ സേവന വിവിധ ഉപകരണങ്ങളിൽ അനുയോജ്യമായ ഉറപ്പാക്കുന്നതിനായി പ്രവർത്തിക്കുന്നു എങ്കിലും, ഞങ്ങൾ സേവന എല്ലാ ഉപകരണങ്ങളിലും പ്രവർത്തിക്കുമെന്നും ഉറപ്പുനൽകാൻ കഴിയില്ല. സേവനം നിലവിൽ, ഒരു വീഡിയോ ക്യാമറ ചടങ്ങിൽ ഉപയോഗിച്ച് സ്മാർട്ട് ആവശ്യമാണ് കാറും സ്റ്റോറേജ് കപ്പാസിറ്റി 30MB ഉറവു ആൻഡ്രോയ്ഡ് 4.3 (അല്ലെങ്കിൽ പിന്നീട്) അല്ലെങ്കിൽ iOS7 (അല്ലെങ്കിൽ പിന്നീട്) ഓപ്പറേറ്റിംഗ് സിസ്റ്റങ്ങളിൽ.</p>\n<p>3.8. നിങ്ങളുടെ ഉപകരണം ഈ ആവശ്യകതകൾ പാലിക്കുന്നുവെന്ന് ഉറപ്പാക്കാൻ നിങ്ങളുടെ ഉത്തരവാദിത്തമാണ്. സേവന ഉപയോഗം ഉപകരണത്തിന്റെ തരം അതു ഉപയോഗിക്കുന്നതിനാൽ സ്പ്രിൻറ് അപ്ലിക്കേഷനുകൾ നിങ്ങളുടെ ഉപകരണം ഉൾപ്പെടെയുള്ള ഉപകരണങ്ങൾ (, അന്താരാഷ്ട്ര കാരണം പ്രവർത്തനം ഏതെങ്കിലും അഭാവം യാതൊരു ഉത്തരവാദിത്തവും സ്വീകരിക്കുന്ന ഓപ്പറേറ്റിങ് സിസ്റ്റം അനുസരിച്ച് പ്രവർത്തനക്ഷമത, ലഭ്യത ഗുണനിലവാരവും ലെ വ്യത്യാസപ്പെടാം കണക്ഷൻ, ഓപ്പറേറ്റിങ് സിസ്റ്റം അല്ലെങ്കിൽ ക്രമീകരണങ്ങളും സോഫ്റ്റ്വെയർ).<br /> <br /> 3.9. അത് (എല്ലാ ടെലിഫോൺ കോൾ അല്ലെങ്കിൽ ലൈൻ ചാർജ് അല്ലെങ്കിൽ ഇന്റർനെറ്റ് ഡാറ്റ സേവനം കോളിംഗ് ചാർജ്, നൽകൽ, പക്ഷെ) സേവനം ഉപയോഗിക്കുന്ന സമയത്ത് നിങ്ങൾ ഈടാക്കുന്നതിനിടയാക്കാം എല്ലാ ചെലവുകളും പണം നിങ്ങളുടെ ഉത്തരവാദിത്തമാണ്.</p>\n<ol start=\"4\">\n<li><strong>ഉപയോക്താവ്</strong><strong>-</strong><strong>നിർമ്മിത</strong> <strong>ഉള്ളടക്കം</strong></li>\n</ol>\n<p>4.1. നിങ്ങൾ ഒരുമിച്ചു (സ്വകാര്യമായി കൈമാറ്റം ചെയ്യപ്പെടുന്ന അല്ലെങ്കിൽ പൊതുവായി ലഭ്യമാകുന്ന എന്നു നിങ്ങളുടെ സേവന ഉപയോഗം ഏതെങ്കിലും റെക്കോർഡിംഗുകളും <strong>(\"</strong><strong>വീഡിയോ</strong> റിക്കോര്ഡ്\") മാത്രം ഉത്തരവാദിത്തമാണ്, സിസറോ, വാക്കുകളും വിവരങ്ങൾ, സന്ദേശങ്ങൾ നിങ്ങൾക്ക് അപ്ലോഡ് അല്ലെങ്കിൽ സേവനത്തിലൂടെ സൃഷ്ടിക്കുന്ന മറ്റേതെങ്കിലും ഉള്ളടക്കം <strong>\"</strong><strong>ഉപയോക്താവ്</strong> <strong>ഉള്ളടക്കം</strong><strong>\").</strong><strong>നിങ്ങളുടെ</strong> <strong>ഉപയോക്തൃ</strong> <strong>ഉള്ളടക്കം</strong> <strong>ഉടമസ്ഥാവകാശത്തെ</strong> <strong>നിലനിർത്തുന്നു</strong><strong>.</strong> &nbsp;<br /> <br /> 4.2. നിങ്ങൾ സേവന അപ്ലോഡ് ചെയ്യുന്ന വീഡിയോ റിക്കോര്ഡ് സേവന മറ്റ് ഉപയോക്താക്കൾക്ക് പൊതു വരുത്തുമ്പോൾ.അപ്ലോഡ് ചെയ്തുകൊണ്ട്, നിങ്ങൾ മനസ്സിലാക്കുകയും നിങ്ങളുടെ പേര് ഓരോ റെക്കോർഡിംഗ് ബന്ധപ്പെട്ട് പൊതു, നിങ്ങൾക്ക് സ്പ്രിൻറ് ആപ്ലിക്കേഷനുകളും ഞങ്ങളുടെ അനുബന്ധ പ്രദർശിപ്പിക്കുകയും, അല്ലെങ്കിൽ റിക്കോര്ഡ് ബന്ധപ്പെട്ട് നിങ്ങളുടെ പേര് ഉപയോഗിക്കാനുള്ള അവകാശം അനുവദിക്കുന്ന ഞാൻ അംഗീകരിക്കുന്നു.<br /> <br /> 4.3. ഏത് സിസറോ / നിങ്ങൾ സേവന ബന്ധപ്പെട്ട് എടുത്തു വീഡിയോകൾ പ്രാദേശികമായി സംഭരിച്ചു നിങ്ങൾ പ്രസിദ്ധീകരിച്ചിരിക്കുന്നത് ഉണ്ടാക്കിയപ്പോൾ സേവനത്തിൽ അപ്ലോഡ്<br /> <br /> 4.4. നിങ്ങൾ മനസിലാക്കുകയും സേവന ഉപയോക്തൃ ഉള്ളടക്കം ഉപയോഗവുമായി ബന്ധപ്പെട്ട് ബാധകമായ എല്ലാ നിയമങ്ങളും പാലിക്കുമെന്ന് സമ്മതിക്കുന്നു. &nbsp;<br /> <br /> 4.5. നിങ്ങൾ എല്ലാ സമയങ്ങളിൽ നിങ്ങളുടെ ഉപയോക്തൃ ഉള്ളടക്കം ചെയ്യുന്നില്ല ഉറപ്പുവരുത്തണം:</p>\n<ol>\n<li>പകർപ്പവകാശം, ട്രേഡ് മാർക്ക് അവകാശങ്ങൾ, രഹസ്യ വിവരങ്ങളോ സ്വകാര്യതാ അവകാശങ്ങൾ ഉൾപ്പെടെ ഏതെങ്കിലും മൂന്നാം കക്ഷിയുടെ അവകാശങ്ങളെ ലംഘിക്കുന്നു ഏതെങ്കിലും ഉള്ളടക്കം, വിവരം, മെറ്റീരിയൽ ഉൾക്കൊള്ളാൻ;</li>\n<li>ബാധകമായ നിയമങ്ങൾ ലംഘിക്കരുത്;</li>\n<li>അമ്പരപ്പിക്കുന്ന, പ്രോത്സാഹിപ്പിക്കുന്നു അല്ലെങ്കിൽ പ്രോത്സാഹിപ്പിക്കുന്നു അക്രമം, തീവ്രവാദം, മറ്റേതെങ്കിലും നിയമവിരുദ്ധമായ ക്ലേശമുണ്ടാക്കാനോ സാധ്യതയുള്ള ഏത് നിന്ദ്യവും അധിക്ഷേപിക്കുന്ന, മാനനഷ്ടം ഉണ്ടാക്കുന്ന, അപകീർത്തികരമായ, ഭീഷണിപ്പെടുത്തൽ, വിവേചനപരമായ അശ്ലീലമോ അക്രമം, ലൈംഗിക സ്പഷ്ടമായ അസഭ്യവും, യാതൊരു ഉള്ളടക്കം അല്ലെങ്കിൽ മെറ്റീരിയൽ ഉൾക്കൊള്ളാൻ , അലാം, അസൌകര്യം വിഷമസന്ധിയിലാക്കുവാൻ ഏതെങ്കിലും വ്യക്തിയെ ശല്യമുണ്ടാക്കാൻ;</li>\n<li>ഏതെങ്കിലും തരത്തിൽ നിയോഗിക്കുക ഏതെങ്കിലും നിയമവിരുദ്ധമായി അല്ലെങ്കിൽ ക്രിമിനൽ പ്രവർത്തനം അല്ലെങ്കിൽ വിരുദ്ധ സാമൂഹ്യ പെരുമാറ്റം സഹായിക്കുന്നു, അല്ലെങ്കിൽ മറ്റുള്ളവരുടെ സുരക്ഷ അല്ലെങ്കിൽ ബുഷാണ് അപകടം കഴിയാത്ത പ്രോത്സാഹിപ്പിക്കാനുള്ള ആർക്കും പ്രോത്സാഹൽപ്പിക്കുകയോ ഇളക്കിവിട്ട്;</li>\n<li>അവർ 18 വയസ്സിൽ കീഴിൽ പക്ഷം അവരുടെ ഒരാളുടെ സമ്മതമില്ലാതെ, അല്ലെങ്കിൽ അവരുടെ രക്ഷകർത്താവ് അല്ലെങ്കിൽ രക്ഷിതാവ് അനുമതി തിരിച്ചറിയാൻ;</li>\n<li>ആരുടേയും സ്വകാര്യ സമ്പർക്ക വിവരങ്ങൾ വെളിപ്പെടുത്താനും അവരുടെ സ്വകാര്യതാ ആക്രമിച്ച്;</li>\n<li>വൈറസുകൾ അല്ലെങ്കിൽ മറ്റ് ക്ഷുദ്ര അല്ലെങ്കിൽ ഹാനികരമായ പ്രോഗ്രാമുകൾ ഉൾക്കൊള്ളാൻ; അഥവാ</li>\n<li>ഏതെങ്കിലും പരസ്യം അല്ലെങ്കിൽ പ്രൊമോഷണൽ സന്ദേശങ്ങൾ ഉൾപ്പെടുത്തുക.</li>\n</ol>\n<p><br /> 4.6. കൂടാതെ, നിങ്ങൾ മനസ്സിലാക്കുകയും സേവനത്തിൻറെ നിങ്ങളുടെ ഉപയോഗം ബന്ധപ്പെട്ട് ചെയ്യാൻ അല്ലെങ്കിൽ ചെയ്യാൻ ശ്രമിക്കും, അല്ലെങ്കിൽ ചെയ്യാൻ ചെയ്യാൻ അല്ലെങ്കിൽ ശ്രമിച്ചുവെന്നതാണ് ഏതെങ്കിലും മൂന്നാം കക്ഷി കാരണമാകും, താഴെ ആർക്കും സമ്മതിക്കുന്നു:</p>\n<ol>\n<li>പോലെ പ്രതീകാത്മകമായി ഈ നിബന്ധനകൾ സേവന പ്രവർത്തനം അനുവദിക്കുന്ന പുറമെ സേവനത്തിൽ ലഭ്യമായ സേവനം അല്ലെങ്കിൽ ഉപയോക്താവ് ഉള്ളടക്കം ഉപയോഗിക്കുക;</li>\n<li>ക്രെഡിറ്റ് കാർഡ് നമ്പറുകൾ, അക്കൗണ്ട് പാസ്വേഡുകൾ തുടങ്ങിയ പോലെ മറ്റ് ആളുകളുടെ സ്വകാര്യ കൂടാതെ / അല്ലെങ്കിൽ രഹസ്യസ്വഭാവമുള്ള വിവരങ്ങൾ .;</li>\n<li>ഒരു നിയമവിരുദ്ധമായ രീതിയിൽ അല്ലെങ്കിൽ ഈ നിബന്ധനകളിൽ എതിരല്ല വിധത്തിൽ, യാതൊരു അനധികൃത ഏതൊരാൾക്കും സേവനം ഉപയോഗിക്കുക;</li>\n<li>സേവന ഉപയോഗവുമായി വഴി മറ്റാരെക്കാളും ആയിരിക്കാൻ ആൾമാറാട്ടം അല്ലെങ്കിൽ നടിക്കുന്നു;</li>\n<li>, തകരാറുള്ള നിർജ്ജീവമാക്കാൻ നിർബന്ധിതരാക്കിത്തീർക്കുമെന്ന്, കോട്ടംവരുത്തുക അല്ലെങ്കിൽ വിട്ടുവീഴ്ച സേവനം, ഞങ്ങളുടെ സിസ്റ്റങ്ങൾ സുരക്ഷാ അല്ലെങ്കിൽ മറ്റ് ഉപയോക്താക്കളുമായി തടസ്സം കഴിഞ്ഞില്ല വിധത്തിൽ സേവനം ഉപയോഗിക്കുക;</li>\n<li>ഏതൊരു പ്രോഗ്രാം അല്ലെങ്കിൽ മറ്റ് മാർഗങ്ങൾ ഉപയോഗിക്കുന്നു ഉൾപ്പെടുന്ന എന്നാൽ സ്ക്രിപ്റ്റുകൾ, ചിലന്തികൾ എന്നിവ റോബോട്ടുകൾ പരിമിതപ്പെടുത്താതെ, മാനുവലായി സ്വയം ഇല്ലയോ, പാകത്തിൽ, ഡൌൺലോഡ്, സൂചിക, എന്റെ പാറയാക്കും, അവതരണം, ഓപ്പറേഷൻ അല്ലെങ്കിൽ സേവനം അല്ലെങ്കിൽ ഏതെങ്കിലും സവിശേഷതകളുടെ ഉദ്ദേശിക്കുന്ന ഉപയോഗത്തിന് പുനരുല്പ്പാദിപ്പിക്കുക അല്ലെങ്കിൽ പ്രയോഗിക്കുന്നതാണ് അല്ലെങ്കിൽ അതിന്റെ പ്രവർത്തനങ്ങൾ;</li>\n<li>കോപ്പി, മാറ്റം decompile അല്ലെങ്കിൽ സേവന ഏതെങ്കിലും ഭാഗത്ത് തടസ്സം;</li>\n<li>മാറ്റം എന്നും സേവനത്തിലേക്ക് മുഴുവനായോ ഭാഗം എന്ന മാറ്റങ്ങൾ വരുത്തുവാൻ, അല്ലെങ്കിൽ യോജിപ്പിക്കണം സേവന അല്ലെങ്കിൽ ഏതെങ്കിലും ഭാഗം അനുവദിക്കുന്നില്ല, അല്ലെങ്കിൽ മറ്റേതെങ്കിലും പരിപാടികൾ, ഇൻകോർപ്പറേറ്റ് തീർന്നിരിക്കുന്നു;</li>\n<li>ഹാക്ക്, അല്ലെങ്കിൽ സേവനം, കയറി, വൈറസുകൾ ഉൾപ്പെടെയുള്ള ക്ഷുദ്ര കോഡ്, അല്ലെങ്കിൽ ഹാനികരമായ ഡാറ്റ ഇടുക; അഥവാ</li>\n<li>സേവന ഉപയോഗവുമായി ബന്ധപ്പെട്ട് നമ്മുടെ ബൗദ്ധിക സ്വത്തവകാശം ലംഘിക്കുന്നില്ലെന്ന്.</li>\n</ol>\n<p>4.7. നിങ്ങൾക്ക് ഞങ്ങൾ കേവലം ഇതുകണ്ടു കല്പാത്തിയും ഇവ ഉപയോക്തൃ ഉള്ളടക്കം വേണ്ടി ഞങ്ങൾ ഉപയോക്താവ് ഉള്ളടക്കം വിതരണം അല്ലെങ്കിൽ അവതരണത്തിലെ സജീവമായ പങ്കു വഹിക്കുന്നു എന്ന് സേവനമായ സമ്മതിക്കുന്നു. &nbsp;<br /> <br /> 4.8. നാം സേവനത്തിൽ പോസ്റ്റുചെയ്ത ഉപയോക്തൃ ഉള്ളടക്കം നിരീക്ഷിക്കാൻ ബാധ്യതയില്ലാതെ കീഴിൽ ഞങ്ങൾ കഴിയില്ല അത്തരം ഉപയോക്തൃ ഉള്ളടക്കം യാതൊരു ഉത്തരവാദിത്തം ചെയ്യരുത്, ഞങ്ങൾ ചെയ്യാറില്ല, പിന്തുണ അല്ലെങ്കിൽ വഴി പോസ്റ്റ് ചെയ്ത ഉപയോക്തൃ ഉള്ളടക്കം അല്ലെങ്കിൽ ആശയവിനിമയ പൂർണത, കൃത്യത അല്ലെങ്കിൽ വിശ്വാസ്യത ഉറപ്പ് അതിൽ പ്രകടിപ്പിച്ചത് സേവനങ്ങൾ അല്ലെങ്കിൽ അഭിപ്രായങ്ങളും. ഉപയോഗം ഏതെങ്കിലും ഉപയോക്തൃ ഉള്ളടക്കം അല്ലെങ്കിൽ മെറ്റീരിയലുകൾ ആശ്രയിക്കുന്നത് സേവനത്തിലൂടെ ചെയ്തത് അല്ലെങ്കിൽ സേവനത്തിലൂടെ ലഭിച്ച നിങ്ങളുടെ സ്വന്തം ഉത്തരവാദിത്വത്തിൽ ആണ്. &nbsp;<br /> <br /> 4.9. SprintApps, ഉപയോക്തൃ ഉള്ളടക്കം വേണ്ടി ഏതെങ്കിലും വിധത്തിൽ വിനോ ഉൾപ്പെടെ, എന്നാൽ പരിമിതപ്പെടാത്തതുമായ അതിൽ അടങ്ങിയിരിക്കുന്ന ഏതെങ്കിലും പിശകുകൾ അല്ലെങ്കിൽ കഥയിൽ ഏതെങ്കിലും ഉപയോക്തൃ ഉള്ളടക്കം ഉപയോഗം ഫലമായി ഉണ്ടാകുന്ന ഏത് തരത്തിലുള്ള നഷ്ടം അല്ലെങ്കിൽ കേടുപാട് ഇമെയിൽ, ചെയ്തത്, പകരുന്ന വരികയില്ല അല്ലെങ്കിൽ സേവനം വഴി ലഭ്യമായ ഉണ്ടാക്കിയ മറ്റെവിടെയെങ്കിലുമോ പ്രക്ഷേപണം.&nbsp;<br /> <br /> 4.10. ഞങ്ങൾ ഞങ്ങളുടെ സ്വന്തം വിവേചനാധികാരം ഈ നിബന്ധനകളുടെ ഒരു പൊട്ടൽ ഉണ്ടായിരുന്നു എന്നു വിശ്വസിക്കുന്നു, ഞങ്ങൾ ഈ നിബന്ധനകൾ കടന്നുകയറുന്നതിനും സാധ്യത വിശ്വസിക്കുന്നു കാരണങ്ങളുെങ്കിൽ ഉണ്ടെങ്കിൽ, ഞങ്ങൾ സേവന അതിന്റെ സംരക്ഷിക്കാൻ ആവശ്യമാണ് കരുതുന്ന ഏത് നടപടി എടുത്തേക്കും ഉപയോക്താക്കൾ. നാം സേവനം ഉപയോഗിക്കുന്നതിന് നിങ്ങളുടെ വലതു പിൻവലിക്കാൻ സേവനത്തിൽ നിന്ന് നിങ്ങളുടെ ഉപയോക്തൃ ഉള്ളടക്ക നീക്കം, (ഞങ്ങൾ നിങ്ങളുടെ ഉപയോക്തൃ ഉള്ളടക്കം നാശനഷ്ടങ്ങൾക്ക് നൽകേണ്ടിവരും ഉണ്ടായിരുന്നു എങ്കിൽ ഉദാഹരണത്തിന്, ഞങ്ങൾ ആ തുക തിരികെ ലഭിക്കാൻ ക്ലെയിം ചെയ്യും) നിങ്ങളുടെ നേരെ നിയമനടപടികളുമായി എടുത്തു വേണ്ടി ഉചിതമെന്നു മറ്റ് നടപടി.</p>\n<ol start=\"5\">\n<li><strong>സേവന</strong> <strong>ലൈസൻസ്</strong></li>\n</ol>\n<p>ഈ നിബന്ധനകൾക്ക് നിങ്ങളുടെ പാലനം വിധേയമായി സ്പ്രിൻറ് അപ്ലിക്കേഷനുകൾ നിങ്ങൾ ഡൗൺലോഡ് / അല്ലെങ്കിൽ സേവനം ഉപയോഗിക്കുക ഈ നിബന്ധനകൾ, സ്വകാര്യത നയം വിധേയമായി വ്യക്തിപരവും ലോകമെമ്പാടും റോയൽറ്റി-, കൈമാറ്റം അല്ലാത്തതുമായ അനുമതി.</p>\n<p><br /> &nbsp;</p>\n<ol start=\"6\">\n<li><strong>സ്പ്രിന്റ്</strong> <strong>അപ്ലിക്കേഷനുകൾ</strong> <strong>അവകാശങ്ങൾ</strong></li>\n</ol>\n<p>6.1. സേവനത്തിൽ എല്ലാ അവകാശങ്ങളും, തലക്കെട്ടുകളും താൽപ്പര്യങ്ങൾ (ഉള്ളടക്കം ഒഴികെ അപ്ലോഡ് അല്ലെങ്കിൽ ഉപയോക്താക്കൾ ലഭ്യമാക്കുന്നു) ഇവ സ്പ്രിൻറ് അപ്ലിക്കേഷനുകളും അതിന്റെ ലൈസൻസർമാരുമാണ് പ്രത്യേക പ്രോപ്പർട്ടി നിലനിൽക്കും.<br /> <br /> 6.2. സേവന പൊതു എടുക്കുന്നതിനു / ഏതെങ്കിലും റിക്കോര്ഡ് അപ്ലോഡുചെയ്യുന്നതിലൂടെ സ്പ്രിൻറ് അപ്ലിക്കേഷനുകൾ ബന്ധപ്പെട്ട് ലോകമെമ്പാടും, നിങ്ങളുടെ പേരും കൂടെ സേവനം അപ്ലോഡ് ഏത് റിക്കോര്ഡ് ഉപയോഗിക്കാൻ അനിയന്ത്രിത, എക്സ്ക്ലൂസിവല്ല റോയൽറ്റി-, കൈമാറ്റം ലൈസൻസ്, അനുവദിച്ചിരിക്കുന്നു ഈ നിബന്ധനകൾ ഞങ്ങളുടെ സ്വകാര്യതാ നയത്തിന് വിധേയമായിരിക്കും സേവനം.</p>\n<ol start=\"7\">\n<li><strong>പകർപ്പവകാശം</strong><strong>, </strong><strong>റിപ്പോർട്ടുചെയ്യലും</strong> <strong>അറിയിപ്പ്</strong><strong> &amp; </strong><strong>നീക്കംചെയ്യൽ</strong> <strong>നയം</strong></li>\n</ol>\n<p>7.1. സ്പ്രിന്റ് അപ്ലിക്കേഷനുകൾ മറ്റുള്ളവരുടെ ബൌദ്ധിക സ്വത്തവകാശ ബഹുമാനിക്കുന്ന സേവന ഉപയോക്താക്കൾക്ക് ഒരേ പ്രതീക്ഷിക്കുന്നില്ല.&nbsp;<br /> <br /> 7.2. നിങ്ങളുടെ പകർപ്പവകാശം ലംഘിക്കുന്നുവെന്ന് വിശ്വസിക്കുന്നതായി പ്ലാറ്റ്ഫോം ഏതെങ്കിലും ഉള്ളടക്കം കണ്ടെത്താൻ എങ്കിൽ, താഴെ വിവരങ്ങൾ ഉൾപ്പെടെയുള്ള രേഖാമൂലം ഞങ്ങൾക്ക് ഇത് റിപ്പോർട്ട് ചെയ്യുക:</p>\n<ol>\n<li>നിങ്ങളുടെ പകർപ്പവകാശ അല്ലെങ്കിൽ ആരുടെ വേണ്ടി നിങ്ങളെ പ്രവർത്തിക്കാൻ അർഹതയുണ്ട് ഒരു മൂന്നാം കക്ഷിയുടെ പകർപ്പവകാശം ലംഘിക്കുന്നതായി പ്ലാറ്റ്ഫോം ഉള്ളടക്കം കണ്ടെത്തിയിട്ടുണ്ട് ഒരു പ്രസ്താവന;</li>\n<li>നിങ്ങൾ ലംഘിക്കപ്പെട്ടു പകർപ്പവകാശ സൃഷ്ടിയുടെ വിവരണം;</li>\n<li>നിങ്ങൾ ലംഘനം എന്നിവ പ്ലാറ്റ്ഫോം ലംഘനമെന്ന് നിങ്ങൾ ക്ലെയിം ഉള്ളടക്കം കണ്ടെത്തി എവിടെ വിശദാംശങ്ങൾ ക്ലെയിം ചെയ്യുന്ന ഉള്ളടക്കം വിവരണം;</li>\n<li>നിങ്ങളുടെ പൂർണ്ണ പേര്, വിലാസം, ടെലിഫോൺ നമ്പർ നിങ്ങൾ ബന്ധപ്പെടാൻ കഴിയുന്ന ഒരു സാധുവായ ഇമെയിൽ വിലാസം ഉൾപ്പെടെ നിങ്ങളുടെ സമ്പർക്ക വിവരം;</li>\n<li>നിങ്ങൾ മെറ്റീരിയലിന്റെ തർക്കത്തിൽ ഉപയോഗം പകർപ്പവകാശ ഉടമ, ഏജന്റോ നിയമമോ അംഗീകാരം അല്ല ഒരു നല്ല വിശ്വാസം ഉണ്ടെന്ന് നിങ്ങൾക്ക് ഒരു പ്രസ്താവന; ഒപ്പം</li>\n<li>നിങ്ങളുടെ നോട്ടീസ് വിവരങ്ങൾ കൃത്യമാണെന്നും നിങ്ങൾ നിയമലംഘനം ആരോപിക്കപ്പെട്ടിരിക്കുന്ന സമ്പൂർണ അവകാശത്തിന്റെ ഉടമയ്ക്ക് വേണ്ടി പ്രവർത്തിക്കാൻ അംഗീകൃതമായ എന്നും നിങ്ങൾക്ക് ഒരു പ്രസ്താവന.</li>\n</ol>\n<p>ഇന്ത്യൻ ഡിജിറ്റൽ മില്ലേനിയം പകർപ്പവകാശ നിയമം അനുസരിച്ച് ഒരു നോട്ടീസ് പരിഗണിക്കരുത് നിങ്ങളുടെ അറിയിപ്പ് ഉദ്ദേശിക്കുന്നതെങ്കിൽ കൂടാതെ,, താഴെ ഉൾപ്പെടുത്തുക:</p>\n<ol>\n<li>നിങ്ങൾ ഉടമയോ നിയമലംഘനം ആരോപിക്കപ്പെട്ടിരിക്കുന്ന എക്സ്ക്ലൂസീവ് പകർപ്പവകാശ ഉടമയുടെ വേണ്ടി പ്രവർത്തിക്കാൻ അനുമതിയുണ്ടെങ്കിലോ ആ അറിയാവുന്നത് അനുസരിച്ച് ഒരു പ്രഖ്യാപനം; ഒപ്പം</li>\n<li>(ഒരു സ്കാൻ പകർപ്പ് സാധ്യതയുള്ള) നിങ്ങളുടെ ഇലക്ട്രോണിക്ക് ഒപ്പ് അല്ലെങ്കിൽ.</li>\n</ol>\n<p>7.3. നിങ്ങളുടെ നോട്ടീസ് ഇമെയിൽ വഴി ഞങ്ങൾക്ക് അല്ലെങ്കിൽ ഞങ്ങളുടെ നിയുക്ത പകർപ്പവകാശ ഏജന്റിന് അയക്കണം <a href=\"mailto:copyright@dubsmash.com\">പകർപ്പവകാശ @</a> <span style=\"text-decoration: underline;\">sprintapps.in</span> അല്ലെങ്കിൽ ഇനിപ്പറയുന്ന വിലാസത്തിലേക്ക് മെയിലിൽ:<br /> <br /> സ്പ്രിന്റ് അപ്ലിക്കേഷനുകൾ പ്രൈവറ്റ് ലിമിറ്റഡ്.,&nbsp;<br /> ഫസ്റ്റ് ഫ്ലോർ, H.NO. 8-2-269 / 19 / എസ് / 1,</p>\n<p>റോഡ് ഇല്ല. 2 ബഞ്ചാര ഹില്സ്, ഹൈദരാബാദ് 500 034, തെലുങ്കാന, ഇന്ത്യ<br /> ശ്രദ്ധിക്കുക: പകർപ്പവകാശ ടീം&nbsp;<br /> <br /> 7.4. നിങ്ങൾക്ക് ലഭിക്കുന്ന അല്ലെങ്കിൽ കണ്ടുമുട്ടുന്നത് നിങ്ങൾ സേവനത്തിലൂടെ നിന്ദ്യവും കാണുന്നതു റെക്കോർഡിംഗുകളും അല്ലെങ്കിൽ മറ്റ് ഉള്ളടക്കം, അല്ലെങ്കിൽ ഒരു ഉപയോക്താവിനെ ഈ നിബന്ധനകൾ / അല്ലെങ്കിൽ സ്വകാര്യതാ നയം ലംഘിച്ച് വിശ്വസിക്കുന്നെങ്കിൽ, ഞങ്ങൾ നേരിട്ട് ഉചിതമായ ഉപയോക്താവിനെ ബന്ധപ്പെടുന്നതിൽ ഒരു പരസ്പരം സുഖദമായ പരിഹാരം എത്താൻ ശ്രമിക്കുന്ന ശുപാർശ . ഈ തൃപ്തികരമായ ഫലമാണ് കാരണമാകുന്നു ചെയ്യുന്നില്ലെങ്കിൽ, ഇമെയിൽ വഴി ഞങ്ങൾക്ക് അത് റിപ്പോർട്ടുചെയ്യുക <a href=\"mailto:copyright@dubsmash.com\">പകർപ്പവകാശ @</a> പ്രസക്തമായ റെക്കോർഡിംഗ് ന്റെ \"റിപ്പോർട്ട്\" ലിങ്ക് വഴി സേവനം ലഭ്യമാണ് രേഖപ്പെടുത്തുന്ന ഒരു മുഴക്കം ബന്ധപ്പെട്ട് എങ്കിൽ <span style=\"text-decoration: underline;\">sprintapps.in</span> അല്ലെങ്കിൽ.</p>\n<p>&nbsp;</p>\n<ol start=\"8\">\n<li><strong>പരസ്യം</strong></li>\n</ol>\n<p>ഞങ്ങൾ സേവന ഉപയോഗവുമായി അരികിലായി നിങ്ങൾക്ക് പരസ്യം ഏല്പിച്ചുകൊടുപ്പാൻ.</p>\n<ol start=\"9\">\n<li><strong>സ്വകാര്യത</strong></li>\n</ol>\n<p>നിങ്ങൾ സ്പ്രിൻറ് Apps ലേക്ക് വിതരണം ആ വിവരങ്ങൾ വ്യക്തിഗത ഡാറ്റ ഉൾപ്പെടാം നിങ്ങളുടെ വിവരങ്ങൾ ഞങ്ങളുടെ ശേഖരണവും ഉപയോഗ നിയന്ത്രിക്കുന്നു നമ്മുടെ സ്വകാര്യതാ നയം, വിധേയമായിരിക്കും.സേവന ചൂടോടെ ഭാഗമായി ഞങ്ങൾ സേവന അറിയിപ്പുകൾ ഭരണ സന്ദേശങ്ങൾ ചില ആശയവിനിമയങ്ങൾ, നിങ്ങള്ക്ക് നല്കാന് വന്നേക്കാം. ഈ ദൃഷ്ടാന്തങ്ങൾ ഒഴിവാക്കുമ്പോൾ ലേക്ക് സ്വീകരിക്കുന്നതിനെ കഴിഞ്ഞേക്കില്ല സേവനങ്ങളുടെ ഭാഗമായി കരുതുന്ന.</p>\n<ol start=\"10\">\n<li><strong>മൂന്നാം</strong> <strong>കക്ഷി</strong> <strong>സേവനങ്ങൾ</strong></li>\n</ol>\n<p>സേവനം അടങ്ങിയ ഒരു മൂന്നാം കക്ഷി ലഭ്യമാക്കുന്ന (മുഖം പുസ്തകവും വാട്സ് പോലുള്ള സോഷ്യൽ അപേക്ഷകൾ എന്നിവയുൾപ്പെടെ എന്നാൽ പരിമിതപ്പെടുത്തിയിരിക്കുന്നു) സവിശേഷതകളും സേവനങ്ങൾ ലിങ്കുകൾ.ഇത്തരം മൂന്നാം കക്ഷി സൈറ്റുകൾ അല്ലെങ്കിൽ സേവനങ്ങൾ നിയന്ത്രിക്കുന്നില്ല അത്തരം സൈറ്റുകൾ അല്ലെങ്കിൽ സേവനങ്ങൾ ഉള്ളടക്കം അല്ലെങ്കിൽ പ്രവർത്തനക്ഷമത ഉത്തരവാദിത്തം എന്തു. കണ്ണികളുടെ നമ്മുടെ ഉൾപ്പെടുത്തൽ അവരുടെ ഓപ്പറേറ്റർമാർ ഏതെങ്കിലും എൻഡോഴ്സ്മെന്റ് അല്ലെങ്കിൽ അസോസിയേഷൻ അർത്ഥമില്ല. അത്തരം മൂന്നാം കക്ഷി സേവനങ്ങളുടെ ഉപയോഗം ബാധകമായ നിബന്ധനകൾ ബാധകമാകും ഞങ്ങൾ അവരുടെ സേവനം നിങ്ങളുടെ ഉപയോഗം ബന്ധപ്പെട്ട് നിങ്ങൾക്ക് അല്ലെങ്കിൽ മൂന്നാം കക്ഷി സേവന ദാതാവ് നടക്കുന്ന യാതൊന്നിലും ഉത്തരവാദിത്തം കഴിയില്ല.</p>\n<ol start=\"11\">\n<li><strong>അവസാനിപ്പിക്കല്</strong></li>\n</ol>\n<p>11.1. നാം അവസാനിപ്പിക്കുകയോ നിങ്ങളുടെ ഉപയോഗിക്കുന്നത് സേവന ലഭ്യത ഏതു സമയത്തും ഏതു കാരണത്താലും, നമ്മുടെ സ്വന്തം വിവേചനാധികാരം ചെയ്യാം. അത്തരം സസ്പെൻഷൻ ഇല്ലാതാക്കുന്നതിലോ ഞങ്ങൾ ഉചിതമായ കരുതുന്ന നിങ്ങൾക്കു വിരോധമായി മറ്റേതെങ്കിലും നടപടിയെടുക്കാൻ ഞങ്ങളുടെ വലതു പരിമിതപ്പെടുത്തുകയോ അല്ല. &nbsp;<br /> <br /> 11.2. സേവനം ഉപയോഗിക്കാൻ ശ്രദ്ധയോടെ / അല്ലെങ്കിൽ നിങ്ങളുടെ ഉപാധി നിന്നുള്ള അപ്ലിക്കേഷൻ ഇല്ലാതാക്കുന്നത് ഏതു സമയത്തും സേവനം ഉപയോഗിക്കുന്നത് അവസാനിപ്പിക്കാം. ഒരു ഉപകരണം നിന്നുള്ള അപ്ലിക്കേഷൻ ഇല്ലാതാക്കുന്നത് നിങ്ങളുടെ പ്രൊഫൈൽ ഇല്ലാതാക്കാൻ, നിങ്ങൾ അപ്ലോഡ് ഏതെങ്കിലും റിക്കോര്ഡ് Pakodi കാറ്റലോഗ് ശേഷിക്കും, ദയവായി ശ്രദ്ധിക്കുക.നിങ്ങളുടെ പ്രൊഫൈൽ ഇല്ലാതാക്കാൻ ആഗ്രഹിക്കുന്നുവെങ്കിൽ, ചെയ്തത് എഴുതി ഞങ്ങളെ ബന്ധപ്പെടുക <a href=\"mailto:contact@sprintapps.in\">contact@sprintapps.in</a><br /> <br /> 11.3. ഒന്നുകിൽ പാർട്ടി അത്തരം അവസാനിപ്പിക്കലിൽ, ഈ നിബന്ധനകൾ ഇല്ലാതാക്കും, പക്ഷേ താഴെപ്പറയുന്ന വ്യവസ്ഥകൾ ബാധകമായി തുടരും: സെക്ഷനുകൾ 3, 4, 6, 7, 9, 10, 11, 12, 13, 14.</p>\n<ol start=\"12\">\n<li><strong>പ്രതിനിധാനങ്ങളും</strong> <strong>ഉറപ്പുകളും</strong></li>\n</ol>\n<p>12.1. നീ ഞങ്ങളെ ആ വാഗ്ദാനം:</p>\n<ol>\n<li>നിങ്ങളുടെ ഉപയോക്തൃ ഉള്ളടക്കം, ഏതെങ്കിലും ബൌദ്ധിക സ്വത്തവകാശ ഉൾപ്പെടെ സ്വകാര്യത രഹസ്യാത്മകമായ വിവരങ്ങൾ അല്ലെങ്കിൽ അവകാശങ്ങൾ അവകാശങ്ങൾ ഏതെങ്കിലും മൂന്നാം കക്ഷിയുടെ അവകാശങ്ങൾ ലംഘിക്കാതിരിക്കുക ചെയ്യും;</li>\n<li>നിങ്ങൾ ഉപയോക്തൃ ഉള്ളടക്കം രംഗത്ത് പ്രത്യക്ഷപ്പെടുന്ന വ്യക്തികൾ നിന്ന് ആവശ്യമായ എല്ലാ അനുമതികളും സമ്മതിക്കുന്ന പ്രാപിച്ചു; ഒപ്പം</li>\n<li>നിങ്ങളുടെ ഉപയോക്തൃ ഉള്ളടക്കം ഈ നിബന്ധനകൾ പാലിക്കേണ്ടതാണ്.</li>\n</ol>\n<p>12.2. ഈ നിബന്ധനകളുടെ വിഭാഗം 13 വിധേയമായി, ഞങ്ങൾ ന്യായമായും അവയും അത്തരം മുറിവു തെറ്റുപറ്റി എവിടെ ഈ നിബന്ധനകളിലെ നിങ്ങൾ ഏതെങ്കിലും പൊട്ടൽ ഫലമായി ഈടാക്കുന്നതിനിടയാക്കാം ഏതെങ്കിലും നഷ്ടം അല്ലെങ്കിൽ ചെലവുകളും ഞങ്ങളെ നഷ്ടപരിഹാരം സമ്മതിക്കുന്നു. ഈ നിബന്ധനകളുടെ നിന്റെ മുറിവു നമ്മുടെ അശ്രദ്ധ അല്ലെങ്കിൽ ഈ നിബന്ധനകളുടെ നമ്മുടെ മുറിവു നിന്നും ഉരുത്തിരിയുന്നതാണ് പക്ഷം ഈ വിഭാഗം കീഴിൽ ഞങ്ങളെ നഷ്ടപരിഹാരം ആവശ്യമാണ് ചെയ്യില്ല.</p>\n<ol start=\"13\">\n<li><strong>നിരാകരണങ്ങൾ</strong> <strong>പരിമിതികളും</strong></li>\n</ol>\n<p>13.1. സേവനം ഉപയോഗിക്കുന്നത് \"അത് കാണുന്നതുപോലെ\" \"ലഭ്യമായ\" അടിസ്ഥാനത്തിൽ എ.എൻ. ഉണ്ട്. സേവനത്തിൽ സേവനവും ഏതെങ്കിലും ഉള്ളടക്കം അല്ലെങ്കിൽ മെറ്റീരിയൽ അതിൻറെ കൃത്യത, അനുയോജ്യമായ, പൂർണതയ്ക്കും അല്ലെങ്കിൽ വിശ്വാസ്യത എന്ന് വ്യക്തമാക്കുന്ന എന്തെങ്കിലും ഉറപ്പുമില്ല, അവസ്ഥകളെ അല്ലെങ്കിൽ വാറണ്ടി കൂടാതെ വകയിരുത്തുന്നു. ഞങ്ങൾ സേവനം ബഹുതല അല്ലെങ്കിൽ പരാജയം നിങ്ങളോട് ബാധ്യസ്ഥരായിരിക്കുന്നതല്ലെന്ന് ചെയ്യില്ല. &nbsp;<br /> <br /> 13.2. നാം വ്യവസ്ഥകൾ ഈ CONTRAVENTION ഏതെങ്കിലും വ്യക്തി സേവനം ഇടയുളള നഷ്ടം അല്ലെങ്കിൽ കേടുപാട് നമ്മുടെ ബാധ്യതയോ ഒഴിവാക്കുകയോ. നിങ്ങൾ സിസറോ, ശബ്ദ റെക്കോർഡിങ്ങുകൾ, സേവന ലഭ്യമായ മറ്റേതെങ്കിലും ഉള്ളടക്കത്തിൻറെയും, അത് ഉപയോക്താക്കളുടെ അമേരിക്കൻ നൽകുന്നതുമാണ് ഗ്രഹിച്ച്, ഞങ്ങൾ സേവനം ഈ ഉള്ളടക്കം നിങ്ങളോട് ഉത്തരവാദിത്തമോ LIABILE അല്ല. &nbsp;<br /> <br /> 13.3. നാം പ്രകടമായി ന്യായമായും അമേരിക്കൻ ബൈ മുൻകൂട്ടി ഏത് ലാഭത്തിനുണ്ടാകുന്ന ഉൾപ്പെടെയുള്ള ഇതുമായി ബന്ധപ്പെട്ട, ഉള്ള നിങ്ങൾ കാരണം ആകുന്നു ഏതെങ്കിലും ബാധ്യത (എ) നഷ്ടം അല്ലെങ്കിൽ കേടുപാട് ഒഴിവാക്കുകയോ; (ബി) ഈ നിബന്ധനകൾ നിങ്ങളുടെ ലംഘനം ഫലമായി നിങ്ങൾ കാരണം ഏതെങ്കിലും നഷ്ടം അല്ലെങ്കിൽ കേടുപാട്. &nbsp;<br /> <br /> 13.4. നിയമം അനുവദിക്കുന്ന പരമാവധി ചെറിയ നാം ബാധകമായ എന്തെങ്കിലും ക്ലെയിം നടപടി അല്ലെങ്കിൽ പടി രൂപത്തിൽ, നിങ്ങൾക്ക് ഏതെങ്കിലും നഷ്ടം അല്ലെങ്കിൽ കേടുപാട് വേറെ ഏതെങ്കിലും കക്ഷി ബാധ്യസ്ഥരായിരിക്കുന്നതല്ലെന്ന് സമ്മതിക്കുകയും ചെയ്യുന്നു. നിങ്ങൾക്ക് ഞങ്ങളുടെ ഏത് തർക്കത്തിനും നിങ്ങളുടെ സ്വന്തം മാത്രം പ്രത്യേകമായ പരിഹാരത്തിന്റെ സേവനം ഉപയോഗിക്കുന്നത് അവസാനിപ്പിക്കാൻ സമ്മതിക്കുന്നു. &nbsp;<br /> <br /> 13.5. ഈ നിബന്ധനകളിൽ ഒന്നും ഞങ്ങളുടെ ബാധ്യത പരിമിതപ്പെടുത്തുന്നു അല്ലെങ്കിൽ അകറ്റിനിർത്താൻ (i) മരണം അല്ലെങ്കിൽ ഞങ്ങളുടെ വീഴ്ച വ്യക്തിപരമായ പരിക്ക്; (ശശ) കല്പിച്ചുകൂട്ടിയ പ്രവൃത്തികളെ, വഞ്ചന അല്ലെങ്കിൽ വഞ്ചനാപരമായ തെറ്റായി; (iii) നിയമപ്രകാരം വാദങ്ങളെ പരിമിതമായിരിക്കും കഴിയാത്ത മറ്റേതെങ്കിലും ബാധ്യത.</p>\n<ol start=\"14\">\n<li><strong>അവസാനിപ്പിക്കല്</strong></li>\n</ol>\n<p>ഞങ്ങൾ സേവനം നൽകാൻ വിരമിക്കുകയാണെങ്കിൽ നാം ഈ നിബന്ധനകൾ അവസാനിപ്പിക്കുകയും നോട്ടീസ് ഏതൊരു സമയത്തും നിങ്ങളുടെ അക്കൗണ്ട് അടയ്ക്കാവുന്നതാണ്.</p>\n<ol start=\"15\">\n<li><strong>മറ്റ്</strong> <strong>നിബന്ധനകൾ</strong></li>\n</ol>\n<p>15.1. സ്പ്രിന്റ് അപ്ലിക്കേഷനുകൾ, സ്ഥാപിക്കുന്നു സബ് കരാർ / അല്ലെങ്കിൽ ഏതെങ്കിലും കമ്പനി, ഉറച്ച അല്ലെങ്കിൽ വ്യക്തിക്ക് ഈ നിബന്ധനകൾ പ്രകാരം നമ്മുടെ അവകാശങ്ങൾ / അല്ലെങ്കിൽ ചുമതലകളും ഏതെങ്കിലും അല്ലെങ്കിൽ എല്ലാ ട്രാൻസ്ഫർ ചെയ്യാം.നിങ്ങൾ മറ്റാർക്കും ഈ നിബന്ധനകൾ പ്രകാരം നിങ്ങളുടെ അവകാശങ്ങൾ അല്ലെങ്കിൽ ചുമതലകളും കൈമാറ്റം പാടില്ല. &nbsp;<br /> <br /> 15.2. ഈ നിബന്ധനകളുടെ വകുപ്പുകൾ ഓരോ വെവ്വേറെ പ്രവർത്തിക്കുന്നുണ്ട്. ഈ നിബന്ധനകളിൽ ഏതെങ്കിലും വകുപ്പ് നിയമവിരുദ്ധമായി അപ്രായോഗികമെന്നോ ആയിരിക്കാൻ നടക്കുന്ന സാഹചര്യത്തിൽ, ആ വ്യവസ്ഥകൾ പരിമിതമായിരിക്കും അല്ലെങ്കിൽ ആവശ്യമായ മിനിമം പരിധിവരെ ഇല്ലാതാക്കാം ഈ അവശേഷിക്കുന്ന വ്യവസ്ഥകൾ പൂർണ്ണമായ ശക്തിയിലും പ്രാബല്യത്തിൽ തുടരും. &nbsp;<br /> <br /> 15.3. ഈ നിബന്ധനകൾ ഞങ്ങളുടെ സ്വകാര്യത നയം ഞങ്ങളെ തമ്മിലുള്ള സമ്പൂർണ കരാർ എല്ലാ മുൻപ് ഒപ്പം കാലത്തുള്ളവയാണ് ഉടമ്പടികൾ അല്ലെങ്കിൽ ആശയവിനിമയങ്ങൾ ലംഘിക്കുന്ന. &nbsp;<br /> <br /> 15.4. ഈ നിബന്ധനകൾ പാർട്ടി അല്ല യാതൊരാളും അതിൽ ഒട്ടും കാലാവധി നടപ്പിലാക്കുന്നില്ല ചെയ്യാം. &nbsp;<br /> <br /> 15.5. ഈ നിബന്ധനകളും നിന്നു അല്ലെങ്കിൽ അല്ലെങ്കിൽ (നോൺ-കരാർ തർക്കങ്ങൾ ക്ലെയിമുകൾ ഉൾപ്പെടെ) അവയുടെ വിഷയ അല്ലെങ്കിൽ രൂപീകരണം നിയന്ത്രിക്കുന്നത് ഇന്ത്യൻ നിയമം അനുസരിച്ച് കരുതേണ്ടതാണ് കക്ഷികളും ബന്ധപ്പെട്ട് ഉണ്ടാകുന്ന എന്തെങ്കിലും തർക്കം അല്ലെങ്കിൽ ക്ലെയിം താഴെ അധികാരപരിധിയിൽ സമർപ്പിക്കുമെന്ന് ഏതെങ്കിലും ക്ലെയിം നിലനിർത്തും അല്ലെങ്കിൽ ഈ നിബന്ധനകൾ അല്ലെങ്കിൽ (നോൺ-കരാർ തർക്കങ്ങൾ ക്ലെയിമുകൾ ഉൾപ്പെടെ) അവയുടെ വിഷയ അല്ലെങ്കിൽ രൂപീകരണത്തിന് ബന്ധപ്പെട്ട് ഉണ്ടാകുന്ന പ്രശ്നമില്ല ഇന്ത്യൻ കോടതികൾ.</p>\n<p><strong>ഫലപ്രദമായി</strong><strong>: 2015 </strong><strong>ആഗസ്ത്</strong></p>',2,'2015-07-24 16:03:47'),(11,6,'About Us - Hindi','<p><strong><span style=\"color: #ff0000;\">Pakodi (पकौड़ी) के बारे में </span></strong></p>\n<p>वो दिन चले गए जब लंबी-लंबी उबाऊ और नीरस बातचीत हुआ करती थी।</p>\n<p>आजकल कई कुशल ऐप्&zwj;स के आने पर, अपने प्रियजनों और दोस्&zwj;तों से होने वाली बातचीत ने एक बिल्&zwj;कुल नया ही रूप ले लिया है। अब, बातचीत में मौजूद कोई \'खास\' खूबी जितनी ज्&zwj;़यादा असरदार होती है, उसे बोलने वाले को उतना ही ज्&zwj;़यादा समझदार माना जाता है।</p>\n<p>Pakodi (पकौड़ी) अपनी श्रेणी में एक अलग तरह का डिस्&zwj;कवरी प्&zwj;लेटफ़ॉर्म है जिसमें वन लाइनर, फिल्&zwj;मों के डायलॉग, कॉमेडी क्लिप्&zwj;स और आपकी पसंदीदा कोई भी चीज़ मौजूद है। अब आप ऑडियो क्लिप भेज सकते हैं, वीडियो रिकॉर्ड कर सकते हैं और फिल्&zwj;म या साउंड क्लिप के ऊपर अपनी आवाज़ डब भी कर सकते हैं। Pakodi (पकौड़ी) की मदद से आप ये सारी चीज़ें सोशल मीडिया प्&zwj;लेटफ़ॉर्म जैसे Whatsapp, Google+, Facebook, Twitter आदि पर शेयर कर सकते हैं।</p>',1,'2015-07-24 16:06:15'),(12,6,'Terms and Conditions - Hindi','<p>(समय-समय पर अद्यतन के रूप में, <strong>\"</strong><strong>शर्तें</strong><strong>\")</strong> सेवा की इन शर्तों को अपने उपयोग को नियंत्रित और <strong>Pakodi</strong> सेवा के उपयोग (नीचे के रूप में परिभाषित) और अपलोड किए गए किसी भी ध्वनि रिकॉर्डिंग, वीडियो, जानकारी, पाठ, ग्राफिक्स या अन्य सामग्री सामग्री, डाउनलोड की गई या सेवा पर ​​दिखाई दे।ध्यान से डाउनलोड करने या सेवा का उपयोग करने से पहले इन नियमों को पढ़ें। इन नियमों को स्वीकार करने, या सेवा का उपयोग करके, आप उनके द्वारा बाध्य होने के लिए सहमत हैं। आप हमारे नियमों समझ में नहीं आता, या उनमें से किसी भी हिस्से को स्वीकार नहीं करते हैं, तो आप इस सेवा का उपयोग नहीं करना चाहिए। (: ईमेल सेवा जिसका जगह व्यापार के हैदराबाद, भारत में है स्प्रिंट एप्प्स प्राइवेट लिमिटेड <strong>(\"</strong><strong>हम</strong><strong>\", \"</strong><strong>हमें</strong><strong>\" \"</strong><strong>हमारे</strong><strong>\"</strong> और <strong>\"SprintApps\")</strong> द्वारा प्रदान की गई है <a href=\"mailto:contact@sprintapps.in)\">contact@sprintapps.in)</a> ।</p>\n<p><strong>1</strong><strong>।</strong> <strong>सेवा</strong></p>\n<p>सर्विस एंड्रॉयड और आईओएस संस्करणों में उपलब्ध है, जो मोबाइल आवेदन <strong>\"Pakodi\"</strong> के रूप में उपलब्ध है</p>\n<p><strong>2</strong><strong>।</strong> <strong>परिवर्तन</strong> <strong>और</strong> <strong>अपडेट</strong></p>\n<p>2.1। हम किसी भी बदलाव को प्रतिबिंबित करने के लिए समय-समय पर इन नियमों को अद्यतन कर सकते हैं: (i) हमारी नीतियों या प्रासंगिक कानूनों में; (Ii) इस सेवा की कार्यक्षमता में; या (iii) किसी भी तीसरे पक्ष के आपूर्तिकर्ताओं द्वारा हम पर थोपा। किसी भी अद्यतन सेवा में खाते में अपनी उचित हितों ले जाएगा और परिवर्तन प्रभावी होने से पहले एक उचित समय के भीतर आपको ईमेल से सूचित किया जाएगा। परिवर्तन पूर्वव्यापी लागू नहीं होगा और वे आप को सूचित किया जाता है के बाद अद्यतन शर्तें प्रभावी हो जाएगा। आप नई शर्तों के साथ सहमत नहीं है, तो आप इस सेवा का उपयोग बंद कर देना चाहिए। वे आप को सूचित किया जाता है के बाद आप एक उचित समय के भीतर नई शर्तों पर आपत्ति नहीं है, तो अद्यतन शर्तें आपके द्वारा स्वीकार कर लिया समझा रहे हैं। हम नियमों और अधिसूचना ईमेल में समझा स्वीकृति के लिए संशोधन पर आपत्ति करने का विकल्प पर प्रकाश डाला जाएगा। &nbsp;<br /> <br /> 2.2। हम वापस लेने के नीचे ले या किसी भी समय पर सेवा पर ​​उपलब्ध सामग्री के सभी या सेवा का हिस्सा है और सभी या भाग में संशोधन करने का अधिकार सुरक्षित रखते हैं, उदाहरण के लिए, कानून या नए तकनीकी विकास के लिए परिवर्तन को प्रतिबिंबित।कोई भी परिवर्तन खाते में अपनी उचित हितों ले जाएगा। सेवा की सभी या भाग तक पहुंच मरम्मत, रखरखाव या अद्यतन करने के लिए अनुमति देने के लिए समय-समय पर प्रतिबंधित किया जा सकता है। यह आपको नवीनतम संस्करण को डाउनलोड करने और किसी भी नई शर्तें स्वीकार कर लिया है, जब तक आप इस सेवा का उपयोग करने में सक्षम नहीं किया जा रहा हो सकता है।</p>\n<p><strong>3</strong><strong>।</strong> <strong>सेवा</strong> <strong>की</strong> <strong>पहुँच</strong><strong> / </strong><strong>प्रयोग</strong> <strong>करें</strong></p>\n<p>3.1। वाई कहां, एक खाता बनाने, एप्लिकेशन डाउनलोड करके सेवा का उपयोग सुनने चयनित ऑडियो क्लिप को Pakodi सूची से, और कहा कि ऑडियो क्लिप के संबंध में एक वीडियो रिकॉर्डिंग कर सकते हैं।यह एक <strong>\"</strong><strong>डब</strong><strong>\"</strong> बनाने, वीडियो के साथ जोड़ा जा रहा ऑडियो क्लिप में परिणाम होगा।बताती है आपके उपकरण के स्थानीय स्मृति में जमा हो जाती है और इस तरह के फेस बुक, ट्विटर, WhatsApp और Google+ के रूप में कुछ तीसरे पक्ष के सेवाओं के माध्यम से अपने संपर्कों के साथ साझा किया जा सकता है।</p>\n<p>3.2। इस सेवा का उपयोग करने के लिए आपको अठारह (18) साल पुराने या पुराने होना चाहिए। इस सेवा का उपयोग करके आप इन नियमों और स्वीकार करते हैं कि हमें वादा करता हूँ कि: (क) यदि आप 18 वर्ष की उम्र या अधिक है, या (ख) आप पर 13 वर्ष की उम्र या कर रहे हैं और अपने माता पिता से इस सेवा का उपयोग करने की अनुमति कर रहे हैं या कानूनी अभिभावक। हम यथोचित आप पर्याप्त रूप से इन मानदंडों को पूरा नहीं करते मानना ​​है कि अगर आप उम्र के स्वीकार्य सबूत के साथ हमें प्रदान की है, जब तक हम इस सेवा का उपयोग निलंबित कर सकते हैं। &nbsp;<br /> <br /> 3.3। हम अपने बच्चों को सर्विस 18 के तहत बच्चों के लिए इरादा नहीं है पता होना चाहिए कि सेवा का उपयोग करने की अनुमति है जो माता-पिता को सलाह। सर्विस पर उपलब्ध कराया सामग्री उत्पन्न \"Pakodi\" भी शामिल होंगे उपयोगकर्ता से है और बच्चों के लिए उपयुक्त नहीं हो सकता।<br /> <br /> 3.4। सर्विस पर कुछ कार्यों का उपयोग करने के लिए आप हमारे साथ रजिस्टर करने की आवश्यकता होगी। रजिस्टर करने के लिए, आप अपना नाम, मोबाइल नंबर, ईमेल पता, उम्र के साथ हमें प्रदान करनी चाहिए।आपका एन AME आप सेवा करने के लिए अपलोड किसी भी सामग्री के साथ दिखाई देंगे।आप अपना नाम इन नियमों का अनुपालन सुनिश्चित करना चाहिए कि।<br /> <br /> 3.5। आप हमें और इस तरह की गतिविधि आपके द्वारा अधिकृत किया गया था, या नहीं, आपके खाते पर जगह लेता है कि किसी भी गतिविधि के साथ अपने खाते के लिए जिम्मेदार हैं।आप हमें प्रदान विवरण सही हैं कि यह सुनिश्चित करने के लिए और तिथि करने के लिए रखा जाना चाहिए।आप हमारे साथ पंजीकरण करते समय आप उपलब्ध कराई गई जानकारी में कोई भी परिवर्तन के बारे में हमें सूचित करना चाहिए। &nbsp;<br /> <br /> 3.6। हम सुरक्षा का उल्लंघन वहाँ की गई है, यदि हम बिना किसी पूर्व सूचना, फिर या अपने accountand सेवा के आपके उपयोग के निषेध को अक्षम, निलंबित या अपने खाते को हटाने, रद्द करने का अधिकार सुरक्षित रखते हैं या गतिविधियों के अपने खाते पर होते हैं तो हमें विश्वास है कि इन नियमों का उल्लंघन।<br /> <br /> 3.7। सेवा की है और उपयोग करने के लिए प्रवेश एक युक्ति संगत और इंटरनेट कनेक्शन की आवश्यकता है। हम सर्विस विभिन्न उपकरणों के पार संगत है कि यह सुनिश्चित करने के लिए काम कर रहे हैं, हम सेवा सभी उपकरणों के साथ काम करेंगे गारंटी नहीं दे सकते। सर्विस वर्तमान में एक वीडियो कैमरा समारोह के साथ smartphones की आवश्यकता है, स्पेयर भंडारण क्षमता और चल रहा है या तो (या बाद में) एंड्रॉयड 4.3 या (या बाद में) iOS7 ऑपरेटिंग सिस्टम के 30MB।</p>\n<p>3.8। यह आपके डिवाइस इन आवश्यकताओं का अनुपालन सुनिश्चित करना है कि आपकी जिम्मेदारी है। सेवा के आपके उपयोग (आपके उपकरण, इंटरनेट सहित डिवाइस और इसे इस्तेमाल करता है और स्प्रिंट एप्प्स अपने उपकरणों की वजह से है कि कार्यक्षमता के किसी भी कमी के लिए कोई जिम्मेदारी स्वीकार करता है कि ऑपरेटिंग सिस्टम के प्रकार के आधार पर कार्यक्षमता, उपलब्धता और गुणवत्ता में भिन्न हो सकते हैं कनेक्शन, ऑपरेटिंग सिस्टम या सेटिंग और सॉफ्टवेयर)।<br /> <br /> 3.9। यह सेवा का उपयोग करते समय आप अपने ऊपर लेना हो सकता है कि सभी लागत और खर्च के लिए भुगतान करने की जिम्मेदारी है (सहित, लेकिन, सभी टेलीफोन कॉल या लाइन शुल्क या इंटरनेट डाटा सेवा का उपयोग शुल्क के लिए सीमित नहीं है)।</p>\n<p><strong>4</strong><strong>।</strong> <strong>उपयोगकर्ता</strong> <strong>जनित</strong> <strong>विषय</strong></p>\n<p>4.1। आप एक साथ (केवल सेवा और किसी भी रिकॉर्डिंग <strong>(\"</strong><strong>वीडियो</strong> रिकॉर्डिंग\") के अपने उपयोग के लिए जिम्मेदार बताती, शब्द, आप अपलोड करने के लिए या सेवा के माध्यम से बनाने की जानकारी है कि, संदेश और अन्य कोई भी सामग्री, निजी तौर पर प्रेषित या चाहे सार्वजनिक रूप से उपलब्ध कराया जाता है <strong>\"</strong><strong>प्रयोक्ता</strong> <strong>सामग्री</strong><strong>\")</strong><strong>।आप</strong> <strong>अपने</strong> <strong>प्रयोक्ता</strong> <strong>सामग्री</strong> <strong>का</strong> <strong>स्वामित्व</strong> <strong>रखने।</strong> &nbsp;<br /> <br /> 4.2। आप सेवा करने के लिए अपलोड किए गए वीडियो रिकॉर्डिंग सेवा के अन्य उपयोगकर्ताओं को सार्वजनिक किया जाता है।अपलोड करके, आप समझते हैं और अपने नाम के प्रत्येक रिकॉर्डिंग के संबंध में सार्वजनिक किया जाएगा कि इस बात से सहमत हैं और आप रिकॉर्डिंग के सिलसिले में अपने नाम का उपयोग प्रदर्शित करने और अन्यथा करने का अधिकार स्प्रिंट Apps और हमारे सहयोगियों कि अनुदान।<br /> <br /> 4.3। आप सेवा के संबंध में रखना है कि किसी भी बताती है / वीडियो के लिए स्थानीय स्तर पर जमा हो जाती है और आप के द्वारा सार्वजनिक किया जब सर्विस पर अपलोड कर रहे<br /> <br /> 4.4। आप समझते हैं और सेवा और प्रयोक्ता सामग्री के उपयोग के संबंध में सभी लागू कानूनों का पालन करने के लिए सहमत हैं। &nbsp;<br /> <br /> 4.5। आप हर समय अपने प्रयोक्ता सामग्री नहीं करता है यह सुनिश्चित करेगा कि:</p>\n<ol>\n<li>कॉपीराइट, व्यापार चिह्न के अधिकार, गोपनीय जानकारी या गोपनीयता के अधिकारों सहित किसी भी तीसरे पक्ष के अधिकारों का उल्लंघन करता है कि किसी भी सामग्री, सूचना या सामग्री शामिल;</li>\n<li>किसी लागू कानून का उल्लंघन;</li>\n<li>को बढ़ावा देता है या हिंसा, आतंकवाद या किसी भी अन्य अवैध गतिविधियों को प्रोत्साहित करती है या परेशान, परेशान होने की संभावना है, जो है, जो अश्लील, यौन स्पष्ट, आक्रामक, अपमानजनक, निंदात्मक, अपमानजनक, अपमानजनक, बदमाशी, भेदभावपूर्ण, अश्लील, हिंसक है कि किसी भी सामग्री या सामग्री शामिल , अलार्म, असुविधा को नीचा दिखाने या किसी भी व्यक्ति को परेशान;</li>\n<li>किसी भी तरह से बढ़ावा देने या करने या किसी भी गैरकानूनी या आपराधिक गतिविधि या असामाजिक व्यवहार करने में सहायता, या दूसरों की सुरक्षा या भलाई खतरे में पड़ सकता है, जो गतिविधियों को प्रोत्साहित करने के लिए किसी को उत्तेजित करना;</li>\n<li>वे उम्र के 18 वर्ष से कम कर रहे हैं, अगर उनकी सहमति के बिना किसी भी व्यक्ति, या उनके माता-पिता या कानूनी अभिभावक की सहमति की पहचान;</li>\n<li>किसी की व्यक्तिगत संपर्क विवरण का खुलासा या उनकी गोपनीयता पर आक्रमण;</li>\n<li>किसी भी वायरस या अन्य दुर्भावनापूर्ण या हानिकारक प्रोग्राम होते हैं; या</li>\n<li>किसी भी विज्ञापन या प्रचार संदेश को शामिल करें।</li>\n</ol>\n<p><br /> 4.6। इसके अलावा, आप समझते हैं और आप करते हैं या करते हैं या ऐसा करने के लिए प्रयास करने के लिए किसी भी तीसरे पक्ष ऐसा करने का प्रयास करें, या कारण नहीं होगा सहमत हैं कि सेवा के आपके उपयोग के संबंध में निम्न में से किसी भी:</p>\n<ol>\n<li>स्पष्ट रूप से इन नियमों और सेवा की सामान्य कार्यक्षमता द्वारा अनुमति के अलावा अन्य सेवा पर ​​उपलब्ध सर्विस या प्रयोक्ता सामग्री का उपयोग करें;</li>\n<li>जैसे क्रेडिट कार्ड नंबर, खाता पासवर्ड आदि के रूप में, दूसरे लोगों की निजी और / या गोपनीय जानकारी प्रेषित .;</li>\n<li>एक गैर-कानूनी ढंग से या इन शर्तों के साथ असंगत किसी भी तरीके से, किसी भी अवैध उद्देश्य के लिए सेवा का उपयोग करें;</li>\n<li>अभिनय करना या सेवा के आपके उपयोग के माध्यम से किसी और के होने का नाटक;</li>\n<li>सेवा, हमारे सिस्टम या सुरक्षा या अन्य उपयोगकर्ताओं के साथ हस्तक्षेप, पल्ला झुकना, अक्षम नुकसान पहुंचा ख़राब या समझौता कर सकता है कि एक तरह से सेवा का उपयोग करें;</li>\n<li>निकालने, डाउनलोड, सूचकांक, मेरा है, परिमार्जन, प्रतिलिपि या प्रस्तुति, ऑपरेशन या सेवा के उद्देश्य का उपयोग करें या किसी भी सुविधाओं को नाकाम करने के लिए, चाहे वह स्वयं या स्वतः, सहित, लेकिन स्क्रिप्ट, मकड़ियों और रोबोट तक ही सीमित नहीं है, किसी भी कार्यक्रम या अन्य साधनों का उपयोग या इसे का काम करता है;</li>\n<li>नकल, संशोधित करने, सेवा के किसी भी भाग के साथ हस्तक्षेप अन्यथा डिकंपाइल या;</li>\n<li>के लिए परिवर्तन, या के संशोधनों के, सेवा के पूरे या भाग बनाने के लिए, या सेवा या इसके किसी भी हिस्से को अनुमति देने के साथ संयुक्त हो, या, में किसी भी अन्य कार्यक्रमों में शामिल हो;</li>\n<li>में हैक, या, सेवा में वायरस, या हानिकारक डेटा सहित दुर्भावनापूर्ण कोड, सम्मिलित; या</li>\n<li>इस सेवा का उपयोग करने के संबंध में हमारी बौद्धिक संपदा उल्लंघन।</li>\n</ol>\n<p>4.7। आप स्वीकार करते हैं और हम केवल एक निष्क्रिय नाली और प्रयोक्ता सामग्री की मेजबानी के लिए सेवा कर रहे हैं कि इस बात से सहमत है और कहा कि हम प्रयोक्ता सामग्री के वितरण या प्रस्तुति में कोई सक्रिय भूमिका निभाते हैं। &nbsp;<br /> <br /> 4.8। हम प्रयोक्ता सामग्री सेवा पर पोस्ट की निगरानी के लिए कोई दायित्व के अधीन हैं और हम और ऐसे प्रयोक्ता सामग्री के लिए कोई जिम्मेदारी नहीं लेते हैं नहीं कर सकते, न ही हम समर्थन का समर्थन या माध्यम से पोस्ट किसी भी प्रयोक्ता सामग्री या संचार की पूर्णता, सटीकता या विश्वसनीयता की गारंटी है सेवा या राय उसमें व्यक्त किया। किसी भी प्रयोक्ता सामग्री या सामग्री सर्विस के माध्यम से पोस्ट या सेवा के माध्यम से आपके द्वारा प्राप्त की पर प्रयोग अथवा रिलायंस को अपने जोखिम पर है। &nbsp;<br /> <br /> 4.9। SprintApps, किसी भी त्रुटि या चूक उसमें निहित, या पोस्ट की किसी भी प्रयोक्ता सामग्री के उपयोग का एक परिणाम के रूप में किए गए किसी भी प्रकार का कोई भी नुकसान या क्षति सहित प्रयोक्ता सामग्री, के लिए किसी भी तरह से जिम्मेदार नहीं है, लेकिन सीमित नहीं करेगा, ईमेल, प्रेषित या अन्यथा सेवा के माध्यम से उपलब्ध कराया गया या कहीं और प्रसारण।&nbsp;<br /> <br /> 4.10। हम अपने विवेकाधिकार में, इन नियमों का उल्लंघन किया गया है कि विश्वास करते हैं, या हम आप इन नियमों का उल्लंघन करने की संभावना है कि विश्वास करने के लिए उचित आधार है, तो हम लगता है कि हम किसी भी कार्रवाई की सेवा और रक्षा के लिए आवश्यक है लग सकता है इसके उपयोगकर्ताओं। हम (हम वापस कि राशि पाने के लिए दावा करेंगे क्योंकि हम अपने प्रयोक्ता सामग्री का हर्जाना अदा करने के लिए किया है, उदाहरण के लिए), सेवा का उपयोग सेवा से अपने प्रयोक्ता सामग्री हटाने के लिए, आप के खिलाफ कानूनी कार्यवाही लेने के लिए अपने अधिकार वापस ले सकते हैं और अन्य कार्रवाई हम उपयुक्त समझे।</p>\n<p><strong>5</strong><strong>।</strong> <strong>सेवा</strong> <strong>की</strong> <strong>लाइसेंस</strong></p>\n<p>इन शर्तों के साथ अपने अनुपालन के अधीन, स्प्रिंट एप्प्स आप इन शर्तों और गोपनीयता नीति के अधीन सेवा, डाउनलोड और / या उपयोग करने के लिए एक व्यक्तिगत, वैश्विक, रॉयल्टी-मुक्त, अहस्तांतरणीय और गैर अनन्य लाइसेंस प्रदान करता है।</p>\n<p><br /> &nbsp;</p>\n<p><strong>6</strong><strong>।</strong> <strong>स्प्रिंट</strong><strong> Apps </strong><strong>का</strong> <strong>अधिकार</strong></p>\n<p>6.1। सभी अधिकार, शीर्षक और सेवा में और करने के हितों (छोड़कर अपलोड की गई सामग्री या अन्यथा उपयोगकर्ताओं द्वारा प्रदान की) कर रहे हैं और स्प्रिंट Apps और उसके लाइसेंसदाताओं के अनन्य संपत्ति रहेगा।<br /> <br /> 6.2। / अपलोड कर सेवा करने के लिए लोक में किसी भी रिकॉर्डिंग करने से, आप के सिलसिले में एक दुनिया भर में, आप अपने नाम के साथ-साथ सेवा करने के लिए अपलोड क