ामाजिक अनुप्रयोगों के लिए सीमित सहित, लेकिन नहीं) सुविधाओं और सेवाओं के लिए लिंक।हम ऐसे तृतीय पक्ष साइटों या सेवाओं पर नियंत्रण नहीं है और ऐसी साइटों या सेवाओं की सामग्री या कार्यक्षमता के लिए जिम्मेदार नहीं हैं। लिंक की हमारी शामिल किए जाने के उनके ऑपरेटरों के साथ किसी भी बेचान या संघ संकेत नहीं करता है। ऐसे तीसरे पक्ष के सेवाओं का उपयोग करने के लिए लागू नियम लागू होगा और हम उनकी सेवा के अपने उपयोग के संबंध में आप या तीसरे पक्ष सेवा प्रदाता द्वारा किया जाता है कि कुछ के लिए जिम्मेदार नहीं होगा।</p>\n<p><strong>1 1</strong><strong>।</strong> <strong>समाप्ति</strong></p>\n<p>11.1। हम निलंबित या अपने विवेकाधिकार में, किसी भी समय और किसी भी कारण से सेवा करने के लिए अपने के उपयोग और पहुँच समाप्त कर सकता है। इस तरह के निलंबन या समाप्ति हम उचित विचार है कि आप के खिलाफ किसी भी अन्य कार्रवाई करने के अपने अधिकार को सीमित नहीं किया जाएगा। &nbsp;<br /> <br /> 11.2। आप अपने डिवाइस से अनुप्रयोग सेवा का उपयोग करने के लिए बंद करके और / या हटाने के द्वारा किसी भी समय इस सेवा का उपयोग समाप्त कर सकता है। अपने प्रोफ़ाइल और आप Pakodi सूची पर रहेगा अपलोड कर दिया है कि किसी भी रिकॉर्डिंग को नष्ट नहीं होगा एक डिवाइस से अनुप्रयोग को हटाने, कृपया ध्यान दें।आप अपने प्रोफाइल को मिटाना चाहते हैं, पर लिखित रूप में कृपया हमसे संपर्क करें <a href=\"mailto:contact@sprintapps.in\">contact@sprintapps.in</a><br /> <br /> 11.3। या तो पार्टी द्वारा इस तरह के समापन की स्थिति में, इन शर्तों को समाप्त होगा, लेकिन निम्नलिखित प्रावधानों को लागू करने के लिए जारी रहेगा: धारा 3, 4, 6, 7, 9, 10, 11, 12, 13 और 14।</p>\n<p><strong>12</strong><strong>।</strong> <strong>अभ्यावेदन</strong> <strong>और</strong> <strong>वारंटी</strong></p>\n<p>12.1। आप हमें लगता है कि वादा करता हूँ:</p>\n<ol>\n<li>किसी बौद्धिक संपदा अधिकार, गोपनीय जानकारी या एकांत में अधिकारों में अधिकारों सहित किसी भी तीसरे पक्ष के अधिकारों, उल्लंघन नहीं होगा अपने प्रयोक्ता सामग्री;</li>\n<li>आप प्रयोक्ता सामग्री में प्रदर्शित होने के किसी भी व्यक्ति से सभी आवश्यक अनुमतियों और सहमति प्राप्त की है; और</li>\n<li>अपने प्रयोक्ता सामग्री इन शर्तों का अनुपालन करेगा।</li>\n</ol>\n<p>12.2। इन नियमों की धारा 13 के अधीन रहते हुए, आप हम यथोचित और काफी आप इस तरह के उल्लंघन के लिए गलती पर हैं, जहां इन नियमों की आप के द्वारा किसी भी उल्लंघन का एक परिणाम के रूप में उठाना हो सकता है किसी भी नुकसान या खर्च के लिए हमें क्षतिपूर्ति करने के लिए सहमत हैं। यदि आप इन शर्तों की अपनी उल्लंघन हमारी लापरवाही या इन नियमों के बारे में हमारी उल्लंघन के बाहर पड़ी तो इस धारा के तहत हमें क्षतिपूर्ति करने की आवश्यकता नहीं होगी।</p>\n<p><strong>13</strong><strong>।</strong> <strong>अस्वीकरण</strong> <strong>और</strong> <strong>सीमाएं</strong></p>\n<p>13.1। सेवा के आपके उपयोग करें और \"के रूप में उपलब्ध\" आधार \"जैसा है\" एक पर है। सेवा पर ​​प्रदर्शित सेवा और किसी भी सामग्री या सामग्री इसकी शुद्धता, उपयुक्तता, संपूर्णता या विश्वसनीयता के बारे में कोई गारंटी देता है, स्थितियों या वारंटी के बिना दी जाती है। हम सेवा की अनुपलब्धता या विफलता के लिए आपके प्रति उत्तरदायी नहीं किया जाएगा। &nbsp;<br /> <br /> 13.2। हम स्पष्ट रूप से इन शर्तों के उल्लंघन में किसी भी व्यक्ति द्वारा सेवा के उपयोग से उत्पन्न किसी भी नुकसान या क्षति के लिए हमारा दायित्व को बाहर निकालें। आप बताती है, सेवा पर ​​उपलब्ध ध्वनि रिकॉर्डिंग और अन्य कोई भी सामग्री अमेरिका उपयोगकर्ताओं नहीं द्वारा प्रदान की गई है समझते हैं, और हम सेवा पर ​​इस सामग्री के लिए आप न ज़िम्मेदार या LIABILE हैं। &nbsp;<br /> <br /> 13.3। हम स्पष्ट रूप से किसी भी दायित्व के लिए (ए) किसी भी नुकसान या अमेरिका द्वारा यथोचित निकट नहीं था कि और लाभ की हानि सहित सेवा के संबंध में आपके द्वारा किए गए है जो क्षति बहिष्कार नहीं; और (ख) किसी नुकसान या क्षति इन शर्तों की अपनी उल्लंघन का एक परिणाम के रूप में आपके द्वारा हुई। &nbsp;<br /> <br /> 13.4। कानून द्वारा अनुमत अधिकतम सीमा तक, हम भले ही किसी भी दावे की कार्रवाई या आधार के फार्म का, आप या किसी भी हानि या नुकसान के लिए किसी अन्य पार्टी के लिए उत्तरदायी नहीं होगा। आप स्वीकार करते हैं और अमेरिका के साथ किसी भी विवाद के लिए अपने एकमात्र और अनन्य उपाय सेवा के आपके उपयोग को समाप्त करने का मानना ​​है कि। &nbsp;<br /> <br /> 13.5। सीमा या के लिए हमारे दायित्व बहिष्कार नहीं करेगा इन नियमों में कुछ भी नहीं है: (i) की मौत या हमारे लापरवाही से उत्पन्न व्यक्तिगत चोट; (Ii) में जानबूझकर कार्य करता है, धोखाधड़ी या धोखाधड़ी गलत बयानी; और (iii) को बाहर रखा गया है या कानून द्वारा सीमित नहीं किया जा सकता है कि किसी भी अन्य देयता।</p>\n<p><strong>14</strong><strong>।</strong> <strong>समाप्ति</strong></p>\n<p>हम इन शर्तों को समाप्त कर और हम सेवा प्रदान करने के लिए संघर्ष करते हैं, तो सूचना के बिना किसी भी समय अपने खाते को बंद कर सकता है।</p>\n<p><strong>15</strong><strong>।</strong> <strong>अन्य</strong> <strong>निबंधन</strong></p>\n<p>15.1। स्प्रिंट एप्लिकेशन, असाइन उप अनुबंध और / या अन्यथा किसी भी कंपनी, फर्म या व्यक्ति के लिए इन नियमों के तहत हमारे अधिकार और / या दायित्वों के किसी एक या सभी हस्तांतरण कर सकते हैं।तुम किसी और को इन नियमों के तहत अपने अधिकारों या दायित्वों के हस्तांतरण नहीं हो सकता है। &nbsp;<br /> <br /> 15.2। इन नियमों के प्रावधानों में से प्रत्येक को अलग से चल रही है। इन नियमों के प्रावधानों के किसी भी गैरकानूनी या लागू न करने के लिए आयोजित कर रहे हैं कि घटना में, उन प्रावधानों को सीमित किया जाएगा या न्यूनतम सीमा के लिए आवश्यक का सफाया कर दिया है, और इन शर्तों के शेष प्रावधान पूरी शक्ति और प्रभाव में रहेगा। &nbsp;<br /> <br /> 15.3। ये नियम और हमारी गोपनीयता नीति आप और हम दोनों के बीच पूरे समझौते का गठन और सभी पूर्व और समकालीन समझौतों या संचार वृथा। &nbsp;<br /> <br /> 15.4। इन शर्तों में पार्टी नहीं है जो कोई व्यक्ति इसके किसी भी अवधि के लागू हो सकता है। &nbsp;<br /> <br /> 15.5। ये नियम और किसी भी विवाद या (गैर अनुबंधीय विवाद या दावों सहित) के बाहर या इसे या इसकी विषय-वस्तु या गठन के संबंध में उत्पन्न होने वाले दावे द्वारा शासित है और भारतीय कानून के अनुसार लगाया और पार्टियों इसके द्वारा अनन्य क्षेत्राधिकार के लिए प्रस्तुत किया जाएगा भारतीय अदालतों के किसी भी दावे का निपटान या इन नियमों या (गैर अनुबंधीय विवाद या दावों सहित) अपने विषय या गठन के संबंध में उत्पन्न होने वाली कोई बात करने के लिए।</p>\n<p><strong>प्रभावी</strong><strong>: </strong><strong>अगस्त</strong><strong> 2015</strong></p>',2,'2015-07-24 16:06:15');
