DROP TABLE IF EXISTS `tbl_content`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `tbl_content` (
  `content_id` int(11) NOT NULL AUTO_INCREMENT,
  `master_content_id` int(11) NOT NULL,
  `content_type` tinyint(4) NOT NULL COMMENT '1=video,2=audio',
  `recommend_type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '1=trends, 2=recommends',
  `contentowner_id` int(11) NOT NULL,
  `unique_code` varchar(125) NOT NULL,
  `title` varchar(100) CHARACTER SET utf8 NOT NULL,
  `short_desc` text CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `category_id` int(11) NOT NULL,
  `parental_advisory` varchar(125) NOT NULL COMMENT 'ALL,PG,13+,16+,18+',
  `language_id` int(11) NOT NULL,
  `contentclip_filename` varchar(255) NOT NULL,
  `search_keywords` text CHARACTER SET utf8 COLLATE utf8_unicode_ci,
  `thumb_filename` varchar(255) NOT NULL,
  `movie_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `main_artist` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `sub_artists` text CHARACTER SET utf8 COLLATE utf8_unicode_ci,
  `film_director` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `music_director` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `dialog_writer` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `content_expirydate` date DEFAULT NULL,
  `content_activationdate` date NOT NULL,
  `contentlike_count` int(11) NOT NULL,
  `contentshare_count` int(11) NOT NULL,
  `contentdownload_count` int(11) NOT NULL,
  `content_rating` int(11) NOT NULL,
  `contentplay_count` int(11) NOT NULL,
  `dub_count` int(11) NOT NULL,
  `clip_length` varchar(50) NOT NULL,
  `copyright` varchar(255) DEFAULT NULL,
  `content_status` tinyint(4) NOT NULL DEFAULT '1',
  `recommend_sort` int(11) NOT NULL,
  `datecreated` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`content_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3963 DEFAULT CHARSET=latin1;
