  `dubplay_count` int(11) NOT NULL,
  `clip_length` varchar(50) NOT NULL,
  `isdub_moderate` tinyint(4) NOT NULL COMMENT '0=not moderate,1=moderate',
  `moderatedby` int(11) NOT NULL,
  `moderatedon` datetime NOT NULL,
  `datecreated` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `dub_status` tinyint(4) NOT NULL,
  `thumb_filename` varchar(255) NOT NULL,
